INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_accelerated_kind', 2, E'Slightly deforming landslip erosion', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_accelerated_kind', 3, E'Water erosion', E'Soil removal by running water.', E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_accelerated_kind', 4, E'Gully erosion', E'Gully erosion is the consequence of water that cuts down into the soil along the line of water concentration and flow.  The resulting channels cannot be obliterated by ordinary tillage operations. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_accelerated_kind', 5, E'Rill erosion', E'Rill erosion is the removal of soil through the cutting of many small, but conspicuous channels where runoff concentrates.  The channels are shallow enough that they can be obliterated with normal tillage operations. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_accelerated_kind', 6, E'Sheet erosion', E'The more or less uniform removal of soil from an area without the development of conspicuous water channels. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_accelerated_kind', 7, E'Tunnel erosion', E'The removal of soil by the formation of subsurface tunnels (often referred to as piping).  Free water enters the soil through macropores such as large desication cracks or rodent burrows. The tunnels tend to enlarge and coelesce.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_accelerated_kind', 8, E'Wind and water erosion', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_accelerated_kind', 9, E'Wind erosion', E'Deflation by wind.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_class', 1, E'None - deposition', E'No apparent erosion has occurred.  Deposition of soil sediment removed from other areas may have occurred.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_class', 2, E'Class 1', E'The soil has lost on the average <25% of the original A and/or E horizons, or of the uppermost 20 cm if the original A and/or E horizons were less than 20 cm thick. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_class', 3, E'Class 2', E'The soil has lost, on the average, 25 to 75 percent of the original A and/or E horizons, or of the uppermost 20 cm if the original A and/or E horizons were less than 20 cm thick.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_class', 4, E'Class 3', E'The soil has lost, on the average, more than 75 percent of the original A and/or E horizon, or of the uppermost 20 cm if the original A and/or E horizons were less than 20 cm thick. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'erosion_class', 5, E'Class 4', E'The soil has lost all of the original A and/or E horizons, or the uppermost 20 cm if the original A and/or E horizons were less than 20 cm thick.  Some of the orginal underlying material may have also been removed. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'excavation_difficulty_class', 1, E'Low', E'Excavations can be made with a spade using arm-applied pressure only.  Neither application of impact energy nor application of foot pressure is necessary.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'excavation_difficulty_class', 2, E'Moderate', E'Excavation can be accomplished quite easily by application of impact energy with a spade or by foot applied pressure.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'excavation_difficulty_class', 3, E'High', E'Excavation with a spade can be accomplished with difficulty. Excavation is easily possible with a full length pick, using an over-the-head swing.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'excavation_difficulty_class', 4, E'Very high', E'Excavation with a full length pick using an over-the-head swing is moderately to markedly difficult.  Excavation is possible in a reasonable period of time with a backhoe mounted on a 40 to 60 kW (50-80 hp) tractor.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'excavation_difficulty_class', 5, E'Extremely high', E'Excavation cannot be accomplished in a resonable time period with a  backhoe mounted on a 40 to 60 kW (50-80 hp) tractor.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'export_certification_status', 1, E'not certified', E'The legend and data mapunits to be included in the export file have been appropriately populated, at least in part, but have not been reviewed or certified.  These are advance data, subject to change.  \r\n\r\nThis certification applies to the whole export package as a single entity.', E'No');
