INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'export_certification_status', 3, E'fully certified', E'The legend and data mapunits to be included in the export file have been appropriately populated, reviewed, and certified for general use.\r\n\r\nThis certification applies to the whole export package as a single entity.', E'No');
