INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fl_soil_leaching_potential', 1, E'Low', E'Slowest permeability is 0.6 in/hr or less.  Soils with a muck/peat layer are rated "low".', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fl_soil_leaching_potential', 2, E'Medium', E'Slowest permeability is between 0.6 and 6.0 in/hr.  Soils with a mucky layer are rated "medium" unless the soil has a slowest permeability of less than 0.6 in/hr.  Then the soil is rated "low".', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fl_soil_leaching_potential', 3, E'High', E'Slowest permeability is 6.0 in/hr or more.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fl_soil_runoff_potential', 1, E'Low', E'Soils with a hydrological group of A, and soils with a hydrological group of B (in their natural, undrained state) that have a permeability of 6.0 in/hr or greater in all of the upper 20 inches of the soil.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fl_soil_runoff_potential', 2, E'Medium', E'Soils with a hydrological group of C, and soils with a hydrological group of B (in their natural, undrained state) that have a permeability of less than 6.0 in/hr within 20 inches of the soil surface.  Soils that rate low are changed to a rating of medium where the slope is more than 12 percent.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fl_soil_runoff_potential', 3, E'High', E'Soils with a hydrological group of D in their natural, undrained state.  Soils that are frequently flooded during the growing season are rated high.  Soils that rate medium are changed to a rating of high where the slope is more than 8 percent.', E'No');
