INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'flooding_frequency_class', 2, E'Very rare', E'Flooding is very unlikely but is possible under unusual weather conditions; less than 1 percent chance in any year (less than 1 time in 100 years, but more than 1 time in 500 years).', E'No');
