INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'flooding_frequency_class', 7, E'Very frequent', E'Flooding is likey to occur very often under usual weather conditions; more than 50 percent chance in all months of any year.', E'No');
