INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fragment_kind', 23, E'Chert fragments', E'A hard, extremely dense or compact, dull to semivitreous, cryptocrystalline sedimentary rock, consisting dominantly of interlocking crystals of quartz less than about 30 mm in diameter; it may contain amorphous silica (opal).  It sometimes contains impurities such as calcite, iron oxide, or the remains of silicious and other organisims.  It has a tough, splintery to conchoidal fracture and may be white or variously colored gray, green, blue, pink, red, yellow, brown, and black.  Chet  occurs principally as nodular or concretionary segregations in limestones and dolomites.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fragment_kind', 24, E'Cinders', E'Uncemented vitric, vesicular, pyroclastic material, more than 2.0 mm in at least one dimension, with an apparent specific gravity (including vesicles) of more than 1.0 and less than 2.0.  Compare - ash [volcanic], block [volcanic], lapilli, tephra.', E'No');
