INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fragment_kind', 141, E'Sedimentary rock fragments', E'A consolidated deposit of clastic particles, chemical precipitates, and organic remains accumulated at or near the surface of the earth under "normal" low temperature and pressure conditions.  Sedimentary rocks include consolidated equivalents of alluvium, colluvium, drift, and eolian, lacustrine, marine deposits; e.g., sandstone, siltstone, mudstone, clay-stone, shale, conglomerate, limestone, dolomite, coal, etc.', E'No');
