INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fragment_roundness', 1, E'Very angular', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fragment_roundness', 2, E'Angular', E'Strongly developed faces with sharp edges (SSM).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fragment_roundness', 3, E'Subangular', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fragment_roundness', 4, E'Subrounded', E'Detectable flat faces with well-rounded corners (SSM).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fragment_roundness', 5, E'Rounded', E'Flat faces absent or nearly absent with all corners rounded (SSM).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fragment_roundness', 6, E'Well rounded', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fragment_shape', 1, E'Flat', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'fragment_shape', 2, E'Nonflat', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_flat', 1, E'Flat', E'default choice, official choices to be determined later', E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_flat', 2, E'Dip', E'A geomorphic component (characteristic piece) of flat plains (e.g., lake plain, low coastal plain, low-relief till plain) consisting of a shallow and typically closed depression that tends to be an area of focused groundwater recharge but not a permanent water body and that lies slightly lower and is wetter than the adjacent talf, and favors the accumulation of fine sediments and organic materials.  SW', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_flat', 3, E'Rise', E'A geomorphic component of flat plains (e.g., lake plain, low coastal plain, low-gradient till plain) consisting of a slightly elevated but low, broad area with low slope gradients (e.g. 1-3 % slopes); typically a microfeature but can be fairly extensive.  Commonly soils on a rise are better drained than those on the surrounding talf.  Compare - talf.  SW', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_flat', 4, E'Talf', E'A geomorphic component of flat plains (e.g., lake plain, low coastal plain, low-gradient till plain) consisting of an essentially flat (e.g. 0-1 % slopes) and broad area dominated by closed depressions and a non-integrated or poorly integrated drainage system.  Precipitation tends to pond locally and lateral transport is slow both above and below ground, which favors the accumulation of soil organic matter and a retention of fine earth sediments; better drained soils are commonly adjacent to drainageways.  Compare - rise.  SW', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_hill', 1, E'Interfluve', E'An elevated area between two drainageways that sheds water to those drainageways.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_hill', 2, E'Head Slope', E'The concave surface at the head of a drainageway where the flow of water converges downward toward the center and contour lines form concave curves.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_hill', 3, E'Nose Slope', E'The projecting end of an interfluve, where contour lines connecting the opposing side slopes form convex curves around the projecting end and lines perpendicular to the contours diverge downward.  Overland flow of water is divergent.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_hill', 4, E'Side Slope', E'The slope bounding a drainageway and lying between the drainageway and the adjacent interfluve.  It is generally linear along the slope width and overland flow is parallel down the slope.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_hill', 5, E'Base Slope', E'A geomorphic component of hills consisting of the concave to linear slope (perpendicular to the contour) which, regardless of the lateral shape is an area that forms an apron or wedge at the bottom of a hillside dominated by colluvial and slope wash processes and sediments (e.g., colluvium and slope alluvium).  Distal base slope sediments commonly grade to, or interfinger with, alluvial fills, or gradually thin to form pedisediment over residuum.  Compare - head slope, side slope, nose slope, interfluve, free face.  SW', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_hill', 6, E'Crest', E'A geomorphic component of hills consisting of the convex slopes (perpendicular to the contour) that form the narrow, roughly linear top area of a hill, ridge, or other upland where shoulders have converged to the extent that little or no summit remains; dominated by erosion, slope wash and mass movement processes and sediments (e.g., slope alluvium, creep).  Commonly, soils on crests are more similar to those on side slopes than to soils on adjacent interfluves.  Compare - interfluve, head slope, side slope, nose slope.  SW', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_hill', 7, E'Free face', E'The part of a hillside or mountainside consisting of an outcrop of bare rock (scarp or cliff) that sheds colluvium to slopes below and commonly stands more steeply than the angle of repose of the colluvial slope (e.g. talus slope) immediately below. SW &  GG', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_hill', 8, E'Crested hills', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_mountain', 1, E'Mountaintop', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_mountain', 2, E'Mountainflank', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_mountain', 3, E'Mountainbase', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_mountain', 4, E'Upper third of mountainflank', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_mountain', 5, E'Center third of mountainflank', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_mountain', 6, E'Lower third of mountainflank', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_mountain', 7, E'Free face', E'The part of a hillside or mountainside consisting of an outcrop of bare rock (scarp or cliff) that sheds colluvium to slopes below and commonly stands more steeply than the angle of repose of the colluvial slope (e.g. talus slope) immediately below. SW &  GG', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_terrace', 1, E'Riser', E'The vertical or steeply sloping surface, commonly one of a series, of natural steplike landforms, as those of a glacial stairway or of successive stream terraces.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'geomor_pos_terrace', 2, E'Tread', E'The flat or gently sloping surface of natural step-like landforms, commonly one of a series, such as successive stream terraces.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'hillslope_profile', 1, E'Summit', E'The topographically highest hillslope position of a hillslope profile and exhibiting a nearly level (planar or only slightly convex) surface.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'hillslope_profile', 2, E'Shoulder', E'The hillslope position that forms the uppermost inclined surface near the top of a hillslope.  If present, it comprises the transition zone from backslope to summit.  The surface is dominantly convex in profile and erosional in origin.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'hillslope_profile', 3, E'Backslope', E'The hillslope profile position that forms the steepest and generally linear, middle portion of the slope.  In profile, backslopes are commonly bounded by a convex shoulder above and a concave footslope below.  They may or may not include cliff segments (i.e. free faces).  Backslopes are commonly erosional forms produced by mass movement, colluvial action, and running water.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'hillslope_profile', 4, E'Footslope', E'The hillslope position that forms the inner, gently inclined surface at the base of a hillslope.  In profile, footslopes are commonly concave.  It is a transition zone between upslope sites of erosion and transport (shoulder, backslope) and downslope sites of deposition (toeslope).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'hillslope_profile', 5, E'Toeslope', E'The hillslope position that forms the gently inclined surface at the base of a hillslope.  Toeslopes in profile are commonly gentle and linear, and are constructional surfaces forming the lower part of a hill-slope continuum that grades to valley or closed-depression floors.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 1, E'a', E'Highly decomposed organic matter. This symbol is used with O to indicate the most highly decomposed organic materials, which have a rubbed fiber content of less than 17 percent of the volume.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 2, E'b', E'Buried genetic horizon.  This symbol is used in mineral soils to indicate identifiable buried horizons with major genetic features that were developed before burial.  Genetic horizons may or may not have formed in the overlying material, which may be either like or unlike the assumed parent material of the buried soil.  This symbol is not used in organic soils or to separate an organic from a mineral layer.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 3, E'c', E'Concretions or nodules. This symbol indicates a significant accumulation of concretions or nodules.  Cementation is required, but the cementing agent is not specified, except that it cannot be silica.  This symbol is not used if the concretions or nodules consist of dolomite or calcite or more soluble salts, but it is used if the nodules or concretions are enriched with minerals that contain iron, aluminum, manganese, or titanium.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 4, E'ca', E'An accumulation of carbonates.', E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 5, E'co', E'Used only with the master designation L to indicate a layer dominated by coprogenous material.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 6, E'd', E'Physical root restriction.  This symbol indicates root-restricting layers in naturally occurring or man-made unconsolidated sediments or materials, such as dense basal till, plow pans, and other mechanically compacted zones.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 7, E'di', E'Used only with the master designation L to indicate a layer dominated by diatomaceous earth.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 8, E'e', E'Organic material of intermediate decomposition.  This symbol is used with O to indicate organic materials of intermediate decomposition.  Their rubbed fiber content is 17 to 40 percent (by volume).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 9, E'f', E'Frozen soil or water.  This symbol indicates that a horizon or layer contains permanent ice.  The symbol is not used for seasonally frozen layers or for so-called dry permafrost (material that is colder than OC but does not contain ice).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 10, E'ff', E'Dry permafrost.  Used in layers or horizons that are colder than 0 degrees C, but do not contain ice.  It is not used for layers or horizons that have seasonal temperatures below 0 degrees C.  The f suffix is used for layers or horizons that contain permanent ice.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 11, E'g', E'Strong gleying.  This symbol indicates either that iron has been reduced and removed during soil formation, or that saturation with stagnant water has preserved it in a reduced state.  Most of the affected layers have a chroma of 2 or less, and many have redox concentrations.  The low chroma can represent either the color of reduced iron or the color of uncoated sand and silt particles from which iron has been removed.  The symbol g is not used for materials of low chroma that have no history of wetness, such as some shales or E horizons.  If g is used with B, pedogenic change in addition to gleying is implied.  If no other pedogenic change besides gleying has taken place, the horizon is designated Cg.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 12, E'h', E'Illuvial accumulation of organic matter.  This symbol is used with B to indicate the accumulation of illuvial, amorphous, dispersible organic-matter-sesquioxide complexes if the sesquioxide component is dominated by aluminum but is present only in very small quantities.  The organo-sesquioxide material coats sand and silt particles.  In some horizons, these coatings have coalesced, filled pores, and cemented the horizon.  The symbol h is also used in combination with s as "Bhs" if the amount of sesquioxide component is significant but the color value and chroma, moist, of the horizon is 3 or less.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 13, E'i', E'Slightly decomposed organic material.  This symbol is used with O to indicate the least decomposed of the organic materials.  Its rubbed fiber content is 40 percent or more (by volume).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 14, E'j', E'Indicates an accumulation of jarosite.  Jarosite is a potassium or sodium iron sulfate mineral that is commonly an alteration product of pyrite upon exposure in an oxidizing environment.  In tidal marshes it is associated with extreme acidity.  Jarosite is easily recognized by its yellowish apperance, often a hue of 2.5Y or yellower and a chroma of 6 or more, although chroma as low as 3 or 4 have been reported.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 15, E'jj', E'Indicates evidence of cyroturbation.  Cryoturbation includes frost stirring, freezing and thawing, and mounding and fissuring.  Soils with cryoturbation often feature thermokarst, ground-ice formation, and patterned ground.  Cryoturbation commonly is manifested by irregular and broken boundaries, sorting of rock fragments, and organic matter in the lower boundaries, especially along the boundary between the active layer and the permafrost table.  The jj suffix can be used with master horizons A, B, or C.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 16, E'k', E'Accumulation of secondary carbonates.  This symbol indicates accumulations of visible pedogenic calcium carbonate (less than 50 % by vol). Carbonate accumulations occurs as carbonate filaments, coatings, masses, nodules, disseminated carbonate, or other forms.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 17, E'kk', E'Engulfment of horizon by secondary carbonates. This symbol indicates major accumulations of pedogenic calcium carbonate. The kk suffix is used when the soil fabric is plugged with fine-grained pedogenic carbonate (50 % or more by vol) that occurs as an essentially continuous medium. The kk suffix corresponds to the Stage III plugged horizon or higher of the carbonate morphogenetic stages.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 18, E'm', E'Cementation or induration.  This symbol indicates continuous or nearly continuous cementation.  It is used only for horizons that are more than 90 percent cemented, although they may be fractured.  The cemented layer is physically root-restrictive.  The predominant cementing agent (or the two dominant cementing agents) may be indicated by using defined letter suffixes, singly or in pairs.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 19, E'ma', E'Used only with the master designation L to indicate a layer dominated by marl.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 20, E'n', E'Accumulation of sodium.  This symbol indicates an accumulation of exchangeable sodium.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 21, E'o', E'This symbol indicates a residual accumulation of sesquioxides.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 22, E'p', E'Tillage or other disturbance.  This symbol indicates a disturbance of the surface layer by mechanical means, pasturing, or similar uses.  A disturbed organic horizon is designated Op.  A disturbed mineral horizon is designated Ap even though it is clearly a former E, B, or C horizon.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 23, E'q', E'Accumulation of silica.  This symbol indicates an accumulation of secondary silica.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 24, E'r', E'Weathered or soft bedrock.  This symbol is used with C to indicate root-restrictive layers of saprolite such as weathered igneous rock, or of soft bedrock such as partly consolidated sandstone, siltstone, and shale.  Excavation difficulty is low to high.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 25, E's', E'Illuvial accumulation of sesquioxides and organic matter.  This symbol is used with B to indicate an accumulation of illuvial, amorphous, dispersible organic-matter-sesquioxide complexes if both the organic-matter and sesquioxide components are significant, and if either the color value or chroma, moist, of the horizon is 4 or more.  The symbol is also used in combination with "h" as "Bhs" if both the organic-matter and sesquioxide components are significant, and if the color value and chroma, moist, is 3 or less.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 26, E'ss', E'This symbol indicates the presence of slickensides.  Slickensides result directly from the swelling of clay minerals and shear failure, commonly at angles of 20 to 60 degrees above horizontal.  They are indicators that other vertic characteristics, such as wedge-shaped peds and surface cracks, may be present. of slickensides.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 27, E't', E'Accumulation of silicate clay.  This symbol indicates an accumulation of silicate clay that has either formed and subsequently been translocated within the horizon or has been moved into the horizon by illuviation, or both.  At least some part of the horizon should show evidence of clay accumulation either as coatings on surfaces of peds or in pores, or as lamellae or as bridges between mineral grains.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 28, E'u', E'Presence of human-manufactured materials (artifacts). This symbol indicates the presence of human-manufactured artifacts that have been created or modified by humans, usually for a practical purpose in habitation, manufacturing, excavation, or construction activities.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 29, E'v', E'Plinthite.  This symbol indicates the presence of iron-rich, humus-poor reddish material that is firm or very firm when moist and hardens irreversibly when exposed to the atmosphere and to repeated wetting and drying.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 30, E'w', E'Development of color or structure.  This symbol is used with B to indicate the development of color or structure, or both, with little or no apparent illuvial accumulation of material.  It should not be used to indicate a transitional horizon.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 31, E'x', E'Fragipan character.  This symbol indicates a genetically developed layer that has a combination of firmness, brittleness, and commonly a higher bulk density than adjacent layers.  Some part of the layer is physically root-restrictive.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 32, E'y', E'Accumulation of gypsum.  This symbol indicates a gypsum accumulation.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_letter_suffix', 33, E'z', E'Accumulation of salts more soluble than gypsum.  This symbol indicates an accumulation of salts that are more soluble than gypsum.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_master', 1, E'O', E'Layers dominated by organic material.  Some are saturated with water for long periods, or were once saturated but are now artificially drained; others have never been saturated.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_master', 2, E'A', E'Mineral horizons which have formed at the surface or below an O horizon; they exhibit obliteration of all or much of the original rock structure1 and show one or both of the following: (1) an accumulation of humified organic matter intimately mixed with the mineral fraction and not dominated by properties characteristic of E or B horizons (defined below), or (2) properties resulting from cultivation, pasturing, or similar kinds of disturbance.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_master', 3, E'E', E'Mineral horizons in which the main feature is loss of silicate clay, iron, or aluminum, or some combination of these, leaving a concentration of sand and silt particles.  These horizons exhibit obliteration of all or much of the original rock structure.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_master', 4, E'B', E'Horizons which have formed below an A, E, or O horizon; they are dominated by the obliteration of all or much of the original rock structure and show one or more of the following:\r\n\r\n(1) Illuvial concentration of silicate clay, iron, aluminum, humus, carbonates, gypsum, or silica, alone or in combination;\r\n(2) Evidence of removal of carbonates;\r\n(3) Residual concentration of sesquioxides;\r\n(4) Coatings of sesquioxides that make the horizon conspicuously lower in color value, higher in chroma, or redder in hue, without apparent illuviation of iron, than overlying and underlying horizons;\r\n(5) Alteration which forms silicate clay or liberates oxides, or both, and which forms a granular, blocky, or prismatic structure if volume changes accompany changes in moisture content; or\r\n(6) Brittleness.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_master', 5, E'C', E'Horizons or layers, excluding hard bedrock, that are little affected by pedogenic processes and lack the properties of O, A, E, or B horizons.  Most are mineral layers.  The material of C layers may be either like or unlike the material from which the solum has presumably formed.  The Chorizon may have been modified, even if there is no evidence of pedogenesis.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_master', 6, E'R', E'Hard Bedrock', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'horz_desgn_master', 7, E'AB', E'Horizons dominated by properties of one master horizon but having subordinate properties of another. The first of these symbols indicates that the properties of the horizon so designated dominate the transitional horizon.  An AB horizon, for example, has characteristics of both an overlying A horizon and an underlying B horizon, but it is more like the A than like the B.', E'No');
