INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'legend_certification_status', 1, E'not for distribution', E'Data in the legend object, including some mapunits, correlation notes, or area overlaps, have been created but are not fully populated or the data are preliminary and incomplete.  The data are subject to major changes.  A legend with this status should not be interpreted, exported, or used by other applications.\r\n\r\nNote that this certification status applies to only the legend object.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'legend_certification_status', 2, E'not certified', E'The data in the legend object, including mapunits, correlation notes, and area overlaps, have been created and have been appropriately populated, but data have not been reviewed or certified.  These are advance data, subject to change.\r\n\r\nNote that this certification status applies to only the legend object.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'legend_certification_status', 3, E'partly certified', E'The data in the legend object, including mapunits, correlation notes, and area overlaps, have been appropriately populated and the data have been reviewed.  At least some of the data elements have been certified for use in specific applications.  Other data elements in the object have advance data, subject to change.\r\n\r\nNote that this certification status applies to only the legend object.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'legend_certification_status', 4, E'certified', E'The data in the legend object, including mapunits, correlation notes, and area overlaps, have been appropriately populated, reviewed, and certified for general use.\r\n\r\nNote, that this certification status applies to only the legend object.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'legend_suitability_for_use', 1, E'not current', E'The legend has been completely replaced by another legend for the survey area.  Typically this legend has an out-of-date operational soil survey status and another survey legend completely covers the geographic area served by this legend.', E'No');
