INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'legend_suitability_for_use', 3, E'current wherever mapped', E'The legend is up-to-date wherever it has been mapped in the survey area.  If the survey area is completely mapped, the legend applies over the entire geographic area.  If the mapping is on-going, the legend is up-to-date where mapping has been completed.', E'No');
