INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 2, E'Semideformable', E'Deformation occurs prior to rupture.  Cracks develop and the speciman ruptures before compression to half its original thickness. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 3, E'Deformable', E'The speciman can be compressed to half its original thickness without rupture.  Radial cracks may appear and extend inward less than half the radius normal to compression. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 4, E'Nonfluid', E'None of the speciman flows through the fingers after exerting full compression. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 5, E'Slightly fluid', E'After exerting full compression, some of the speciman flows through the fingers, but most remains in the palm of the hand.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 6, E'Moderately fluid', E'After exerting full compression, most of the speciman flows through the fingers; a small residue remains in the palm of the hand.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 7, E'Strongly fluid', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 8, E'Very fluid', E'Under very gentle pressure most of the speciman flows through the fingers like a slightly viscous fluid; very little or no residue remains in the palm of the hand. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 9, E'Nonsmeary', E'At failure, the speciman does not chage suddenly to a fluid, the fingers do not skid, and no smearing occurs. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 10, E'Weakly smeary', E'At failure, the speciman changes suddenly to fluid, the fingers skid, and the soil smears.  Afterward, little or no free water remains on the fingers. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 11, E'Moderately smeary', E'At failure, the speciman changes suddenly to fluid, the fingers skid, and the soil smears.  Afterward, some free water can be seen on the fingers. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 12, E'Strongly smeary', E'At failure, the speciman suddenly changes to fluid, the fingers skid, the soil smears, and is very slippery.  Afterward, free water is easliy seen on the fingers. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'manner_of_failure', 13, E'Smeary', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'mapunit_certification_status', 1, E'not for distribution', E'The map unit object has been created, but is not populated or the data are preliminary and incomplete.  The data are subject to major changes.  A map unit with this status should not be interpreted, exported, or used by other applications.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'mapunit_certification_status', 2, E'not certified', E'The data in the map unit object have been created and have been appropriately populated, at least in part, but the data have not been reviewed or certified.  Data in some data elements in these tables may be more complete than in others.  These are advance data, subject to change.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'mapunit_certification_status', 3, E'partly certified', E'The data in the map unit object have been appropriately populated and the data have been reveiwed.  At least some of the data elements have been certified for use in specific applications.  Other data elements in the object have advance data, subject to change.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'mapunit_certification_status', 4, E'certified', E'The data in the map unit object have been appropriately populated, reviewed, and certified for general use.', E'No');
