INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 2, E'Alluvium', E'Unconsolidated clastic material subaerially deposited by running water, including gravel, sand, silt, clay, and various mixtures of these.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 3, E'arkosic-sandstone', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 4, E'Ash flow', E'A highly heated mixture of volcanic gases and ash, traveling down the flank of a volcano or along the surface of the ground; produced by the explosive disintegration of viscous lava in a volcanic crater, or by the explosive emission of gas-charged ash from a fissure or group of fissures.  The solid materials contained in a typical ash flow are generally unsorted and ordinarily include volcanic dust, pumice, scoria, and blocks in addition to ash.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 5, E'Backswamp deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 6, E'Beach sand', E'Well sorted, sand-sized, clastic material transported, sorted and deposited primarily by wave action and deposited in a shore environment.  Compare - eolian sands.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 7, E'Block glide deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 8, E'breccia-acidic', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 9, E'breccia-basic', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 10, E'chalk', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 11, E'charcoal', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 12, E'Cinders', E'Uncemented vitric, vesicular, pyroclastic material, more than 2.0 mm in at least one dimension, with an apparent specific gravity (including vesicles) of more than 1.0 and less than 2.0.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 13, E'coal', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 14, E'Coastal marl', E'An earthy, unconsolidated deposit of gray to buff-colored mud of low bulk density (dry) composed primarily of very fine, almost pure calcium carbonate formed in subaqueous settings that span freshwater lacustrine conditions (e.g. Florida Everglades) to saline intertidal settings (e.g. Florida Keys) formed by the chemical action of algal mats and organic detritus (periphyton); other marl varieties associated with different  environments (e.g. freshwater marl, glauconitic marl) also occur.  Coastal marl can be quite pure or it can be finely disseminated throughout living root mats (e.g. mangrove roots) and / or organic soil layers.  Compare  marl, freshwater marl.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 15, E'Colluvium', E'Unconsolidated, unsorted earth material being transported or deposited on side slopes and/or at the base of slopes by mass movement (e.g. direct gravitational action) and by local, unconcentrated runoff.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 16, E'Complex landslide deposits', E'A category of mass movement processes, associated sediments (complex landslide deposit) or resultant landforms characterized by a composite of several mass movement processes none of which dominates or leaves a prevailing landform.  Numerous types of complex landslides can be specified by naming the constituent processes evident (e.g. a complex earth spread - earth flow landslide).  Compare - fall, topple, slide, lateral spread, flow, landslide.  SW &  DV', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 17, E'conglomerate', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 18, E'conglomerate-calcareous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 19, E'conglomerate-noncalcareous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 20, E'Coprogenic material', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 21, E'Creep deposits', E'Sediment resulting from slow mass movement of earth material down slopes, caused by gravity but facilitated by saturation with water and alternate freezing and thawing.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 22, E'Cryoturbate', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 23, E'Debris avalanche deposits', E'Sediment resulting from the very rapid and usually sudden sliding and flow of incoherent, unsorted mixtures of soil and weathered bedrock.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 24, E'Debris fall deposits', E'The process, associated sediments (debris fall deposit) or resultant landform characterized by a rapid type of fall involving the relatively free, downslope movement or collapse of detached, unconsolidated material which falls freely through the air (lacks an underlying slip face); sediments have substantial proportions of both fine earth and coarse fragments; common along undercut stream banks.  Compare - rock fall, soil fall, landslide.  SW', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 25, E'Debris flow deposits', E'Sediment resulting from a mass movement of rock fragments, soil, mud, more than half of the particles being larger than sand size.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 26, E'Debris slide deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 27, E'Debris spread deposits', E'The process, associated sediments (debris spread deposit) or resultant landforms characterized by a very rapid type of spread dominated by lateral movement in a soil and rock mass resulting from liquefaction or plastic flow of underlying materials that may be extruded out between intact units; sediments have substantial proportions of both fine earth and coarse fragments.  Compare - earth spread, rock spread, landslide.  SW & DV', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 28, E'Debris topple deposits', E'The process, associated sediments (debris topple deposit) or resultant landform characterized by a localized, very rapid type of topple in which large blocks of soil and rock material literally fall over, rotating outward over a low pivot point;  sediments have substantial proportions of both fine earth and coarse fragments.  Portions of the original material may remain intact, although reoriented, within the resulting debris pile.  Compare - earth topple, rock topple, landslide.  SW', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 29, E'Diamicton', E'A nonlithified, nonsorted or poorly sorted sediment that contains a wide range of particle sizes, such as coarse fragments contained within a fine earth matrix (e.g. till, pebbly mudstone) and used when', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 30, E'Diatomaceous earth', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 31, E'dolomite', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 32, E'Dredge spoils', E'Unconsolidated, randomly mixed sediments extracted and deposited during dredging and dumping activities (e.g. adjoining the Intracoastal Waterway).  Dredge spoils lie unconformably upon natural, undisturbed soil or regolith and can form anthropogenic landforms (e.g. dredge spoil bank).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 33, E'Drift', E'A general term applied to all mineral material (clay, silt, sand, gravel, boulders) transported by a glacier and deposited directly by or from the ice, or by running water emanating from a glacier.  Drift includes unstratified material (till) that forms moraines, and stratified deposits that form outwash plains, eskers, kames, varves, and glaciofluvial sediments.  The term is generally applied to Pleistocene glacial deposits in areas that no longer contain glaciers.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 34, E'Earth spread deposits', E'The process, associated sediments (earth spread deposit) or resultant landforms characterized by a very rapid type of spread dominated by lateral movement in a soil mass resulting from liquefaction or plastic flow of underlying materials that may be extruded out between intact units.  Compare - debris spread, rock spread, landslide.  SW & DV', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 35, E'Earth topple deposits', E'The process, associated sediments (earth topple deposit) or resultant landform characterized by a localized, very rapid type of topple in which large blocks of soil material literally fall over, rotating outward over a low pivot point; sediments < 2 mm predominate.  Portions of the original material may remain intact, although reoriented, within the resulting deposit.  Compare - debris topple, rock topple, landslide.  SW', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 36, E'Earthflow deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 37, E'Eolian deposits', E'Material transported and deposited by the wind.  Includes earth materials such as dune sands, sand sheets, loess deposits, and clay (e.g. parna).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 38, E'Eolian sands', E'Material transported and deposited by the wind, dominated by particles of sand-size (0.05-2 mm).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 39, E'Estuarine deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 40, E'Fall deposits', E'(a) A category of mass movement processes, associated sediments (fall deposit), or resultant landforms (e.g., rockfall, debris fall, soil fall) characterized by very rapid movement of a mass of rock or earth that travels mostly through the air by free fall, leaping, bounding, or rolling, with little or no interaction between one moving unit and another.  Compare - topple, slide, lateral spread, flow, complex landslide, landslide.  SW & DV;   (b) The mass of material moved by a fall.  GG', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 41, E'Flow deposits', E'A category of mass movement processes, associated sediments (flow deposit) and landforms characterized by slow to very rapid downslope movement of unconsolidated material which, whether saturated or comparatively dry, behaves much as a viscous fluid as it moves. Types of flows can be specified based on the dominant particle size of sediments (i.e. debris flow (e.g., lahar), earth flow (creep, mudflow), rock fragment flow (e.g., rockfall avalanche), debris avalanche]. Compare - fall, topple, slide, lateral spread, complex landslide, landslide.  SW & DV', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 42, E'Fluviomarine deposits', E'Stratified materials (clay, silt, sand, or gravel) formed by both marine and fluvial processes, resulting from sea level flucuations and stream migration (i.e. materials originally deposited in a nearshore environment and subsequently reworked by fluvial processes as sea level fell, or vice versa as sea level rose).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 43, E'Freshwater marl', E'A soft, grayish to white, earthy or powdery, usually impure calcium carbonate precipitated on the bottoms of present-day freshwater lakes and ponds largely through the chemical action of algal mats and organic detritus, or forming deposits that underlie marshes, swamps, and bogs that occupy the sites of former (glacial) lakes.  The calcium carbonate may range from 90% to less than 30%.  Freshwater marl is usually gray; it has been used as a fertilizer for acid soils deficient in lime. Syn.: bog lime.  Compare  marl, coastal marl.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 44, E'Glaciofluvial deposits', E'Material moved by glaciers and subsequently sorted and deposited by streams flowing from the melting ice.  The deposits are stratified and may occur in the form of outwash plains, valley trains, deltas, kames, eskers, and kame terraces.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 45, E'Glaciolacustrine deposits', E'Material ranging from fine clay to sand derived from glaciers and deposited in glacial lakes by water originating mainly from the melting of glacial ice.  Many are bedded or laminated with varves or rhythmites.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 46, E'Glaciomarine deposits', E'Glacially eroded, terrestrially derived sediments (clay, silt, sand, and gravel) that accumulated on the ocean floor.  Sediments may be accumulated as an ice-contact deposit, by fluvial transport, ice-rafting, or eolian transport.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 47, E'glauconite', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 48, E'gneiss', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 49, E'gneiss-acidic', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 50, E'gneiss-basic', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 51, E'Greensands', E'a) An unconsolidated, near-shore marine sediment containing substantial amounts of dark greenish glauconite pellets, often mingled with clay or sand (quartz may form the dominant constituent); prominent in Cretaceous and Tertiary coastal plain strata of New Jersey, Delaware and Maryland; has been commercially mined for potassium fertilizer.  The term is loosely applied to any glauconitic sediment.  b)  (Not Preferred - use glauconitic sandstone)  A sandstone consisting of greensand that is commonly poorly cemented, and has a greenish color when unweathered but an orange or yellow color when weathered.  Compare - glauconite pellets.  SW', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 52, E'Grus', E'The fragmental products of in situ granular disintegration of granite and granitic rocks, dominated by inter-crystal disintegration.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 53, E'Human transported material', E'Organic or mineral soil material (or any other material that can function as a soil material) that has been moved horizontally onto a pedon from a source area outside of that pedon by directed human activity, usually with the aid of machinery. There has been little or no subsequent reworking by wind, gravity, water, or ice. Human transported materials are most commonly associated with building sites, mining or dredging operations, land fills, or other similar activities that result in the formation of a constructional anthropogenic landform.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 54, E'igneous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 55, E'igneous-acid (eg., rhyolite)', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 56, E'igneous-andesite', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 57, E'igneous-basalt', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 58, E'igneous-basic (eg., gabbro)', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 59, E'igneous-coarse (or intrusive)', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 60, E'igneous-fine (or extrusive)', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 61, E'igneous-granite', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 62, E'igneous-intermediate (eg., diorite)', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 63, E'igneous-ultrabasic', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 64, E'interbedded sedimentary', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 65, E'Lacustrine deposits', E'Clastic sediments and chemical precipitates deposited in lakes.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 66, E'Lagoonal deposits', E'Sand, silt or clay-sized sediments transported and deposited by wind, currents, and storm washover in the relatively low-energy, brackish to saline, shallow waters of a lagoon.  Compare - marine deposit.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 67, E'Lahar', E'A term for a mass movement landform and a process characterized by a mudflow composed chiefly of volcaniclastic materials on or near the flank of a volcano.  The debris carried in the flow includes pyroclastic material, blocks from primary lava flows, and epiclastic material.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 68, E'Lapilli', E'Non or slightly vesicular pyroclastics, 2.0 to 76 mm in at least one dimension, with an apparent specific gravity of 2.0 or more.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 69, E'Lateral spread deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 70, E'limestone', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 71, E'limestone-arenaceous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 72, E'limestone-argillaceous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 73, E'limestone-cherty', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 74, E'limestone-phosphatic', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 75, E'limestone-sandstone', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 76, E'limestone-sandstone-shale', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 77, E'limestone-shale', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 78, E'limestone-siltstone', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 79, E'Loess', E'Material transported and deposited by wind and consisting predominantly of silt size.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 80, E'Calcareous loess', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 81, E'Noncalcareous loess', E'Noncalcareous material transported and deposited by wind and consisting predominantly of silt size (0.002-0.05 mm).', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 82, E'logs and stumps', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 83, E'marble', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 84, E'Marine deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 85, E'Marl', E'A generic term loosely applied to a variety of materials, most of which occur as an earthy, unconsolidated deposit consisting chiefly of an intimate mixture of clay and calcium carbonate formed commonly by the chemical action of algae mats and organic detritus (periphyton); specifically an earthy substance containing 35-65% clay and 65-35% calcium carbonate mud; formed primarily under freshwater lacustrine conditions, but varieties associated with more saline environments and higher carbonate contents also occur.  Compare  coastal marl, freshwater marl,', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 86, E'Mass movement deposits', E'Sediment resulting from the dislodgement and downslope transport of soil and rock material as a unit under direct gravitational stress.  The process includes slow displacements such as creep and solifluction, and rapid movements such as landslides, rock slides, and falls, earthflows, debris flows, and avalanches.  Agents of fluid transport (water, ice, air) may play an important, if subordinate role in the process.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 87, E'metamorphic', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 88, E'Mine spoil or earthy fill', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 89, E'Coal extraction mine spoil', E'Randomly mixed, earthy materials artificially deposited as a result of either surficial or underground coal mining activities.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 90, E'Metal ore extraction mine spoil', E'Randomly mixed, earthy materials artificially deposited as a result of either surficial or underground metal-ore mining activities.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 91, E'mixed', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 92, E'mixed-calcareous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 93, E'mixed-igneous & metamorphic', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 94, E'mixed-igneous & sedimentary', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 95, E'mixed-igneous-metamorphic & sedimentary', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 96, E'mixed-metamorphic & sedimentary', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 97, E'mixed-noncalcareous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 98, E'Mudflow deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 99, E'Grassy organic material', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 100, E'Herbaceous organic material', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 101, E'Mossy organic material', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 102, E'Organic material', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 103, E'Woody organic material', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 104, E'Outwash', E'(a) Stratified detritus (chiefly sand and gravel) removed or "washed out" from a glacier by melt-water streams and deposited in front of or beyond the end moraine or the margin of an active glacier.  The coarser material is deposited nearer to the ice.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 105, E'Overbank deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 106, E'pahoehoe', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 107, E'Parna', E'A term used, especially in southeast Australia, for silt and sand-sized aggregates of eolian clay occurring in sheets.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 108, E'Pedisediment', E'A layer of sediment, eroded from the shoulder and back slope of an erosional slope, that lies on and is, or was, being transported across a pediment.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 109, E'Pumice', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 110, E'pyroclastic', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 111, E'Pyroclastic flow', E'A fast density current of pyroclastic material, usually very hot, composed of a mixture of gasses and a variety of pyroclastic particles (ash, pumice, scoria, lava fragments, etc.); produced by the explosive disintegration of viscous lava in a volcanic crater or by the explosive emission of gas-charged ash from a fissure and which tends to follow topographic lows (e.g. valleys) as it moves; used in a more general sense than ash flow.  Compare - pyroclastic surge, ash flow, nue ardente, lahar.  SW, SN, GG', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 112, E'Pyroclastic surge', E'A low density, dilute, turbulent pyroclastic flow, usually very hot, composed of a generally unsorted mixture of gases, ash, pumice and dense rock fragments that travels across the ground at high speed and less constrained by topography than a pyroclastic flow; several types of pyroclastic surges can be specified (e.g. base surge, ash-cloud-surge).  Compare - pyroclastic flow.  SW, SN, GG', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 113, E'quartzite', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 114, E'Residuum', E'Unconsolidated, weathered, or partly weathered mineral material that accumulates by disintegration of bedrock in place.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 115, E'Rock spread deposits', E'The process, associated sediments (rock spread deposit) or resultant landforms characterized by a very rapid type of spread dominated by lateral movement in a rock mass resulting from liquefaction or plastic flow of underlying materials that may be extruded out between intact units; rock bodies predominate.  Compare - debris spread, earth spread, landslide.  SW & DV', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 116, E'Rock topple deposits', E'The process, associated sediments (rock topple deposit) or resultant landform characterized by a localized, very rapid type of fall in which large blocks of rock material literally fall over, rotating outward over a low pivot point; rock bodies predominate (little fine earth).  Portions of the original material may remain intact, although reoriented, within the resulting deposit.  Compare - earth topple, debris topple, landslide.  SW', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 117, E'Rockfall avalanche deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 118, E'Rockfall deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 119, E'Rotational debris slide deposits', E'The process, associated sediments (rotational debris slide deposit) or resultant landform characterized by an extremely slow to moderately rapid type of slide, composed of comparatively dry and largely unconsolidated earthy material, portions of which remain largely intact and in which movement occurs along a well-defined, concave shear surface and resulting in a backward rotation of the displaced mass; sediments have substantial proportions of both fine earth and coarse fragments.  The landform may be single, successive (repeated up and down slope), or multiple (as the number of slide components increase).  Compare - rotational earth slide, rotational rock slide, translational slide, lateral spread, landslide.  SW & DV', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 120, E'Rotational earth slide deposits', E'The process, associated sediments (rotational earth slide deposit) or resultant landform characterized by an extremely slow to moderately rapid type of slide, composed of comparatively dry and largely unconsolidated earthy material, portions of which remain largely intact and in which movement occurs along a well-defined, concave shear surface and resulting in a backward rotation of the displaced mass; sediments predominantly fine earth (< 2 mm).  The landform may be single, successive (repeated up and down slope), or multiple (as the number of slide components increase).  Compare - rotational debris slide, rotational rock slide, translational slide, lateral spread, landslide.  SW & DV', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 121, E'Rotational rock slide deposits', E'The process, associated sediments (rotational rock slide deposit) or resultant landform characterized by an extremely slow to moderately rapid type of slide, composed of comparatively dry and largely consolidated rock bodies, portions of which remain largely intact but reoriented, and in which movement occurs along a well-defined, concave shear surface and resulting in a backward rotation of the displaced mass.  The landform may be single, successive (repeated up and down slope), or multiple (as the number of slide components increase).  Compare - rotational debris slide, rotational earth slide, translational slide, lateral spread, landslide.  SW & DV', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 122, E'Rotational slide deposits', E'An accumlation of sediment resulting from a mass movement and a process characterized by a slide in which shearing takes place on a well defined, curved shear surface, concave upward, producing a backward rotation in the displaced mass.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 123, E'Sand flow deposits', E'A flow of wet sand, as along banks of noncohesive clean sand that is subject to scour and to repeated fluctuations in pore-water pressure due to rise and fall of the tide.  GG', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 124, E'sandstone', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 125, E'sandstone-calcareous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 126, E'sandstone-noncalcareous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 127, E'sandstone-shale', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 128, E'sandstone-siltstone', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 129, E'Saprolite', E'- (Provisional definition)  Soft, friable, isovolumetrically weathered bedrock that retains the fabric and structure of the parent rock (Colman and Dethier, 1986) exhibiting extensive inter-crystal and intra-crystal weathering.  \r\n\r\nIn pedology, saprolite was formerly applied to any unconsolidated residual material underlying the soil and grading to hard bedrock below.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 130, E'schist', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 131, E'schist-acidic', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 132, E'schist-basic', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 133, E'Scoria', E'Vesicular, cindery crust or bomb-sized fragments of such material on the surface of andesitic or basaltic lava, the vesicular nature of which is due to the escape of volcanic gases before solidification; it is usually heavier, darker, and more crystalline than pumice.  Synonym - cinder.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 134, E'Scree', E'A collective term for an accumulation of coarse rock debris or a sheet of coarse debris mantling a slope.  Scree is not a synonym of talus, as scree includes loose, coarse fragment material on slopes without cliffs.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 135, E'sedimentary', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 136, E'serpentine', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 137, E'shale', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 138, E'shale-calcareous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 139, E'shale-clay', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 140, E'shale-noncalcareous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 141, E'shale-siltstone', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 142, E'siltstone', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 143, E'siltstone-calcareous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 144, E'siltstone-noncalcareous', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 145, E'slate', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 146, E'Slide deposits', E'A category of mass movement processes, associated sediments (slide deposit) or resultant landforms (e.g., rotational slide, translational slide, and snowslide) characterized by a failure of earth, snow, or rock under shear stress along one or several surfaces that are either visible or may reasonably be inferred.  The moving mass may or may not be greatly deformed, and movement may be rotational (rotational slide) or planar (translational slide).    A slide can result from lateral erosion, lateral pressure, weight of overlying material, accumulation of moisture, earthquakes, expansion owing to freeze-thaw of water in cracks, regional tilting, undermining, fire, and human agencies.  Compare -fall, topple, lateral spread, flow, complex landslide.  SW & DV  (b) The track of bare rock or furrowed earth left by a slide.  (c) The mass of material moved in or deposited by a slide.  Compare - fall, flow, complex landslide, landslide.  SW & GG', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 147, E'Slope alluvium', E'Sediment gradually transported on mountain or hill slopes primarily by alluvial processes and characterized by particle sorting.  In a profile sequence, sediments may be distinguished by differences in size and/or specific gravity of coarse fragments and may be separated by stone lines.  Sorting of rounded or subrounded pebbles or cobbles and burnished peds distinguish these materials from unsorted colluvial deposits.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 148, E'Slump block', E'TheA mass of material torn away as a coherent unit during a landslide; a largely intact but displaced and commonly reoriented body of rock or soil.  SW & GG', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 149, E'Soil fall deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 150, E'Solid rock', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 151, E'Solifluctate', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 152, E'Solifluction deposits', E'A deposit of nonsorted, water-saturated, locally derived earthy material that is moving or has moved downslope, en masse, caused by the melting of seasonal frost or permafrost.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 153, E'Supraglacial debris-flow', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 154, E'Talus', E'Rock fragments of any size or shape (usually coarse and angular) derived from and lying at the base of a cliff or very steep rock slope.  The accumulated mass of such loose broken rock formed chiefly by falling, rolling, or sliding.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 155, E'Tephra', E'A collective term for all clastic volcanic materials that are ejected from a vent during an eruption and transported through the air, including ash [volcanic ], blocks [volcanic], cinders, lapilli, scoria, and pumice.  Tephra is a general term which, unlike many volcaniclastic terms, does not denote properties of composition, visicularity, or grain size.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 156, E'Ablation till', E'A general term for loose, relatively permeable material deposited during the downwasting of nearly static glacial ice, either contained within or accumulated on the surface of the glacier.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 157, E'Basal till', E'Unconsolidated material of mixed composition deposited at the base (bottom) of a glacier [ The term emphaizes the e.g. subglacial till.  Types of basal till include lodgment, melt-out, and flow till.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 158, E'Flow till', E'A till, commonly supraglacial, that is modified and transported by plastic mass flow; also spelled flow till.  Compare - ablation till, basal till, lodgment till, mass-movement till, slump-till, supraglacial melt-out till.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 159, E'Lodgment till', E'A basal till commonly characterized by compact, fissile ("platy")  structure and containing coarse fragments oriented with their long axes generally parallel to the direction of ice movement.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 160, E'Melt-out till', E'Till derived from slow melting of debris-rich stagnant ice buried beneath sufficient overburden to inhibit deformation under gravity, thus preserving structures derived from the parent ice.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 161, E'Slump till', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 162, E'Subglacial till', E'Till deposited in or by the bottom parts of a glacier or ice sheet; types include lodgement till, subglacial flow till; synonym (not preferred; obsolete): basal till.  SW & GM', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 163, E'Supraglacial till', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 164, E'Supraglacial meltout till', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 165, E'Till', E'Dominantly unsorted and unstratified drift, generally unconsolidated and deposited directly by a glacier without subsequent reworking by meltwater, and consisting of a heterogeneous mixture of clay, silt, sand, gravel, stones, and boulders; rock fragments of various lithologies are imbedded within a finer matrix that can range from clay to sandy loam.  Compare - ablation till, basal till, flowtill, lodgment till, drift, moraine.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 166, E'Topple deposits', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 167, E'Translational debris slide deposits', E'The process, associated sediments (translational debris slide deposit) or resultant landform characterized by an extremely slow to moderately rapid type of slide, composed of comparatively dry and largely unconsolidated earthy material, portions or blocks of which remain largely intact and in which movement occurs along a well-defined, planar slip face roughly parallel to the ground surface and resulting in lateral displacement but no rotation of the displaced mass; sediments have substantial proportions of both fine earth and coarse fragments.  The landform may be single, successive (repeated up and down slope), or multiple (as the number of slide components increase).  Compare - translational earth slide, translational rock slide, rotational slide lateral spread, landslide.  SW & DV', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 168, E'Translational earth slide deposits', E'The process, associated sediments (translational earth slide deposit) or resultant landform characterized by an extremely slow to moderately rapid type of slide, composed of comparatively dry and largely unconsolidated earthy material, portions or blocks of which remain largely intact and in which movement occurs along a well-defined, planar slip face roughly parallel to the ground surface and resulting in lateral displacement but no rotation of the displaced mass; sediments predominantly fine earth (< 2 mm).  The landform may be single, successive (repeated up and down slope), or multiple (as the number of slide components increase).  Compare translational debris slide, translational rock slide, rotational slide, lateral spread, landslide.  SW & DV', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 169, E'Translational rock slide deposits', E'The process, associated sediments (translational rock slide deposit) or resultant landform characterized by an extremely slow to moderately rapid type of slide, composed of comparatively dry and largely consolidated rock bodies, portions or blocks of which remain largely intact and in which movement occurs along a well-defined, planar slip face roughly parallel to the ground surface and resulting in lateral displacement but no rotation of the displaced mass; sediments predominantly fine earth (< 2 mm).  The landform may be single, successive (repeated up and down slope), or multiple (as the number of slide components increase).  Compare translational debris slide, translational earth slide, rotational slide, lateral spread, landslide.  SW & DV', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 170, E'Translational slide deposits', E'A category of mass movement processes, associated sediments (translational slide deposit) or resultant landforms characterized by the extremely slow to moderately rapid downslope displacement of comparatively dry soil-rock material on a surface (slip face) that is roughly parallel to the general ground surface, in contrast to falls topples, and rotational slides.  The term includes such diverse slide types as translational debris slides, translational earth slide, translational rock slide, block glides, and slab or flake slides. .  Compare - rotational slide, slide, landslide.  SW, DV, GG', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 171, E'tuff', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 172, E'tuff-acidic', NULL, E'Yes');
