INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 174, E'tuff-breccia', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 175, E'Unconsolidated sediments', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 176, E'Valley side alluvium', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_kind', 177, E'Volcanic ash', E'Unconsolidated, pyroclastic material less than 2 mm in all dimensions.', E'No');
