INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_modifier', 1, E'Clayey', E'The soil texture class is clay, sandy clay, or silty clay.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_modifier', 2, E'Coarse-loamy', E'The material contains less than 18 percent clay and 15 percent or more particles that are 0.1 to 75.0 mm in size.  The soil texture class is loamy very fine sand, very fine sand, or finer.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_modifier', 3, E'Coarse-silty', E'The material contains less than 18 percent clay and less than 15 percent particles that are 0.1 to 75.0 mm in size.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_modifier', 4, E'Fine-loamy', E'The material contains 18 to 35 percent clay and 15 percent or more particles that are 0.1 to 75.0 mm in size.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_modifier', 5, E'Fine-silty', E'The material contains 18 to 35 percent clay and less than 15 percent particles that are 0.1 to 75.0 mm in size.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_modifier', 6, E'Gravelly', E'The material contains 15 percent or more rock fragments.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_modifier', 7, E'Loamy', E'The soil texture class is sandy loam, sandy clay loam, clay loam, silt, silt loam, or silty clay loam.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_modifier', 8, E'Sandy', E'The soil texture class is sand or loamy sand.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_modifier', 9, E'Sandy and gravelly', E'The soil texture class contains sand or loamy sand, and the material contains 15 percent or more rock fragments.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_modifier', 10, E'Sandy and silty', E'The soil texture class is sand or loamy sand and silt or silt loam.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_modifier', 11, E'Silty', E'The soil texture class is silt or silt loam.', E'No');
