INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 1, E'`A`a lava', E'A type of lava flow having a rough, jagged, clinkery surface.  Compare - pahoehoe lava.  GG & MA', E'No');
