INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 17, E'Chert', E'A hard, extremely dense or compact, dull to semivitreous, cryptocrystalline sedimentary rock, consisting dominantly of interlocking crystals of quartz less than about 30 mm in diameter; it may contain amorphous silica (opal).  It sometimes contains impurities such as calcite, iron oxide, or the remains of silicious and other organisims.  It has a tough, splintery to conchoidal fracture and may be white or variously colored gray, green, blue, pink, red, yellow, brown, and black.  Chet  occurs principally as nodular or concretionary segregations in limestones and dolomites.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 18, E'Cinders', E'Uncemented vitric, vesicular, pyroclastic material, more than 2.0 mm in at least one dimension, with an apparent specific gravity (including vesicles) of more than 1.0 and less than 2.0.  Compare - ash [volcanic], block [volcanic], lapilli, tephra.  KST', E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 19, E'Claystone', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 20, E'Coal', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 21, E'Calcareous conglomerate', E'A coarse-grained, clastic sedimentary rock composed of rounded to subangular rock fragments larger than 2 mm, commonly with a matrix of sand and finer material; cements include silica, calcium carbonate, and iron oxides.  The consolidated equivalent of gravel.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 22, E'Noncalcareous conglomerate', E'A coarse-grained, clastic sedimentary rock composed of rounded to subangular rock fragments larger than 2 mm, commonly with a matrix of sand and finer material; cements include silica, calcium carbonate, and iron oxides.  The consolidated equivalent of gravel.', E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 23, E'Conglomerate', NULL, E'No');
