INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 27, E'Dolomite', E'A carbonate sedimentary rock consisting chiefly (more than 50 percent by weight or by areal percentages under the microscope) of the mineral dolomite.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 28, E'Ejecta-ash', E'Unconsolidated, pyroclastic material less than 2 mm in all dimensions.  Commonly called "volcanic ash".  Compare - block [volcanic], cinders, lapilli, tephra.', E'Yes');
