INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 72, E'Limestone', E'A sedimentary rock consisting chiefly (more than 50 percent) of calcium carbonate, primarily in the form of calcite.  Limestones are usually formed by a combination of organic and inorganic processes and include chemical and clastic (soluble and insoluble) constituents; many contain fossils.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 73, E'Marble', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 74, E'Marl', E'An earthy, unconsolidated deposit consisting chiefly of calcium carbonate mixed with clay in approximately equal proportions (35 to 65 percent of each); formed primarily under freshwater lacustrine conditions, but varieties associated with more saline environments also occur.', E'Yes');
