INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 89, E'Mudstone', E'a) a blocky or massive, fine-grained sedimentary rock in which the proportions of clay and silt are approximately equal  b) A general term that includes clay, silt, claystone, siltstone, shale, and argillite, and that should be used only when the amounts of clay and silt are not known or cannot be precisely identified.', E'No');
