INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 97, E'Pumice', E'A light-colored, vesicular, glassy rock commonly having the composition of rhyolite.  It commonly has a specific gravity of < 1.0 and is thereby sufficiently buoyant to float on water.  Compare - scoria, tephra.', E'No');
