INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 117, E'Scoria', E'Vesicular, cindery crust or bomb-sized fragments of such material on the surface of andesitic or basaltic lava, the vesicular nature of which is due to the escape of volcanic gases before solidification; it is usually heavier, darker, and more crystalline than pumice.  Synonym - cinder.  Compare - pumice, tephra.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 118, E'Sedimentary rock', E'A consolidated deposit of clastic particles, chemical precipitates, and organic remains accumulated at or near the surface of the earth under "normal" low temperature and pressure conditions.  Sedimentary rocks include consolidated equivalents of alluvium, colluvium, drift, and eolian, lacustrine, marine deposits; e.g., sandstone, siltstone, mudstone, clay-stone, shale, conglomerate, limestone, dolomite, coal, etc.  Compare - sediment.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'parent_material_origin', 119, E'Serpentinite', NULL, E'No');
