INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'restriction_kind', 1, E'Abrupt textural change', E'This term is meant to be used as defined in Soil Taxonomy excluding the control section requirement, i.e. this term applies to the entire soil profile. It is characterized by a considerable increase in clay content within a very short vertical distance in the zone of contact.  In the context of how it is to be used for identifying a kind of restriction, it is root restrictive.  See the Keys to Soil Taxonomy for additional details.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'restriction_kind', 2, E'Densic bedrock', E'This is composed of non-cemented material that is commonly or locally referred to as "bedrock".  It meets the criteria of "densic materials" as defined in Soil Taxonomy.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'restriction_kind', 3, E'Lithic bedrock', E'Material underlying a Lithic Contact as defined in Soil Taxonomy.\r\n\r\nThe material is virtually continuous within the limits of a pedon.  Cracks that can be penetrated by roots are 10 cm or more apart.  When moist, hand digging with a spade is impractical although the material may be chipped or scratched.  Rupture resistance class is at least strongly cemented.  Commonly, the material is indurated.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'restriction_kind', 4, E'Paralithic bedrock', E'Material underlying a Paralithic Contact as defined in Soil Taxonomy.\r\n\r\nThe material is virtually continuous within the limits of a pedon.  Cracks that can be penetrated by roots are 10 cm or more apart.  Rupture resistance is extremely weakly cemented to moderately cemented.  Commonly, the material is partially weathered bedrock or weakly consolidated bedrock such as sandstone, siltstone or shale.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'restriction_kind', 5, E'Cemented horizon', E'Cemented earthy material that does not meet the criteria for any other specificly defined types.  This material does not slake in water.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'restriction_kind', 6, E'Dense material', E'Material underlying a densic contact as defined in Soil Taxonomy.\r\n\r\nThe material is virtually continuous within the limits of a pedon.  Cracks that can be penetrated by roots are 10 cm or more apart.  The material is relatively unaltered and has a noncemented rupture resistance class.  Commonly, the material is earthy material such as till, volcanic mudflows, and mechanically compacted materials, but noncemented rocks can be densic materials if they are dense or resistance enough to keep roots from entering, except in cracks.', E'No');
