INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'restriction_kind', 17, E'Salic', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'restriction_kind', 18, E'Strongly contrasting textural stratification', E'1) The same as "strongly contrasting particle-size classes"  described in the Keys to Soil Taxonomy except that the thickness requirement of 12.5 cm or more for each of the contrasting particle-size classes is waived.  The term is applied to the entire soil profile not just the particle-size control section. In the context of how it is to be used for identifying a kind of restriction, it is root restrictive.  2) Stratified soil textures that differ significantly enough as to restrict the movement of water and air through the soil, or that provide an unfavorable root environment.  It is in all cases root restrictive.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'restriction_kind', 19, E'Sulfuric', NULL, E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'restriction_kind', 20, E'Undefined', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'rule_design', 1, E'class', E'The rule is designed to result in the soil being interpreted as a member of a discrete class.  Reportable features are those with fuzzy values closest to 1.  The fuzzy values of child-rules will be sorted in descending order.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'rule_design', 2, E'limitation', E'The rule is designed in a manner such that the higher the fuzzy value, the more limited the soil is for the stated use. The fuzzy values, of child-rules, closest to 1 represent the most limiting features and will be sorted in descending order.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'rule_design', 3, E'suitability', E'The rule is designed in a manner such that the higher the fuzzy value, the better suited the soil is for the stated use. The fuzzy values, of child-rules, closest to 0 represent the most limiting features and will be sorted in ascending order.', E'No');
