INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'soil_survey_area_status', 1, E'Initial', E'Soil survey area has a signed Memorandum of Understanding and assigned staffing to complete the initial mapping and field documentation in 3 to 5 years.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'soil_survey_area_status', 2, E'Maintenance', E'Soil survey area has a published report that requires some degree of revision (primarily to soil maps), as defined in NSSH Part 610.06.  A comprehensive evaluation documents deficiencies for the entire survey area, and National Cooperative Soil Survey cooperators have agreed on the evaluation; staffing is assigned and other necessary resources are available to complete all revisions within 2 years or less.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'soil_survey_area_status', 3, E'Maintenance needed', E'Soil survey area has a published report that requires some degree of revision (primarily to soil maps), as defined in NSSH Part 610.06.  A comprehensive evaluation documents deficiencies for the entire survey area, and National Cooperative Soil Survey cooperators have agreed on the evaluation; however available resources do not dictate immediate project activities and a change to Maintenance status.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'soil_survey_area_status', 4, E'Nonproject', E'Soil survey area has neither the initial mapping complete nor a signed correlation document.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'soil_survey_area_status', 5, E'Out-of-date', E'Soil survey area has a published report, but it no longer meets user needs; it requires extensive revision, as defined in NSSH Part 610.06.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'soil_survey_area_status', 6, E'Published', E'Soil survey area has been printed, or otherwise reproduced and issued by a Federal or State agency, and meets the current needs of users.  Publication is defined as a traditional hard copy printed report, CD-ROM, web publication, or other media as agreed to by the National Cooperative Soil Survey cooperators in the memorandum of understanding.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'soil_survey_area_status', 7, E'Update', E'Soil Survey area has a published report that requires extensive revision, as defined in NSSH Part 610.06.  The Director, Soil Survey Division, has approved the survey area for updating and republication, and the survey area has a signed memorandum of understanding and staffing to complete the fieldwork in 2 to 4 years.', E'No');
