INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'stickiness', 1, E'Nonsticky', E'After release of pressure, practically no soil material adheres to the thumb or forefinger. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'stickiness', 2, E'Slightly sticky', E'After release of pressure, soil material adheres perceptible to both digits.  As the digits are separated, the material tends to come off one or the other rather cleanly.  The material does not stretch appreciably on separation of the digits.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'stickiness', 3, E'Moderately sticky', E'After release of pressure, soil material adheres to both digits and tends to stretch slightly rather than pull completely free from either digit.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'stickiness', 4, E'Very sticky', E'After release of pressure, soil material adheres so strongly to both digits that it stretches decidely when the digits are separated.  Soil material remains on both digits.', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'structure_grade', 1, E'Weak', E'Individual soil units or aggregates are barely observable in place.  When gently disturbed, the soil material parts into a mixture of whole and broken units and much material that exhibits no planes of weakness. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'structure_grade', 2, E'Moderate', E'Individual soil units or aggregates are well formed and evident in undisturbed soil.  When disturbed, the soil material parts into a mixture of mostly whole units, some broken units, and material not in units. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'structure_grade', 3, E'Strong', E'Individual soil units or aggregates are distinct in undisturbed soil.  When removed, the soil material parts mainly into whole units. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'structure_grade', 4, E'Weak and moderate', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'structure_grade', 5, E'Moderate and strong', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'structure_grade', 6, E'Structureless', E'No individual soil units or aggregates are observable, either in place or following disturbance. (SSM)', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'structure_grade', 7, E'Very strong', NULL, E'Yes');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'structure_size', 1, E'Very fine', E'Granular or platy:  <1 mm\r\n\r\nColumnar or prismatic:  <10 mm\r\n\r\nAngular or subangular blocky: <5 mm', E'No');
INSERT INTO "mdstatdomdet" ("domainname", "choicesequence", "choice", "choicedesc", "choiceobsolete") VALUES (E'structure_size', 2, E'Very fine and fine', NULL, E'Yes');
