INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'chaashto', 1, E'aashtocl', E'aashto_group_classification', E'AASHTO', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'aashto_group_classification', E'A rating based on a system that classifies soils according to those properties that affect roadway construction and maintenance.  Soils are classified into seven basic groups plus eight subgroups, for a total of fifteen for mineral soils.  Another class for organic soils is used.  The groups are based on determinations of particle-size distribution, liquid limit, and plasticity index.  The group classification, including group index, is useful in determining the relative quality of the soil material for use in earthwork structures, particularly embankments, subgrades, subbases, and bases.  (American Association fo State Highway and Transportation Officials)');
