INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 72, E'soilslippot', E'soil_slippage_potential', E'Soil Slip Pot', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'soil_slippage_potential', E'The possibility that a mass of soil will slip when these conditions are met: 1) vegetation is removed, 2) soil water is at or near saturation, and 3) other normal practices are applied.  Increasing the hazard of slippage but not considered in this rating are: 1) the undercutting lower portions or loading the upper parts of a slope or 2) altering the drainage or offsite water contribution to the site such as through irrigation.');
