INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 85, E'taxsuborder', E'taxonomic_suborder', E'Suborder', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'taxonomic_suborder', E'The second level of Soil Taxonomy.  The suborder is below the order and above the great group.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 86, E'taxgrtgroup', E'taxonomic_great_group', E'Great Group', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'taxonomic_great_group', E'The third level of Soil Taxonomy.  The category is below the suborder and above the subgroup.');
