INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 88, E'taxpartsize', E'taxonomic_family_particle_size', E'Particle Size', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'taxonomic_family_particle_size', E'Particle-size classes are used as family differentiae. Particle-size refers to grain-size distribution of the whole soil and is not the same as texture.  (Soil Taxonomy).');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 89, E'taxpartsizemod', E'taxonomic_family_part_size_mod', E'Particle Size Mod', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'taxonomic_family_part_size_mod', E'Taxonomic family criteria that is used to indicate the presence of more than two strongly contrasting classes in the particle size control section.  (Soil Taxonomy)');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 90, E'taxceactcl', E'taxonomic_family_c_e_act_class', E'CEC Activity Cl', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'taxonomic_family_c_e_act_class', E'Cation exchange activity classes are used as family criteria differentiae.  It is the relative cation exchange (CEC) activity level of the soil based on the CEC to clay ratio. (Soil Taxonomy)');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 91, E'taxreaction', E'taxonomic_family_reaction', E'Reaction', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'taxonomic_family_reaction', E'Indicates the presence or absence of carbonates and the reaction.  They are treated together because of their intimate relationship, and are used to indicate family differentiae.  (Soil Taxonomy)');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 92, E'taxtempcl', E'taxonomic_family_temp_class', E'Temp Class', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'taxonomic_family_temp_class', E'The taxonomic family temperature class used to construct the official classification name.  It may be null when the taxonomic family temperature class is embedded in the classification name.  The actual taxonomic temperature regime is recorded in another place.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 93, E'taxmoistscl', E'taxonomic_moisture_subclass', E'Moist Subclass', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'taxonomic_moisture_subclass', E'Soil moisture subclasses are taxonomic subgroup criteria, whether included or not in the name of the subgroup.  The definition of each subclass is dependent upon the specific taxonomic great group to which it is attached.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 94, E'taxtempregime', E'taxonomic_temp_regime', E'Temp Regime', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'taxonomic_temp_regime', E'Soil temperature regime as defined in Soil Taxonomy.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 95, E'soiltaxedition', E'soil_taxonomy_edition', E'Keys to Taxonomy Edition Used', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'soil_taxonomy_edition', E'The edition of Keys to Soil Taxonomy used to classify the soil.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 96, E'castorieindex', E'ca_storie_index', E'CA Storie Index', E'Integer', E'No', NULL, NULL, 0, 100, NULL, NULL, E'The California Storie Index expresses numerically the relative degree of suitability of a soil for general intensive agricultural uses at the time of evaluation.  The rating is based on soil characteristics only and is obtained by evaluating such factors as soil depth, texture of the surface soil, subsoil characteristics, and surface relief.\r\n\r\nStorie, R. Earl and Walter W. Weir. 1948. Manual for identifying and classifying California soil series.  With 1958 Supplement, revised 1978. Associated Students Store, University of California, Berkley, California.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 97, E'flecolcomnum', E'fl_ecological_community_number', E'FL Ecol Comm #', E'String', E'No', 5, NULL, NULL, NULL, NULL, NULL, E'Numbers correspond to the NRCS printed publication "26 Ecological Communities of Florida" 1995.  This publication is based on the awareness that a soil type commonly supports a specific vegetative community, which in turn provides the habitat needed by specific wildlife species.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 98, E'flhe', E'fl_highly_erodible', E'FL HE', E'Boolean', E'No', 3, NULL, NULL, NULL, NULL, NULL, E'A data element with a yes/no entry, assigned by soil component, used in Florida.  It is used to identify highly erodible land.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 99, E'flphe', E'fl_potentially_highly_erodible', E'FL PHE', E'Boolean', E'No', 3, NULL, NULL, NULL, NULL, NULL, E'A data element with a yes/no entry, assigned by soil component, used in Florida.  The basis for identifying highly erodible land is the erodibility index of a soil survey map unit.  The erodibility index of a soil is determined by dividing the potential erodibility for each soil survey map unit by the soil loss tolerance (T) value established for the soil.  The potential erodibility for a map unit differs according to the erosion type (water or wind erosion).  The T value represents the maximum annual rate of soil erosion that could take place without causing a decline in long-term productivity.  A soil map unit with an erodibility index of 8 or more is a highly erodible soil map unit.\r\n\r\nFor water erosion, a soil survey map unit is potentially highly erodible if: (1) the RKLS/T value using the minimum LS factor is less than 8 and (2) the RKLS/T value using the maximum LS factor is equal to or greater than 8. (Predicting Rainfall Erosion Losses; A Guide to Conservation Planning, Field Office Technical Guide, Nat. FSA Handbook Sec. 511.23, and Florida Erosion Control Handbook)');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 100, E'flsoilleachpot', E'fl_soil_leaching_potential', E'FL Leach Pot', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'fl_soil_leaching_potential', E'The potential of the soil to allow chemicals to leave the application site by leaching through the soil, as used in Florida state law.  Soils with a rating of High or Medium are considered to pose a potential leaching hazard.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 101, E'flsoirunoffpot', E'fl_soil_runoff_potential', E'FL Runoff Pot', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'fl_soil_runoff_potential', E'The potential of the soil to allow chemicals to leave the application site with runoff water and/or detached soil particles, as defined for use in Florida.  Soils with a rating of High or Medium are considered to pose a potential runoff hazard.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 102, E'fltemik2use', E'fl_temik_2_use', E'FL Temik', E'Boolean', E'No', 3, NULL, NULL, NULL, NULL, NULL, E'The following soil related use restrictions for Temik 10G (aldicarb) exits if the pesticide is to be applied to citrus in Florida.\r\nTemik cannot be used within 1000 feet of a drinking water well unless it is known that the well is cased to 100 feet below ground level or to a minimum of 30 feet below the water table in soils that have:\r\n1. A permeability of twenty inches/hour or more (very rapid permeability) and\r\n2. A water holding capacity of less than 0.06 inch/inch of soil (very low water holding capacity)--\r\nin all horizons to a depth of 80 inches or to bedrock if bedrock is within 80 inches of the surface.\r\nThe choice indicates that if a component has soil properties, according to state labeling, favorable for the application of the pesticide Temik 10G, the entry is Yes.  If the component does not have favorable properties the entry is No.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 103, E'fltriumph2use', E'fl_triumph_2_use', E'FL Triumph', E'Boolean', E'No', 3, NULL, NULL, NULL, NULL, NULL, E'Soil related use restrictions for Triumph 4E Insecticide are applicable in certain conditions in Florida.  Please note the label for the conditions.  The soil related conditions are as follows:\r\n1. A permeability of six inches/hour or more (rapid or very rapid permeability) and\r\n2. A water holding capacity of 0.10 inch/inch of soil or less (low or very low water holding capacity)--\r\nin all horizons to a depth of 80 inches or to bedrock if bedrock is within 80 inches of the surface.\r\n\r\nThe choice indicates that if a component has soil properties, according to state labeling, favorable for the application of the pesticide Triumph 4E Insecticide (trademark), the entry is Yes.  If the component does not have favorable properties the entry is No.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 104, E'indraingrp', E'in_drainage_group', E'IN Drainage Grp', E'String', E'No', 3, NULL, NULL, NULL, NULL, NULL, E'A group of soils that share similar recommendations for drainage whether the drainage is subsurface or surface. (Agronomy Guide, ID-160 - Purdue University)');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 105, E'innitrateleachi', E'in_nitrate_leaching_index', E'IN NO3 Leach Index', E'Integer', E'No', NULL, NULL, 0, 99, NULL, NULL, E'A number which reflects annual precipitation, rainfall distribution, and hydrologic group.  The system allows comparison of the amount of nitrate which could be leached in percolating water.  The numbers were obtained from the Midwest National Technical Center and are used in Indiana.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 106, E'misoimgmtgrp', E'mi_soil_management_group', E'MI Soil Mgmt Grp', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'mi_soil_management_group', E'A system for ranking soils for major uses, developed by Michigan State University.  Soils are assigned to a group according to the dominant profile texture, the natural drainage class, and the management groups are listed in the same order as the series named in the complex. (Mokma, D.L., E.P. Whiteside, and J.F. Schneider. 1978. Soil Management Units in Land Use Planning. Mich. State Univ., Ext. Bull. E-1262, 12 pp.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'component', 107, E'vasoimgtgrp', E'va_soil_management_group', E'VA Soil Mgmt Grp', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'va_soil_management_group', E'A system for ranking soils in Virginia for productivity estimates.  Developed by VPI&SU.  See Virginia Agronomic Land Use Evaluation System (VALUES) 1993.');
