INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'mdstatrshipmas', 4, E'cardinality', E'cardinality', E'Cardinality', E'Choice', E'Yes', 254, NULL, NULL, NULL, NULL, E'cardinality', E'Indicates whether the relationship between the left table and right table is one to one (left is one, right is one) or one to many (left is one, right is many).  For a one to one relationship, a record in the left table is related to no more than one record in the right table.  For a one to many relationship, a record in the left table may be related to more than one record in the right table.  Neither cardinality implies that a record in the left table necessarily has a corresponding record in the right table.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'mdstatrshipmas', 5, E'mandatory', E'mandatory', E'Mandatory?', E'Boolean', E'Yes', 3, NULL, NULL, NULL, NULL, NULL, E'Indicates if in order for a record to exist in the right table of a relationship, a corresponding record must exist in the left table of that relationship, i.e. mandatory = "yes".  In other words, when mandatory is "no", a record may exist in the right table of a relationship without having a corresponding record in the left table of that relationship.');
