INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'mdstattabcols', 4, E'collogname', E'column_logical_name', E'Column Logical Name', E'String', E'Yes', 30, NULL, NULL, NULL, NULL, NULL, E'A name associated with a column that is more connotative than the column\'s corresponding physical name.  For a SSURGO table, every column\'s logical name must be unique, making a column\'s logical name a suitable alias for identifying a column.  For SSURGO, column logical names are lower case character strings with no embedded blanks, where individual parts of the logical name may be separated using the underscore character.');
