INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'muaggatt', 11, E'pondfreqprs', E'pondfreq_prs', E'Ponding Frequency - Presence', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'ponding_frequency_map_legend', E'The percentage of the map unit that is subject to water being ponded on the soil surface, expressed as one of four classes; 0-14%, 15-49%, 50-74% or 75-100%.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'muaggatt', 12, E'aws025wta', E'aws_0_25_wta', E'Available Water Storage 0-25 cm - Weighted Average', E'Float', E'No', NULL, 2, NULL, NULL, E'centimeters', NULL, E'Available water storage (AWS).  The volume of water that the soil, to a depth of 25 centimeters, can store that is available to plants.  It is reported as the weighted average of all components in the map unit, and is expressed as centimeters of water.\r\n\r\nAWS is calculated from AWC (available water capacity) which is commonly estimated as the difference between the water contents at 1/10 or 1/3 bar (field capacity) and 15 bars (permanent wilting point) tension, and adjusted for salinity and fragments.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'muaggatt', 13, E'aws050wta', E'aws_0_50_wta', E'Available Water Storage 0-50 cm - Weighted Average', E'Float', E'No', NULL, 2, NULL, NULL, E'centimeters', NULL, E'Available water storage (AWS).  The volume of water that the soil, to a depth of 50 centimeters, can store that is available to plants.  It is reported as the weighted average of all components in the map unit, and is expressed as centimeters of water.\r\n\r\nAWS is calculated from AWC (available water capacity) which is commonly estimated as the difference between the water contents at 1/10 or 1/3 bar (field capacity) and 15 bars (permanent wilting point) tension, and adjusted for salinity and fragments.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'muaggatt', 14, E'aws0100wta', E'aws_0_100_wta', E'Available Water Storage 0-100 cm - Weighted Average', E'Float', E'No', NULL, 2, NULL, NULL, E'centimeters', NULL, E'Available water storage (AWS).  The volume of water that the soil, to a depth of 100 centimeters, can store that is available to plants.  It is reported as the weighted average of all components in the map unit, and is expressed as centimeters of water.\r\n\r\nAWS is calculated from AWC (available water capacity) which is commonly estimated as the difference between the water contents at 1/10 or 1/3 bar (field capacity) and 15 bars (permanent wilting point) tension, and adjusted for salinity and fragments.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'muaggatt', 15, E'aws0150wta', E'aws_0_150_wta', E'Available Water Storage 0-150 cm - Weighted Average', E'Float', E'No', NULL, 2, NULL, NULL, E'centimeters', NULL, E'Available water storage (AWS).  The volume of water that the soil, to a depth of 150 centimeters, can store that is available to plants.  It is reported as the weighted average of all components in the map unit, and is expressed as centimeters of water.\r\n\r\nAWS is calculated from AWC (available water capacity) which is commonly estimated as the difference between the water contents at 1/10 or 1/3 bar (field capacity) and 15 bars (permanent wilting point) tension, and adjusted for salinity and fragments.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'muaggatt', 16, E'drclassdcd', E'drclass_dcd', E'Drainage Class - Dominant Condition', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'drainage_class', E'The natural drainage condition of the soil refers to the frequency and duration of wet periods.  This column displays the dominant drainage class for the map unit, based on composition percentage of each map unit component.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'muaggatt', 17, E'drclasswettest', E'drclass_wettest', E'Drainage Class - Wettest', E'Choice', E'No', 254, NULL, NULL, NULL, NULL, E'drainage_class', E'The natural drainage condition of the soil refers to the frequency and duration of wet periods.  This column displays the wettest drainage class assigned to an individual component of the map unit whose composition in the map unit is equal to or exceeds 15%.');
