INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'sdvattribute', 12, E'nasisrulename', E'nasis_rule_name', E'NASIS Rule Name', E'String', E'No', 60, NULL, NULL, NULL, NULL, NULL, E'A name that uniquely identifies a particular NASIS rule (interpretation).');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'sdvattribute', 13, E'ruledesign', E'rule_design', E'Rule Design', E'Integer', E'No', NULL, NULL, NULL, NULL, NULL, E'rule_design', E'An indicator of the design scheme of the rule.\r\n\r\n1 = limitation\r\n2 = suitability\r\n3 = class\r\n\r\nWhen rule design is either "limitation" or "suitability", this entry provides an indication of which end of the fuzzy value range, 0 or 1, represents the most limiting features.  When rule design is "class", the rating values are not considered to be logically ordered.\r\n\r\nMost non-class interpretive rules are designed such that the most limiting features are those with a fuzzy value closest to 1.  However, non-class interpretive rules that are designed to evaluate the favorable features of a soil, such as the suitability as a gravel source, may be written such that the most limiting features are those with a fuzzy value closest to 0.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'sdvattribute', 14, E'notratedphrase', E'not_rated_phrase', E'Not Rated Phrase', E'String', E'No', 254, NULL, NULL, NULL, NULL, NULL, E'For a soil interpretation, the phrase to be used when a rating cannot be determined.  The default value for this string is "Not rated", but NASIS permits the designer of an interpretation to change this default.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'sdvattribute', 15, E'mapunitlevelattribflag', E'mapunit_level_attribute_flag', E'Map Unit Level Attribute Flag', E'Boolean', E'Yes', NULL, NULL, NULL, NULL, NULL, NULL, E'Indicates if the corresponding attribute is considered to be "at the map unit level", in the map unit table hierarchy.');
