INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'sdvattribute', 19, E'tiebreakdomainname', E'tie_break_domain_name', E'Tie Break Domain Name', E'String', E'No', 40, NULL, NULL, NULL, NULL, NULL, E'In some cases the column that is being aggregated to the map unit level corresponds to an attribute whose values are restricted to a ranked domain.  In this case, this rank value is used to resolve ties.  In order to be able to retrieve this rank value, the corresonding domain name must be provided.');
INSERT INTO "mdstattabcols" ("tabphyname", "colsequence", "colphyname", "collogname", "collabel", "logicaldatatype", "notnull", "fieldsize", "precision", "minimum", "maximum", "uom", "domainname", "coldesc") VALUES (E'sdvattribute', 20, E'tiebreakruleoptionflag', E'tie_break_rule_option_flag', E'Tie Break Rule Option Flag', E'Boolean', E'Yes', NULL, NULL, NULL, NULL, NULL, NULL, E'For intrinsic soil properties, whether ties should select the lowest or highest value may be an arbitrary decision.  In such a case, this flag can be set, and in advanced mode the user can then specify at run time whether the lowest or highest value should be selected in case of a tie.');
