INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1, NULL, E'Map Unit Legend', E'Map Unit Legend', NULL, E'Map Unit Legend', E'0', NULL, NULL, NULL, E'1', E'1', NULL);
