INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (4, NULL, E'Agricultural Disposal of Manure, Food-Processing Waste, and Sewage Sludge', E'Agricultural Disposal of Manure, Food-Processing Waste, and Sewage Sludge', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 2 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'     Soil properties are important considerations in areas where soils are used as sites for the treatment and disposal of organic waste and wastewater. Selection of soils with properties that favor waste management can help to prevent environmental damage.\r\n\r\n     This table shows the degree and kind of soil limitations affecting the treatment of agricultural waste, including municipal and food-processing wastewater and effluent from lagoons or storage ponds. Municipal wastewater is the waste stream from a municipality. It contains domestic waste and may contain industrial waste. It may have received primary or secondary treatment. It is rarely untreated sewage. Food-processing wastewater results from the preparation of fruits, vegetables, milk, cheese, and meats for public consumption. In places it is high in content of sodium and chloride. In the context of this table, the effluent in lagoons and storage ponds is from facilities used to treat or store food-processing wastewater or domestic or animal waste. Domestic and food-processing wastewater is very dilute, and the effluent from the facilities that treat or store it commonly is very low in content of carbonaceous and nitrogenous material; the content of nitrogen commonly ranges from 10 to 30 milligrams per liter. The wastewater from animal waste treatment lagoons or storage ponds, however, has much higher concentrations of these materials, mainly because the manure has not been diluted as much as the domestic waste. The content of nitrogen in this wastewater generally ranges from 50 to 2,000 milligrams per liter. When wastewater is applied, checks should be made to ensure that nitrogen, heavy metals, and salts are not added in excessive amounts.\r\n\r\n     The ratings in the table are for waste management systems that not only dispose of and treat organic waste or wastewater but also are beneficial to crops. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect agricultural waste management. "Not limited" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. "Somewhat limited" indicates that the soil has features that are moderately favorable for the specified use. The limitations can be overcome or minimized by special planning, design, or installation. Fair performance and moderate maintenance can be expected. "Very limited" indicates that the soil has one or more features that are unfavorable for the specified use. The limitations generally cannot be overcome without major soil reclamation, special design, or expensive installation procedures. Poor performance and high maintenance can be expected.\r\n\r\n     Numerical ratings in the tables indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     "Application of manure and food-processing waste" not only disposes of waste material but also can improve crop production by increasing the supply of nutrients in the soils where the material is applied. Manure is the excrement of livestock and poultry, and food-processing waste is damaged fruit and vegetables and the peelings, stems, leaves, pits, and soil particles removed in food preparation. The manure and food-processing waste are solid, slurry, or liquid. Their nitrogen content varies. A high content of nitrogen limits the application rate. Toxic or otherwise dangerous wastes, such as those mixed with the lye used in food processing, are not considered in the ratings.\r\n\r\n     The ratings are based on the soil properties that affect absorption, plant growth, microbial activity, erodibility, the rate at which the waste is applied, and the method by which the waste is applied. The properties that affect absorption include saturated hydraulic conductivity (Ksat), depth to a water table, ponding, the sodium adsorption ratio, depth to bedrock or a cemented pan, and available water capacity. The properties that affect plant growth and microbial activity include reaction, the sodium adsorption ratio, salinity, and bulk density. The wind erodibility group, the soil erodibility factor K, and slope are considered in estimating the likelihood that wind erosion or water erosion will transport the waste material from the application site. Stones, cobbles, a water table, ponding, and flooding can hinder the application of waste. Permanently frozen soils are unsuitable for waste treatment.\r\n\r\n     "Application of sewage sludge" not only disposes of waste material but also can improve crop production by increasing the supply of nutrients in the soils where the material is applied. In the context of this table, sewage sludge is the residual product of the treatment of municipal sewage. The solid component consists mainly of cell mass, primarily bacteria cells that developed during secondary treatment and have incorporated soluble organics into their own bodies. The sludge has small amounts of sand, silt, and other solid debris. The content of nitrogen varies. Some sludge has constituents that are toxic to plants or hazardous to the food chain, such as heavy metals and exotic organic compounds, and should be analyzed chemically prior to use.\r\n\r\n     The content of water in the sludge ranges from about 98 percent to less than 40 percent. The sludge is considered liquid if it is more than about 90 percent water, slurry if it is about 50 to 90 percent water, and solid if it is less than about 50 percent water.\r\n\r\n     The ratings in the table are based on the soil properties that affect absorption, plant growth, microbial activity, erodibility, the rate at which the sludge is applied, and the method by which the sludge is applied. The properties that affect absorption, plant growth, and microbial activity include Ksat, depth to a water table, ponding, the sodium adsorption ratio, depth to bedrock or a cemented pan, available water capacity, reaction, salinity, and bulk density. The wind erodibility group, the soil erodibility factor K, and slope are considered in estimating the likelihood that wind erosion or water erosion will transport the waste material from the application site. Stones, cobbles, a water table, ponding, and flooding can hinder the application of sludge. Permanently frozen soils are unsuitable for waste treatment.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (5, NULL, E'Agricultural Disposal of Wastewater by Rapid Infiltration and Slow Rate Treatment', E'Agricultural Disposal of Wastewater by Rapid Infiltration and Slow Rate Treatment', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 2 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'     Soil properties are important considerations in areas where soils are used as sites for the treatment and disposal of organic waste and wastewater. Selection of soils with properties that favor waste management can help to prevent environmental damage.\r\n\r\n     This table shows the degree and kind of soil limitations affecting the treatment of wastewater, including municipal and food-processing wastewater and effluent from lagoons or storage ponds. Municipal wastewater is the waste stream from a municipality. It contains domestic waste and may contain industrial waste. It may have received primary or secondary treatment. It is rarely untreated sewage. Food-processing wastewater results from the preparation of fruits, vegetables, milk, cheese, and meats for public consumption. In places it is high in content of sodium and chloride. In the context of this table, the effluent in lagoons and storage ponds is from facilities used to treat or store food-processing wastewater or domestic or animal waste. Domestic and food-processing wastewater is very dilute, and the effluent from the facilities that treat or store it commonly is very low in content of carbonaceous and nitrogenous material; the content of nitrogen commonly ranges from 10 to 30 milligrams per liter. The wastewater from animal waste treatment lagoons or storage ponds, however, has much higher concentrations of these materials, mainly because the manure has not been diluted as much as the domestic waste. The content of nitrogen in this wastewater generally ranges from 50 to 2,000 milligrams per liter. When wastewater is applied, checks should be made to ensure that nitrogen, heavy metals, and salts are not added in excessive amounts.\r\n\r\n     The ratings in the table are for waste management systems that not only dispose of and treat wastewater but also are beneficial to crops.  The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect agricultural waste management. "Not limited" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. "Somewhat limited" indicates that the soil has features that are moderately favorable for the specified use. The limitations can be overcome or minimized by special planning, design, or installation. Fair performance and moderate maintenance can be expected. "Very limited" indicates that the soil has one or more features that are unfavorable for the specified use. The limitations generally cannot be overcome without major soil reclamation, special design, or expensive installation procedures. Poor performance and high maintenance can be expected.\r\n\r\n     Numerical ratings in the tables indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     "Rapid infiltration of wastewater" is a process in which wastewater applied in a level basin at a rate of 4 to 120 inches per week percolates through the soil. The wastewater may eventually reach the ground water. The application rate commonly exceeds the rate needed for irrigation of cropland. Vegetation is not a necessary part of the treatment; hence, the basins may or may not be vegetated. The thickness of the soil material needed for proper treatment of the wastewater is more than 72 inches. As a result, geologic and hydrologic investigation is needed to ensure proper design and performance and to determine the risk of ground-water pollution.\r\n\r\n     The ratings in the table are based on the soil properties that affect the risk of pollution and the design, construction, and performance of the system. Depth to a water table, ponding, flooding, and depth to bedrock or a cemented pan affect the risk of pollution and the design and construction of the system. Slope, stones, and cobbles also affect design and construction. Ksat and reaction affect performance. Permanently frozen soils are unsuitable for waste treatment.\r\n\r\n     "Slow rate treatment of wastewater" is a process in which wastewater is applied to land at a rate normally between 0.5 inch and 4.0 inches per week. The application rate commonly exceeds the rate needed for irrigation of cropland. The applied wastewater is treated as it moves through the soil. Much of the treated water may percolate to the ground water, and some enters the atmosphere through evapotranspiration. The applied water generally is not allowed to run off the surface. Waterlogging is prevented either through control of the application rate or through the use of tile drains, or both.\r\n\r\n     The ratings in the table are based on the soil properties that affect absorption, plant growth, microbial activity, erodibility, and the application of waste. The properties that affect absorption include the sodium adsorption ratio, depth to a water table, ponding, available water capacity, Ksat, depth to bedrock or a cemented pan, reaction, the cation-exchange capacity, and slope. Reaction, the sodium adsorption ratio, salinity, and bulk density affect plant growth and microbial activity. The wind erodibility group, the soil erodibility factor K, and slope are considered in estimating the likelihood of wind erosion or water erosion. Stones, cobbles, a water table, ponding, and flooding can hinder the application of waste. Permanently frozen soils are unsuitable for waste treatment.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (6, NULL, E'Irrigated and Nonirrigated Yields by Map Unit Component (includes Land Capability Classification)', E'Irrigated and Nonirrigated Yields by Map Unit Component', E'Yields in the "N" columns are for nonirrigated areas; those in the "I" column are for irrigated areas.  Yields are those that can be expected under a high level of management.  Absence of a yield indicates that the soil is not suited to the crop or the crop generally is not grown on the soil', E'Irrigated and Nonirrigated Yields by Map Unit Component', E'1', 3, E'Report Parameters - Component Crops', 3, E'1', E'1', E'     The average yields per acre that can be expected of the principal crops under a high level of management are shown in this table. In any given year, yields may be higher or lower than those indicated in the table because of variations in rainfall and other climatic factors. \r\n\r\n     The yields are based mainly on the experience and records of farmers, conservationists, and extension agents. Available yield data from nearby counties and results of field trials and demonstrations also are considered.\r\n\r\n     The management needed to obtain the indicated yields of the various crops depends on the kind of soil and the crop. Management can include drainage, erosion control, and protection from flooding; the proper planting and seeding rates; suitable high-yielding crop varieties; appropriate and timely tillage; control of weeds, plant diseases, and harmful insects; favorable soil reaction and optimum levels of nitrogen, phosphorus, potassium, and trace elements for each crop; effective use of crop residue, barnyard manure, and green manure crops; and harvesting that ensures the smallest possible loss.\r\n\r\n     If yields of irrigated crops are given, it is assumed that the irrigation system is adapted to the soils and to the crops grown, that good-quality irrigation water is uniformly applied as needed, and that tillage is kept to a minimum.\r\n\r\n     Pasture yields are expressed in terms of animal unit months. An animal unit month (AUM) is the amount of forage required by one mature cow of approximately 1,000 pounds weight, with or without a calf, for 1 month.\r\n\r\n     The estimated yields reflect the productive capacity of each soil for each of the principal crops. Yields are likely to increase as new production technology is developed. The productivity of a given soil compared with that of other soils, however, is not likely to change.\r\n\r\n     Crops other than those shown in the table are grown in the survey area, but estimated yields are not listed because the acreage of such crops is small. The local office of the Natural Resources Conservation Service or of the Cooperative Extension Service can provide information about the management and productivity of the soils for those crops.\r\n\r\n     The land capability classification of map units in the survey area is shown in this table. This classification shows, in a general way, the suitability of soils for most kinds of field crops (United States Department of Agriculture, Soil Conservation Service, 1961). Crops that require special management are excluded. The soils are grouped according to their limitations for field crops, the risk of damage if they are used for crops, and the way they respond to management. The criteria used in grouping the soils do not include major and generally expensive landforming that would change slope, depth, or other characteristics of the soils, nor do they include possible but unlikely major reclamation projects. Capability classification is not a substitute for interpretations designed to show suitability and limitations of groups of soils for rangeland, for forestland, or for engineering purposes.\r\n\r\n     In the capability system, soils are generally grouped at three levels--capability class, subclass, and unit.\r\n\r\n     "Capability classes," the broadest groups, are designated by the numbers 1 through 8. The numbers indicate progressively greater limitations and narrower choices for practical use. The classes are defined as follows:\r\n\r\n     Class 1 soils have slight limitations that restrict their use.\r\n\r\n     Class 2 soils have moderate limitations that restrict the choice of plants or that require moderate conservation practices.\r\n\r\n     Class 3 soils have severe limitations that restrict the choice of plants or that require special conservation practices, or both.\r\n\r\n     Class 4 soils have very severe limitations that restrict the choice of plants or that require very careful management, or both.\r\n\r\n     Class 5 soils are subject to little or no erosion but have other limitations, impractical to remove, that restrict their use mainly to pasture, rangeland, forestland, or wildlife habitat. \r\n     Class 6 soils have severe limitations that make them generally unsuitable for cultivation and that restrict their use mainly to pasture, rangeland, forestland, or wildlife habitat.\r\n\r\n     Class 7 soils have very severe limitations that make them unsuitable for cultivation and that restrict their use mainly to grazing, forestland, or wildlife habitat.\r\n\r\n     Class 8 soils and miscellaneous areas have limitations that preclude commercial plant production and that restrict their use to recreational purposes, wildlife habitat, watershed, or esthetic purposes.\r\n\r\n     "Capability subclasses" are soil groups within one class. They are designated by adding a small letter, "e," "w," "s," or "c," to the class numeral, for example, 2e. The letter "e" shows that the main hazard is the risk of erosion unless close-growing plant cover is maintained; "w" shows that water in or on the soil interferes with plant growth or cultivation (in some soils the wetness can be partly corrected by artificial drainage); "s" shows that the soil is limited mainly because it is shallow, droughty, or stony; and "c," used in only some parts of the United States, shows that the chief limitation is climate that is very cold or very dry.\r\n\r\n     In class 1 there are no subclasses because the soils of this class have few limitations. Class 5 contains only the subclasses indicated by "w," "s," or "c" because the soils in class 5 are subject to little or no erosion. They have other limitations that restrict their use to pasture, rangeland, forestland, wildlife habitat, or recreation.\r\n\r\n     "Capability units" are soil groups within a subclass. The soils in a capability unit are enough alike to be suited to the same crops and pasture plants, to require similar management, and to have similar productivity. Capability units are generally designated by adding an Arabic numeral to the subclass symbol, for example, 2e-4 and 3e-6. These units are not given in all soil surveys.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Soil Conservation Service. 1961. Land capability classification. U.S. Department of Agriculture Handbook 210.');
