ty system, soils are generally grouped at three levels--capability class, subclass, and unit.\r\n\r\n     "Capability classes," the broadest groups, are designated by the numbers 1 through 8. The numbers indicate progressively greater limitations and narrower choices for practical use. The classes are defined as follows:\r\n\r\n     Class 1 soils have slight limitations that restrict their use.\r\n\r\n     Class 2 soils have moderate limitations that restrict the choice of plants or that require moderate conservation practices.\r\n\r\n     Class 3 soils have severe limitations that restrict the choice of plants or that require special conservation practices, or both.\r\n\r\n     Class 4 soils have very severe limitations that restrict the choice of plants or that require very careful management, or both.\r\n\r\n     Class 5 soils are subject to little or no erosion but have other limitations, impractical to remove, that restrict their use mainly to pasture, rangeland, forestland, or wildlife habitat. \r\n     Class 6 soils have severe limitations that make them generally unsuitable for cultivation and that restrict their use mainly to pasture, rangeland, forestland, or wildlife habitat.\r\n\r\n     Class 7 soils have very severe limitations that make them unsuitable for cultivation and that restrict their use mainly to grazing, forestland, or wildlife habitat.\r\n\r\n     Class 8 soils and miscellaneous areas have limitations that preclude commercial plant production and that restrict their use to recreational purposes, wildlife habitat, watershed, or esthetic purposes.\r\n\r\n     "Capability subclasses" are soil groups within one class. They are designated by adding a small letter, "e," "w," "s," or "c," to the class numeral, for example, 2e. The letter "e" shows that the main hazard is the risk of erosion unless close-growing plant cover is maintained; "w" shows that water in or on the soil interferes with plant growth or cultivation (in some soils the wetness can be partly corrected by artificial drainage); "s" shows that the soil is limited mainly because it is shallow, droughty, or stony; and "c," used in only some parts of the United States, shows that the chief limitation is climate that is very cold or very dry.\r\n\r\n     In class 1 there are no subclasses because the soils of this class have few limitations. Class 5 contains only the subclasses indicated by "w," "s," or "c" because the soils in class 5 are subject to little or no erosion. They have other limitations that restrict their use to pasture, rangeland, forestland, wildlife habitat, or recreation.\r\n\r\n     "Capability units" are soil groups within a subclass. The soils in a capability unit are enough alike to be suited to the same crops and pasture plants, to require similar management, and to have similar productivity. Capability units are generally designated by adding an Arabic numeral to the subclass symbol, for example, 2e-4 and 3e-6. These units are not given in all soil surveys.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Soil Conservation Service. 1961. Land capability classification. U.S. Department of Agriculture Handbook 210.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (10, NULL, E'Irrigated Yields by Map Unit (includes Land Capability Classification)', E'Irrigated Yields by Map Unit', E'Yields are those that can be expected under a high level of management.  They are for irrigated areas.  Absence of a yield indicates that the soil is not suited to the crop or the crop generally is not grown on the soil', E'Irrigated Yields by Map Unit', E'1', 5, E'Report Parameters - Mapunit Crops', 1, E'1', E'1', E'     The average yields per acre that can be expected of the principal crops under a high level of management are shown in this table. In any given year, yields may be higher or lower than those indicated in the table because of variations in rainfall and other climatic factors. \r\n\r\n     The yields are based mainly on the experience and records of farmers, conservationists, and extension agents. Available yield data from nearby counties and results of field trials and demonstrations also are considered.\r\n\r\n     The management needed to obtain the indicated yields of the various crops depends on the kind of soil and the crop. Management can include drainage, erosion control, and protection from flooding; the proper planting and seeding rates; suitable high-yielding crop varieties; appropriate and timely tillage; control of weeds, plant diseases, and harmful insects; favorable soil reaction and optimum levels of nitrogen, phosphorus, potassium, and trace elements for each crop; effective use of crop residue, barnyard manure, and green manure crops; and harvesting that ensures the smallest possible loss.\r\n\r\n     If yields of irrigated crops are given, it is assumed that the irrigation system is adapted to the soils and to the crops grown, that good-quality irrigation water is uniformly applied as needed, and that tillage is kept to a minimum.\r\n\r\n     Pasture yields are expressed in terms of animal unit months. An animal unit month (AUM) is the amount of forage required by one mature cow of approximately 1,000 pounds weight, with or without a calf, for 1 month.\r\n\r\n     The estimated yields reflect the productive capacity of each soil for each of the principal crops. Yields are likely to increase as new production technology is developed. The productivity of a given soil compared with that of other soils, however, is not likely to change.\r\n\r\n     Crops other than those shown in the table are grown in the survey area, but estimated yields are not listed because the acreage of such crops is small. The local office of the Natural Resources Conservation Service or of the Cooperative Extension Service can provide information about the management and productivity of the soils for those crops.\r\n\r\n     The land capability classification of map units in the survey area is shown in this table. This classification shows, in a general way, the suitability of soils for most kinds of field crops (United States Department of Agriculture, Soil Conservation Service, 1961). Crops that require special management are excluded. The soils are grouped according to their limitations for field crops, the risk of damage if they are used for crops, and the way they respond to management. The criteria used in grouping the soils do not include major and generally expensive landforming that would change slope, depth, or other characteristics of the soils, nor do they include possible but unlikely major reclamation projects. Capability classification is not a substitute for interpretations designed to show suitability and limitations of groups of soils for rangeland, for forestland, or for engineering purposes.\r\n\r\n     In the capability system, soils are generally grouped at three levels--capability class, subclass, and unit.\r\n\r\n     "Capability classes," the broadest groups, are designated by the numbers 1 through 8. The numbers indicate progressively greater limitations and narrower choices for practical use. The classes are defined as follows:\r\n\r\n     Class 1 soils have slight limitations that restrict their use.\r\n\r\n     Class 2 soils have moderate limitations that restrict the choice of plants or that require moderate conservation practices.\r\n\r\n     Class 3 soils have severe limitations that restrict the choice of plants or that require special conservation practices, or both.\r\n\r\n     Class 4 soils have very severe limitations that restrict the choice of plants or that require very careful management, or both.\r\n\r\n     Class 5 soils are subject to little or no erosion but have other limitations, impractical to remove, that restrict their use mainly to pasture, rangeland, forestland, or wildlife habitat. \r\n     Class 6 soils have severe limitations that make them generally unsuitable for cultivation and that restrict their use mainly to pasture, rangeland, forestland, or wildlife habitat.\r\n\r\n     Class 7 soils have very severe limitations that make them unsuitable for cultivation and that restrict their use mainly to grazing, forestland, or wildlife habitat.\r\n\r\n     Class 8 soils and miscellaneous areas have limitations that preclude commercial plant production and that restrict their use to recreational purposes, wildlife habitat, watershed, or esthetic purposes.\r\n\r\n     "Capability subclasses" are soil groups within one class. They are designated by adding a small letter, "e," "w," "s," or "c," to the class numeral, for example, 2e. The letter "e" shows that the main hazard is the risk of erosion unless close-growing plant cover is maintained; "w" shows that water in or on the soil interferes with plant growth or cultivation (in some soils the wetness can be partly corrected by artificial drainage); "s" shows that the soil is limited mainly because it is shallow, droughty, or stony; and "c," used in only some parts of the United States, shows that the chief limitation is climate that is very cold or very dry.\r\n\r\n     In class 1 there are no subclasses because the soils of this class have few limitations. Class 5 contains only the subclasses indicated by "w," "s," or "c" because the soils in class 5 are subject to little or no erosion. They have other limitations that restrict their use to pasture, rangeland, forestland, wildlife habitat, or recreation.\r\n\r\n     "Capability units" are soil groups within a subclass. The soils in a capability unit are enough alike to be suited to the same crops and pasture plants, to require similar management, and to have similar productivity. Capability units are generally designated by adding an Arabic numeral to the subclass symbol, for example, 2e-4 and 3e-6. These units are not given in all soil surveys.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Soil Conservation Service. 1961. Land capability classification. U.S. Department of Agriculture Handbook 210.');
