e generally grouped at three levels--capability class, subclass, and unit.\r\n\r\n     "Capability classes," the broadest groups, are designated by the numbers 1 through 8. The numbers indicate progressively greater limitations and narrower choices for practical use. The classes are defined as follows:\r\n\r\n     Class 1 soils have slight limitations that restrict their use.\r\n\r\n     Class 2 soils have moderate limitations that restrict the choice of plants or that require moderate conservation practices.\r\n\r\n     Class 3 soils have severe limitations that restrict the choice of plants or that require special conservation practices, or both.\r\n\r\n     Class 4 soils have very severe limitations that restrict the choice of plants or that require very careful management, or both.\r\n\r\n     Class 5 soils are subject to little or no erosion but have other limitations, impractical to remove, that restrict their use mainly to pasture, rangeland, forestland, or wildlife habitat. \r\n     Class 6 soils have severe limitations that make them generally unsuitable for cultivation and that restrict their use mainly to pasture, rangeland, forestland, or wildlife habitat.\r\n\r\n     Class 7 soils have very severe limitations that make them unsuitable for cultivation and that restrict their use mainly to grazing, forestland, or wildlife habitat.\r\n\r\n     Class 8 soils and miscellaneous areas have limitations that preclude commercial plant production and that restrict their use to recreational purposes, wildlife habitat, watershed, or esthetic purposes.\r\n\r\n     "Capability subclasses" are soil groups within one class. They are designated by adding a small letter, "e," "w," "s," or "c," to the class numeral, for example, 2e. The letter "e" shows that the main hazard is the risk of erosion unless close-growing plant cover is maintained; "w" shows that water in or on the soil interferes with plant growth or cultivation (in some soils the wetness can be partly corrected by artificial drainage); "s" shows that the soil is limited mainly because it is shallow, droughty, or stony; and "c," used in only some parts of the United States, shows that the chief limitation is climate that is very cold or very dry.\r\n\r\n     In class 1 there are no subclasses because the soils of this class have few limitations. Class 5 contains only the subclasses indicated by "w," "s," or "c" because the soils in class 5 are subject to little or no erosion. They have other limitations that restrict their use to pasture, rangeland, forestland, wildlife habitat, or recreation.\r\n\r\n     "Capability units" are soil groups within a subclass. The soils in a capability unit are enough alike to be suited to the same crops and pasture plants, to require similar management, and to have similar productivity. Capability units are generally designated by adding an Arabic numeral to the subclass symbol, for example, 2e-4 and 3e-6. These units are not given in all soil surveys.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Soil Conservation Service. 1961. Land capability classification. U.S. Department of Agriculture Handbook 210.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (12, NULL, E'Rangeland Productivity', E'Rangeland Productivity', E'Only the soils that support rangeland vegetation suitable for grazing are rated', E'Rangeland Productivity', E'0', NULL, NULL, NULL, E'1', E'1', E'     In areas that have similar climate and topography, differences in the kind and amount of vegetation produced on rangeland are closely related to the kind of soil. Effective management is based on the relationship between the soils and vegetation and water.\r\n\r\n     This table shows, for each soil that supports rangeland vegetation, the ecological site and the potential annual production of vegetation in favorable, normal, and unfavorable years. An explanation of the column headings in the table follows.\r\n\r\n     An "ecological site" is the product of all the environmental factors responsible for its development. It has characteristic soils that have developed over time throughout the soil development process; a characteristic hydrology, particularly infiltration and runoff, that has developed over time; and a characteristic plant community (kind and amount of vegetation). The hydrology of a site is influenced by development of the soil and plant community. The vegetation, soils, and hydrology are all interrelated. Each is influenced by the others and influences the development of the others. The plant community on an ecological site is typified by an association of species that differs from that of other ecological sites in the kind and/or proportion of species or in total production. Descriptions of ecological sites are provided in the Field Office Technical Guide, which is available in local offices of the Natural Resources Conservation Service (NRCS).\r\n\r\n     "Total dry-weight production" is the amount of vegetation that can be expected to grow annually on well managed rangeland that is supporting the potential natural plant community. It includes all vegetation, whether or not it is palatable to grazing animals. It includes the current year\'s growth of leaves, twigs, and fruits of woody plants. It does not include the increase in stem diameter of trees and shrubs. It is expressed in pounds per acre of air-dry vegetation for favorable, normal, and unfavorable years. In a favorable year, the amount and distribution of precipitation and the temperatures make growing conditions substantially better than average. In a normal year, growing conditions are about average. In an unfavorable year, growing conditions are well below average, generally because of low available soil moisture. Yields are adjusted to a common percent of air-dry moisture content.\r\n\r\n     Range management requires knowledge of the kinds of soil and of the potential natural plant community. It also requires an evaluation of the present range similarity index and rangeland trend. Range similarity index is determined by comparing the present plant community with the potential natural plant community on a particular rangeland ecological site. The more closely the existing community resembles the potential community, the higher the range similarity index. Rangeland trend is defined as the direction of change in an existing plant community relative to the potential natural plant community. Further information about the range similarity index and rangeland trend is available in the "National Range and Pasture Handbook," which is available in local offices of NRCS or on the Internet.\r\n\r\n     The objective in range management is to control grazing so that the plants growing on a site are about the same in kind and amount as the potential natural plant community for that site. Such management generally results in the optimum production of vegetation, control of undesirable brush species, conservation of water, and control of erosion. Sometimes, however, an area with a range similarity index somewhat below the potential meets grazing needs, provides wildlife habitat, and protects soil and water resources.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Natural Resources Conservation Service. National range and pasture handbook. (http://www.nrcs.usda.gov/technical/range.html)');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (13, NULL, E'Rangeland Productivity and Plant Composition', E'Rangeland Productivity and Plant Composition', E'Only the soils that support rangeland vegetation suitable for grazing are rated', E'Rangeland Productivity and Plant Composition', E'0', NULL, NULL, NULL, E'1', E'1', E'     In areas that have similar climate and topography, differences in the kind and amount of rangeland or forest understory vegetation are closely related to the kind of soil. Effective management is based on the relationship between the soils and vegetation and water.\r\n\r\n     This table shows, for each soil that supports vegetation suitable for grazing, the ecological site; the total annual production of vegetation in favorable, normal, and unfavorable years; the characteristic vegetation; and the average percentage of each species. An explanation of the column headings in the table follows.\r\n\r\n     An "ecological site" is the product of all the environmental factors responsible for its development. It has characteristic soils that have developed over time throughout the soil development process; a characteristic hydrology, particularly infiltration and runoff that has developed over time; and a characteristic plant community (kind and amount of vegetation). The hydrology of the site is influenced by development of the soil and plant community. The vegetation, soils, and hydrology are all interrelated. Each is influenced by the others and influences the development of the others. The plant community on an ecological site is typified by an association of species that differs from that of other ecological sites in the kind and/or proportion of species or in total production. Descriptions of ecological sites are provided in the Field Office Technical Guide, which is available in local offices of the Natural Resources Conservation Service (NRCS).\r\n\r\n     "Total dry-weight production" is the amount of vegetation that can be expected to grow annually in a well managed area that is supporting the potential natural plant community. It includes all vegetation, whether or not it is palatable to grazing animals. It includes the current year\'s growth of leaves, twigs, and fruits of woody plants. It does not include the increase in stem diameter of trees and shrubs. It is expressed in pounds per acre of air-dry vegetation for favorable, normal, and unfavorable years. In a favorable year, the amount and distribution of precipitation and the temperatures make growing conditions substantially better than average. In a normal year, growing conditions are about average. In an unfavorable year, growing conditions are well below average, generally because of low available soil moisture. Yields are adjusted to a common percent of air-dry moisture content.\r\n\r\n     "Characteristic vegetation" (the grasses, forbs, and shrubs that make up most of the potential natural plant community on each soil) is listed by common name. Under "rangeland composition," the expected percentage of the total annual production is given for each species making up the characteristic vegetation. The amount that can be used as forage depends on the kinds of grazing animals and on the grazing season.\r\n\r\n     Range management requires knowledge of the kinds of soil and of the potential natural plant community. It also requires an evaluation of the present range similarity index and rangeland trend. Range similarity index is determined by comparing the present plant community with the potential natural plant community on a particular rangeland ecological site. The more closely the existing community resembles the potential community, the higher the range similarity index. Rangeland trend is defined as the direction of change in an existing plant community relative to the potential natural plant community. Further information about the range similarity index and rangeland trend is available in the "National Range and Pasture Handbook," which is available in local offices of NRCS or on the Internet.\r\n\r\n     The objective in range management is to control grazing so that the plants growing on a site are about the same in kind and amount as the potential natural plant community for that site. Such management generally results in the optimum production of vegetation, control of undesirable brush species, conservation of water, and control of erosion. Sometimes, however, an area with a range similarity index somewhat below the potential meets grazing needs, provides wildlife habitat, and protects soil and water resources.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Natural Resources Conservation Service. National range and pasture handbook. (http://www.nrcs.usda.gov/technical/range.html)');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (14, NULL, E'Forestland Productivity', E'Forestland Productivity', NULL, E'Forestland Productivity', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table can help forestland owners or managers plan the use of soils for wood crops. It shows the potential productivity of the soils for wood crops.\r\n\r\n     "Potential productivity" of merchantable or "common trees" on a soil is expressed as a site index and as a volume number. The "site index" is the average height, in feet, that dominant and codominant trees of a given species attain in a specified number of years. The site index applies to fully stocked, even-aged, unmanaged stands. Commonly grown trees are those that forestland managers generally favor in intermediate or improvement cuttings. They are selected on the basis of growth rate, quality, value, and marketability. More detailed information regarding site index is available in the "National Forestry Manual," which is available in local offices of the Natural Resources Conservation Service or on the Internet.\r\n\r\n     The "volume of wood fiber," a number, is the yield likely to be produced by the most important tree species. This number, expressed as cubic feet per acre per year and calculated at the age of culmination of the mean annual increment (CMAI), indicates the amount of fiber produced in a fully stocked, even-aged, unmanaged stand.\r\n\r\n     "Trees to manage" are those that are preferred for planting, seeding, or natural regeneration and those that remain in the stand after thinning or partial harvest.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Natural Resources Conservation Service. National forestry manual. (http://soils.usda.gov/technical/nfhandbook/)');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (15, NULL, E'Source of Sand and Gravel', E'Source of Sand and Gravel', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.00 to 0.99.  The larger the value, the greater the likelihood that the bottom layer or thickest layer of the soil is a source of sand or gravel', E'Source of Sand and Gravel', E'0', NULL, NULL, NULL, E'0', E'1', E'     This table gives information about the soils as potential sources of gravel and sand. Normal compaction, minor processing, and other standard construction practices are assumed.\r\n\r\n     Sand and gravel are natural aggregates suitable for commercial use with a minimum of processing. They are used in many kinds of construction. Specifications for each use vary widely.  Only the likelihood of finding material in suitable quantity is evaluated. The suitability of the material for specific purposes is not evaluated, nor are factors that affect excavation of the material. The properties used to evaluate the soil as a source of sand or gravel are gradation of grain sizes (as indicated by the Unified classification of the soil), the thickness of suitable material, and the content of rock fragments. If the bottom layer of the soil contains sand or gravel, the soil is considered a likely source regardless of thickness. The assumption is that the sand or gravel layer below the depth of observation exceeds the minimum thickness. The ratings are for the whole soil, from the surface to a depth of about 6 feet.\r\n\r\n     The soils are rated "good," "fair," or "poor" as potential sources of sand and gravel. A rating of "good" or "fair" means that the source material is likely to be in or below the soil. The bottom layer and the thickest layer of the soils are assigned numerical ratings. These ratings indicate the likelihood that the layer is a source of sand or gravel. The number 0.00 indicates that the layer is a poor source. The number 1.00 indicates that the layer is a good source. A number between 0.00 and 1.00 indicates the degree to which the layer is a likely source.\r\n\r\n     Information in this table is intended for land use planning, for evaluating land use alternatives, and for planning site investigations prior to design and construction. The information, however, has limitations. For example, estimates and other data generally apply only to that part of the soil between the surface and a depth of 5 to 7 feet. Because of the map scale, small areas of different soils may be included within the mapped areas of a specific soil.\r\n\r\n     The information is not site specific and does not eliminate the need for onsite investigation of the soils or for testing and analysis by personnel experienced in the design and construction of engineering works.\r\n\r\n     Government ordinances and regulations that restrict certain land uses or impose specific design criteria were not considered in preparing the information in this table. Local ordinances and regulations should be considered in planning, in site selection, and in design.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (16, NULL, E'Source of Reclamation Material, Roadfill, and Topsoil', E'Source of Reclamation Material, Roadfill, and Topsoil', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.00 to 0.99.  The smaller the value, the greater the limitation', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'0', E'1', E'     This table gives information about the soils as potential sources of reclamation material, roadfill, and topsoil. Normal compaction, minor processing, and other standard construction practices are assumed.\r\n\r\n     The soils are rated "good," "fair," or "poor" as potential sources of reclamation material, roadfill, and topsoil. The features that limit the soils as sources of these materials are specified in the table. Numerical ratings between 0.00 and 0.99 are given after the specified features. These numbers indicate the degree to which the features limit the soils as sources of topsoil, reclamation material, or roadfill. The lower the number, the greater the limitation.\r\n\r\n     "Reclamation material" is used in areas that have been drastically disturbed by surface mining or similar activities. When these areas are reclaimed, layers of soil material or unconsolidated geological material, or both, are replaced in a vertical sequence. The reconstructed soil favors plant growth. The ratings in the table do not apply to quarries and other mined areas that require an offsite source of reconstruction material. The ratings are based on the soil properties that affect erosion and stability of the surface and the productive potential of the reconstructed soil. These properties include the content of sodium, salts, and calcium carbonate; reaction; available water capacity; erodibility; texture; content of rock fragments; and content of organic matter and other features that affect fertility.\r\n\r\n     "Roadfill" is soil material that is excavated in one place and used in road embankments in another place. In this table, the soils are rated as a source of roadfill for low embankments, generally less than 6 feet high and less exacting in design than higher embankments. The ratings are for the whole soil, from the surface to a depth of about 5 feet. It is assumed that soil layers will be mixed when the soil material is excavated and spread.\r\n\r\n     The ratings are based on the amount of suitable material and on soil properties that affect the ease of excavation and the performance of the material after it is in place. The thickness of the suitable material is a major consideration. The ease of excavation is affected by large stones, depth to a water table, and slope. How well the soil performs in place after it has been compacted and drained is determined by its strength (as inferred from the AASHTO classification of the soil) and linear extensibility (shrink-swell potential).\r\n\r\n     "Topsoil" is used to cover an area so that vegetation can be established and maintained. The upper 40 inches of a soil is evaluated for use as topsoil. Also evaluated is the reclamation potential of the borrow area. The ratings are based on the soil properties that affect plant growth; the ease of excavating, loading, and spreading the material; and reclamation of the borrow area. Toxic substances, soil reaction, and the properties that are inferred from soil texture, such as available water capacity and fertility, affect plant growth. The ease of excavating, loading, and spreading is affected by rock fragments, slope, depth to a water table, soil texture, and thickness of suitable material. Reclamation of the borrow area is affected by slope, depth to a water table, rock fragments, depth to bedrock or a cemented pan, and toxic material.\r\n\r\n     The surface layer of most soils is generally preferred for topsoil because of its organic matter content. Organic matter greatly increases the absorption and retention of moisture and nutrients for plant growth.\r\n\r\n     Information in this table is intended for land use planning, for evaluating land use alternatives, and for planning site investigations prior to design and construction. The information, however, has limitations. For example, estimates and other data generally apply only to that part of the soil between the surface and a depth of 5 to 7 feet. Because of the map scale, small areas of different soils may be included within the mapped areas of a specific soil.\r\n\r\n     The information is not site specific and does not eliminate the need for onsite investigation of the soils or for testing and analysis by personnel experienced in the design and construction of engineering works.\r\n\r\n     Government ordinances and regulations that restrict certain land uses or impose specific design criteria were not considered in preparing the information in this table. Local ordinances and regulations should be considered in planning, in site selection, and in design.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (17, NULL, E'Dwellings and Small Commercial Buildings', E'Dwellings and Small Commercial Buildings', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'0', E'1', E'     Soil properties influence the development of building sites, including the selection of the site, the design of the structure, construction, performance after construction, and maintenance. This table shows the degree and kind of soil limitations that affect dwellings and small commercial buildings.\r\n\r\n     The ratings in the table are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect building site development. "Not limited" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. "Somewhat limited" indicates that the soil has features that are moderately favorable for the specified use. The limitations can be overcome or minimized by special planning, design, or installation. Fair performance and moderate maintenance can be expected. "Very limited" indicates that the soil has one or more features that are unfavorable for the specified use. The limitations generally cannot be overcome without major soil reclamation, special design, or expensive installation procedures. Poor performance and high maintenance can be expected.\r\n\r\n     Numerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     "Dwellings" are single-family houses of three stories or less. For dwellings without basements, the foundation is assumed to consist of spread footings of reinforced concrete built on undisturbed soil at a depth of 2 feet or at the depth of maximum frost penetration, whichever is deeper. For dwellings with basements, the foundation is assumed to consist of spread footings of reinforced concrete built on undisturbed soil at a depth of about 7 feet. The ratings for dwellings are based on the soil properties that affect the capacity of the soil to support a load without movement and on the properties that affect excavation and construction costs. The properties that affect the load-supporting capacity include depth to a water table, ponding, flooding, subsidence, linear extensibility (shrink-swell potential), and compressibility. Compressibility is inferred from the Unified classification. The properties that affect the ease and amount of excavation include depth to a water table, ponding, flooding, slope, depth to bedrock or a cemented pan, hardness of bedrock or a cemented pan, and the amount and size of rock fragments.\r\n\r\n     "Small commercial buildings" are structures that are less than three stories high and do not have basements. The foundation is assumed to consist of spread footings of reinforced concrete built on undisturbed soil at a depth of 2 feet or at the depth of maximum frost penetration, whichever is deeper. The ratings are based on the soil properties that affect the capacity of the soil to support a load without movement and on the properties that affect excavation and construction costs. The properties that affect the load-supporting capacity include depth to a water table, ponding, flooding, subsidence, linear extensibility (shrink-swell potential), and compressibility (which is inferred from the Unified classification). The properties that affect the ease and amount of excavation include flooding, depth to a water table, ponding, slope, depth to bedrock or a cemented pan, hardness of bedrock or a cemented pan, and the amount and size of rock fragments.\r\n\r\n     Information in this table is intended for land use planning, for evaluating land use alternatives, and for planning site investigations prior to design and construction. The information, however, has limitations. For example, estimates and other data generally apply only to that part of the soil between the surface and a depth of 5 to 7 feet. Because of the map scale, small areas of different soils may be included within the mapped areas of a specific soil.\r\n\r\n     The information is not site specific and does not eliminate the need for onsite investigation of the soils or for testing and analysis by personnel experienced in the design and construction of engineering works.\r\n\r\n     Government ordinances and regulations that restrict certain land uses or impose specific design criteria were not considered in preparing the information in this table. Local ordinances and regulations should be considered in planning, in site selection, and in design.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (18, NULL, E'Roads and Streets, Shallow Excavations, and Lawns and Landscaping', E'Roads and Streets, Shallow Excavations, and Lawns and Landscaping', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'0', E'1', E'     Soil properties influence the development of building sites, including the selection of the site, the design of the structure, construction, performance after construction, and maintenance. This table shows the degree and kind of soil limitations that affect local roads and streets, shallow excavations, and lawns and landscaping.\r\n\r\n     The ratings in the table are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect building site development. "Not limited" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. "Somewhat limited" indicates that the soil has features that are moderately favorable for the specified use. The limitations can be overcome or minimized by special planning, design, or installation. Fair performance and moderate maintenance can be expected. "Very limited" indicates that the soil has one or more features that are unfavorable for the specified use. The limitations generally cannot be overcome without major soil reclamation, special design, or expensive installation procedures. Poor performance and high maintenance can be expected.\r\n\r\n     Numerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     "Local roads and streets" have an all-weather surface and carry automobile and light truck traffic all year. They have a subgrade of cut or fill soil material; a base of gravel, crushed rock, or soil material stabilized by lime or cement; and a surface of flexible material (asphalt), rigid material (concrete), or gravel with a binder. The ratings are based on the soil properties that affect the ease of excavation and grading and the traffic-supporting capacity. The properties that affect the ease of excavation and grading are depth to bedrock or a cemented pan, hardness of bedrock or a cemented pan, depth to a water table, ponding, flooding, the amount of large stones, and slope. The properties that affect the traffic-supporting capacity are soil strength (as inferred from the AASHTO group index number), subsidence, linear extensibility (shrink-swell potential), the potential for frost action, depth to a water table, and ponding.\r\n\r\n     "Shallow excavations" are trenches or holes dug to a maximum depth of 5 or 6 feet for graves, utility lines, open ditches, or other purposes. The ratings are based on the soil properties that influence the ease of digging and the resistance to sloughing. Depth to bedrock or a cemented pan, hardness of bedrock or a cemented pan, the amount of large stones, and dense layers influence the ease of digging, filling, and compacting. Depth to the seasonal high water table, flooding, and ponding may restrict the period when excavations can be made. Slope influences the ease of using machinery. Soil texture, depth to the water table, and linear extensibility (shrink-swell potential) influence the resistance to sloughing.\r\n\r\n     "Lawns and landscaping" require soils on which turf and ornamental trees and shrubs can be established and maintained. Irrigation is not considered in the ratings. The ratings are based on the soil properties that affect plant growth and trafficability after vegetation is established. The properties that affect plant growth are reaction; depth to a water table; ponding; depth to bedrock or a cemented pan; the available water capacity in the upper 40 inches; the content of salts, sodium, or calcium carbonate; and sulfidic materials. The properties that affect trafficability are flooding, depth to a water table, ponding, slope, stoniness, and the amount of sand, clay, or organic matter in the surface layer.\r\n\r\n     Information in this table is intended for land use planning, for evaluating land use alternatives, and for planning site investigations prior to design and construction. The information, however, has limitations. For example, estimates and other data generally apply only to that part of the soil between the surface and a depth of 5 to 7 feet. Because of the map scale, small areas of different soils may be included within the mapped areas of a specific soil.\r\n\r\n     The information is not site specific and does not eliminate the need for onsite investigation of the soils or for testing and analysis by personnel experienced in the design and construction of engineering works.\r\n\r\n     Government ordinances and regulations that restrict certain land uses or impose specific design criteria were not considered in preparing the information in this table. Local ordinances and regulations should be considered in planning, in site selection, and in design.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (19, NULL, E'Sewage Disposal', E'Sewage Disposal', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 2 Interpretations', E'0', NULL, NULL, NULL, E'0', E'1', E'     This table shows the degree and kind of soil limitations that affect septic tank absorption fields and sewage lagoons. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect these uses. "Not limited" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. "Somewhat limited" indicates that the soil has features that are moderately favorable for the specified use. The limitations can be overcome or minimized by special planning, design, or installation. Fair performance and moderate maintenance can be expected. "Very limited" indicates that the soil has one or more features that are unfavorable for the specified use. The limitations generally cannot be overcome without major soil reclamation, special design, or expensive installation procedures. Poor performance and high maintenance can be expected.\r\n\r\n     Numerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     "Septic tank absorption fields" are areas in which effluent from a septic tank is distributed into the soil through subsurface tiles or perforated pipe. Only that part of the soil between depths of 24 and 60 inches is evaluated. The ratings are based on the soil properties that affect absorption of the effluent, construction and maintenance of the system, and public health. Saturated hydraulic conductivity (Ksat), depth to a water table, ponding, depth to bedrock or a cemented pan, and flooding affect absorption of the effluent. Stones and boulders, ice, and bedrock or a cemented pan interfere with installation. Subsidence interferes with installation and maintenance. Excessive slope may cause lateral seepage and surfacing of the effluent in downslope areas.\r\n\r\n     Some soils are underlain by loose sand and gravel or fractured bedrock at a depth of less than 4 feet below the distribution lines. In these soils the absorption field may not adequately filter the effluent, particularly when the system is new. As a result, the ground water may become contaminated.\r\n\r\n     "Sewage lagoons" are shallow ponds constructed to hold sewage while aerobic bacteria decompose the solid and liquid wastes. Lagoons should have a nearly level floor surrounded by cut slopes or embankments of compacted soil. Nearly impervious soil material for the lagoon floor and sides is required to minimize seepage and contamination of ground water. Considered in the ratings are slope, Ksat, depth to a water table, ponding, depth to bedrock or a cemented pan, flooding, large stones, and content of organic matter.\r\n\r\n     Ksat is a critical property affecting the suitability for sewage lagoons. Most porous soils eventually become sealed when they are used as sites for sewage lagoons. Until sealing occurs, however, the hazard of pollution is severe. Soils that have a Ksat rate of more than 14 micrometers per second are too porous for the proper functioning of sewage lagoons. In these soils, seepage of the effluent can result in contamination of the ground water. Ground-water contamination is also a hazard if fractured bedrock is within a depth of 40 inches, if the water table is high enough to raise the level of sewage in the lagoon, or if floodwater overtops the lagoon.\r\n\r\n     A high content of organic matter is detrimental to proper functioning of the lagoon because it inhibits aerobic activity. Slope, bedrock, and cemented pans can cause construction problems, and large stones can hinder compaction of the lagoon floor. If the lagoon is to be uniformly deep throughout, the slope must be gentle enough and the soil material must be thick enough over bedrock or a cemented pan to make land smoothing practical.\r\n\r\n     Information in this table is intended for land use planning, for evaluating land use alternatives, and for planning site investigations prior to design and construction. The information, however, has limitations. For example, estimates and other data generally apply only to that part of the soil between the surface and a depth of 5 to 7 feet. Because of the map scale, small areas of different soils may be included within the mapped areas of a specific soil.\r\n\r\n     The information is not site specific and does not eliminate the need for onsite investigation of the soils or for testing and analysis by personnel experienced in the design and construction of engineering works.\r\n\r\n     Government ordinances and regulations that restrict certain land uses or impose specific design criteria were not considered in preparing the information in this table. Local ordinances and regulations should be considered in planning, in site selection, and in design.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (20, NULL, E'Landfills', E'Landfills', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'0', E'1', E'     This table shows the degree and kind of soil limitations that affect sanitary landfills and daily cover for landfill. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect these uses. "Not limited" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. "Somewhat limited" indicates that the soil has features that are moderately favorable for the specified use. The limitations can be overcome or minimized by special planning, design, or installation. Fair performance and moderate maintenance can be expected. "Very limited" indicates that the soil has one or more features that are unfavorable for the specified use. The limitations generally cannot be overcome without major soil reclamation, special design, or expensive installation procedures. Poor performance and high maintenance can be expected.\r\n\r\n     Numerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     A "trench sanitary landfill" is an area where solid waste is placed in successive layers in an excavated trench. The waste is spread, compacted, and covered daily with a thin layer of soil excavated at the site. When the trench is full, a final cover of soil material at least 2 feet thick is placed over the landfill. The ratings in the table are based on the soil properties that affect the risk of pollution, the ease of excavation, trafficability, and revegetation. These properties include saturated hydraulic conductivity (Ksat), depth to bedrock or a cemented pan, depth to a water table, ponding, slope, flooding, texture, stones and boulders, highly organic layers, soil reaction, and content of salts and sodium. Unless otherwise stated, the ratings apply only to that part of the soil within a depth of about 6 feet. For deeper trenches, onsite investigation may be needed.\r\n\r\n     Hard, nonrippable bedrock, creviced bedrock, or highly permeable strata in or directly below the proposed trench bottom can affect the ease of excavation and the hazard of ground-water pollution. Slope affects construction of the trenches and the movement of surface water around the landfill. It also affects the construction and performance of roads in areas of the landfill.\r\n\r\n     Soil texture and consistence affect the ease with which the trench is dug and the ease with which the soil can be used as daily or final cover. They determine the workability of the soil when dry and when wet. Soils that are plastic and sticky when wet are difficult to excavate, grade, or compact and are difficult to place as a uniformly thick cover over a layer of refuse.\r\n\r\n     The soil material used as the final cover for a trench landfill should be suitable for plants. It should not have excess sodium or salts and should not be too acid. The surface layer generally has the best workability, the highest content of organic matter, and the best potential for plants. Material from the surface layer should be stockpiled for use as the final cover.\r\n\r\n     In an "area sanitary landfill," solid waste is placed in successive layers on the surface of the soil. The waste is spread, compacted, and covered daily with a thin layer of soil from a source away from the site. A final cover of soil material at least 2 feet thick is placed over the completed landfill. The ratings in the table are based on the soil properties that affect trafficability and the risk of pollution. These properties include flooding, Ksat, depth to a water table, ponding, slope, and depth to bedrock or a cemented pan.\r\n\r\n     Flooding is a serious problem because it can result in pollution in areas downstream from the landfill. If Ksat is too rapid or if fractured bedrock, a fractured cemented pan, or the water table is close to the surface, the leachate can contaminate the water supply. Slope is a consideration because of the extra grading required to maintain roads in the steeper areas of the landfill. Also, leachate may flow along the surface of the soils in the steeper areas and cause difficult seepage problems.\r\n\r\n     "Daily cover for landfill" is the soil material that is used to cover compacted solid waste in an area sanitary landfill. The soil material is obtained offsite, transported to the landfill, and spread over the waste. The ratings in the table also apply to the final cover for a landfill. They are based on the soil properties that affect workability, the ease of digging, and the ease of moving and spreading the material over the refuse daily during wet and dry periods. These properties include soil texture, depth to a water table, ponding, rock fragments, slope, depth to bedrock or a cemented pan, reaction, and content of salts, sodium, or lime.\r\n\r\n     Loamy or silty soils that are free of large stones and excess gravel are the best cover for a landfill. Clayey soils may be sticky and difficult to spread; sandy soils are subject to wind erosion.\r\n\r\n     Slope affects the ease of excavation and of moving the cover material. Also, it can influence runoff, erosion, and reclamation of the borrow area. \r\n\r\n     After soil material has been removed, the soil material remaining in the borrow area must be thick enough over bedrock, a cemented pan, or the water table to permit revegetation. The soil material used as the final cover for a landfill should be suitable for plants. It should not have excess sodium, salts, or lime and should not be too acid.\r\n\r\n     Information in this table is intended for land use planning, for evaluating land use alternatives, and for planning site investigations prior to design and construction. The information, however, has limitations. For example, estimates and other data generally apply only to that part of the soil between the surface and a depth of 5 to 7 feet. Because of the map scale, small areas of different soils may be included within the mapped areas of a specific soil.\r\n\r\n     The information is not site specific and does not eliminate the need for onsite investigation of the soils or for testing and analysis by personnel experienced in the design and construction of engineering works.\r\n\r\n     Government ordinances and regulations that restrict certain land uses or impose specific design criteria were not considered in preparing the information in this table. Local ordinances and regulations should be considered in planning, in site selection, and in design.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (21, NULL, E'Haul Roads, Log Landings, and Soil Rutting on Forestland', E'Haul Roads, Log Landings, and Soil Rutting on Forestland', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table can help forestland owners or managers plan the use of soils for wood crops.  Interpretive ratings are given for the soils according to the limitations that affect various aspects of forestland management. The ratings are both verbal and numerical.\r\n\r\n     Numerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the specified aspect of forestland management (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     The paragraphs that follow indicate the soil properties considered in rating the soils. More detailed information about the criteria used in the ratings is available in the "National Forestry Manual," which is available in local offices of the Natural Resources Conservation Service or on the Internet.\r\n\r\n     For "limitations affecting construction of haul roads and log landings," the ratings are based on slope, flooding, permafrost, plasticity index, the hazard of soil slippage, content of sand, the Unified classification, rock fragments on or below the surface, depth to a restrictive layer that is indurated, depth to a water table, and ponding. The limitations are described as slight, moderate, or severe. A rating of "slight" indicates that no significant limitations affect construction activities, "moderate" indicates that one or more limitations can cause some difficulty in construction, and "severe" indicates that one or more limitations can make construction very difficult or very costly.\r\n\r\n     The ratings of "suitability for log landings" are based on slope, rock fragments on the surface, plasticity index, content of sand, the Unified classification, depth to a water table, ponding, flooding, and the hazard of soil slippage. The soils are described as well suited, moderately suited, or poorly suited to use as log landings. "Well suited" indicates that the soil has features that are favorable for log landings and has no limitations. Good performance can be expected, and little or no maintenance is needed. "Moderately suited" indicates that the soil has features that are moderately favorable for log landings. One or more soil properties are less than desirable, and fair performance can be expected. Some maintenance is needed. "Poorly suited" indicates that the soil has one or more properties that are unfavorable for log landings. Overcoming the unfavorable properties requires special design, extra maintenance, and costly alteration.\r\n\r\n     Ratings in the column "soil rutting hazard" are based on depth to a water table, rock fragments on or below the surface, the Unified classification, depth to a restrictive layer, and slope. Ruts form as a result of the operation of forestland equipment. The hazard is described as slight, moderate, or severe. A rating of "slight" indicates that the soil is subject to little or no rutting, "moderate" indicates that rutting is likely, and "severe" indicates that ruts form readily.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Natural Resources Conservation Service. National forestry manual. (http://soils.usda.gov/technical/nfhandbook/)');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (22, NULL, E'Hazard of Erosion and Suitability for Roads on Forestland', E'Hazard of Erosion and Suitability for Roads on Forestland', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table can help forestland owners or managers plan the use of soils for wood crops.  Interpretive ratings are given for the soils according to the limitations that affect various aspects of forestland management. The ratings are both verbal and numerical.\r\n\r\n     Numerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the specified aspect of forestland management (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     The paragraphs that follow indicate the soil properties considered in rating the soils. More detailed information about the criteria used in the ratings is available in the "National Forestry Manual," which is available in local offices of the Natural Resources Conservation Service or on the Internet.\r\n\r\n     Ratings in the column "hazard of off-road or off-trail erosion" are based on slope and on soil erodibility factor K. The soil loss is caused by sheet or rill erosion in off-road or off-trail areas where 50 to 75 percent of the surface has been exposed by logging, grazing, mining, or other kinds of disturbance. The hazard is described as slight, moderate, severe, or very severe. A rating of "slight" indicates that erosion is unlikely under ordinary climatic conditions; "moderate" indicates that some erosion is likely and that erosion-control measures may be needed; "severe" indicates that erosion is very likely and that erosion-control measures, including revegetation of bare areas, are advised; and "very severe" indicates that significant erosion is expected, loss of soil productivity and off-site damage are likely, and erosion-control measures are costly and generally impractical.\r\n\r\n     Ratings in the column "hazard of erosion on roads and trails" are based on the soil erodibility factor K, slope, and content of rock fragments. The ratings apply to unsurfaced roads and trails. The hazard is described as slight, moderate, or severe. A rating of "slight" indicates that little or no erosion is likely; "moderate" indicates that some erosion is likely, that the roads or trails may require occasional maintenance; and that simple erosion-control measures are needed; and "severe" indicates that significant erosion is expected, that the roads or trails require frequent maintenance, and that costly erosion-control measures are needed.\r\n\r\n     Ratings in the column "suitability for roads (natural surface)" are based on slope, rock fragments on the surface, plasticity index, content of sand, the Unified classification, depth to a water table, ponding, flooding, and the hazard of soil slippage. The ratings indicate the suitability for using the natural surface of the soil for roads. The soils are described as well suited, moderately suited, or poorly suited to this use. "Well suited" indicates that the soil has features that are favorable for the specified kind of roads and has no limitations. Good performance can be expected, and little or no maintenance is needed. "Moderately suited" indicates that the soil has features that are moderately favorable for the specified kind of roads. One or more soil properties are less than desirable, and fair performance can be expected. Some maintenance is needed. "Poorly suited" indicates that the soil has one or more properties that are unfavorable for the specified kind of roads. Overcoming the unfavorable properties requires special design, extra maintenance, and costly alteration.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Natural Resources Conservation Service. National forestry manual. (http://soils.usda.gov/technical/nfhandbook/)');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (23, NULL, E'Forestland Planting and Harvesting', E'Forestland Planting and Harvesting', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table can help forestland owners or managers plan the use of soils for wood crops. Interpretive ratings are given for the soils according to the limitations that affect planting and harvesting on forestland. The ratings are both verbal and numerical.\r\n\r\n     Rating class terms indicate the degree to which the soils are suited to a specified aspect of forestland management. "Well suited" indicates that the soil has features that are favorable for the specified management aspect and has no limitations. Good performance can be expected, and little or no maintenance is needed. "Moderately suited" indicates that the soil has features that are moderately favorable for the specified management aspect. One or more soil properties are less than desirable, and fair performance can be expected. Some maintenance is needed. "Poorly suited" indicates that the soil has one or more properties that are unfavorable for the specified management aspect. Overcoming the unfavorable properties requires special design, extra maintenance, and costly alteration. "Unsuited" indicates that the expected performance of the soil is unacceptable for the specified management aspect or that extreme measures are needed to overcome the undesirable soil properties.\r\n\r\n     Numerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the specified aspect of forestland management (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     The paragraphs that follow indicate the soil properties considered in rating the soils. More detailed information about the criteria used in the ratings is available in the "National Forestry Manual," which is available in local offices of the Natural Resources Conservation Service or on the Internet.\r\n\r\n     Ratings in the columns "suitability for hand planting" and "suitability for mechanical planting" are based on slope, depth to a restrictive layer, content of sand, plasticity index, rock fragments on or below the surface, depth to a water table, and ponding. The soils are described as well suited, moderately suited, poorly suited, or unsuited to these methods of planting. It is assumed that necessary site preparation is completed before seedlings are planted.\r\n\r\n     Ratings in the column "suitability for use of harvesting equipment" are based on slope, rock fragments on the surface, plasticity index, content of sand, the Unified classification, depth to a water table, and ponding. The soils are described as well suited, moderately suited, or poorly suited to this use.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Natural Resources Conservation Service. National forestry manual. (http://soils.usda.gov/technical/nfhandbook/)');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (24, NULL, E'Forestland Site Preparation', E'Forestland Site Preparation', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 2 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table can help forestland owners or managers plan the use of soils for wood crops. Interpretive ratings are given for the soils according to the limitations that affect site preparation on forestland. The ratings are both verbal and numerical.\r\n\r\n     Rating class terms indicate the degree to which the soils are suited to site preparation. "Well suited" indicates that the soil has features that are favorable for the specified kind of site preparation and has no limitations. Good performance can be expected, and little or no maintenance is needed. "Poorly suited" indicates that the soil has one or more properties that are unfavorable for the specified kind of site preparation. Overcoming the unfavorable properties requires special design, extra maintenance, and costly alteration. "Unsuited" indicates that the expected performance of the soil is unacceptable for the specified kind of site preparation or that extreme measures are needed to overcome the undesirable soil properties.\r\n\r\n     Numerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the specified kind of site preparation (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     The paragraphs that follow indicate the soil properties considered in rating the soils. More detailed information about the criteria used in the ratings is available in the "National Forestry Manual," which is available in local offices of the Natural Resources Conservation Service or on the Internet.\r\n\r\n     Ratings in the column "suitability for mechanical site preparation (surface)" are based on slope, depth to a restrictive layer, plasticity index, rock fragments on or below the surface, depth to a water table, and ponding. The soils are described as well suited, poorly suited, or unsuited to this management activity. The part of the soil from the surface to a depth of about 1 foot is considered in the ratings.\r\n\r\n     Ratings in the column "suitability for mechanical site preparation (deep)" are based on slope, depth to a restrictive layer, rock fragments on or below the surface, depth to a water table, and ponding. The soils are described as well suited, poorly suited, or unsuited to this management activity. The part of the soil from the surface to a depth of about 3 feet is considered in the ratings.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Natural Resources Conservation Service. National forestry manual. (http://soils.usda.gov/technical/nfhandbook/)');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (25, NULL, E'Damage by Fire and Seedling Mortality on Forestland', E'Damage by Fire and Seedling Mortality on Forestland', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 2 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table can help forestland owners or managers plan the use of soils for wood crops. Interpretive ratings are given for the soils according to the limitations that affect the potential for fire damage and for seedling mortality. The ratings are both verbal and numerical.\r\n\r\n     Rating class terms indicate the potential for fire damage and for seedling mortality. "Low" indicates that the soil has features that reduce its potential for fire damage or seedling mortality. Good performance can be expected, and little or no maintenance is needed. "Moderate" indicates that the soil has features that result in a moderate potential for fire damage or seedling mortality. One or more soil properties are less than desirable, and fair performance can be expected. Some maintenance is needed. "High" indicates that the soil has one or more properties that result in a high potential for fire damage or seedling mortality. Overcoming the unfavorable properties requires special design, extra maintenance, and costly alteration.\r\n\r\n     Numerical ratings in the table indicate gradations between the point at which the potential for fire damage or seedling mortality is highest (1.00) and the point at which the potential is lowest (0.00).\r\n\r\n     The paragraphs that follow indicate the soil properties considered in rating the soils. More detailed information about the criteria used in the ratings is available in the "National Forestry Manual," which is available in local offices of the Natural Resources Conservation Service or on the Internet.\r\n\r\n     Ratings in the column "potential for damage to soil by fire" are based on texture of the surface layer, content of rock fragments and organic matter in the surface layer, thickness of the surface layer, and slope. The soils are described as having a low, moderate, or high potential for this kind of damage. The ratings indicate an evaluation of the potential impact of prescribed fires or wildfires that are intense enough to remove the duff layer and consume organic matter in the surface layer.\r\n\r\n     Ratings in the column "potential for seedling mortality" are based on flooding, ponding, depth to a water table, content of lime, reaction, salinity, available water capacity, soil moisture regime, soil temperature regime, aspect, and slope. The soils are described as having a low, moderate, or high potential for seedling mortality.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Natural Resources Conservation Service. National forestry manual. (http://soils.usda.gov/technical/nfhandbook/)');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (26, NULL, E'Engineering Properties', E'Engineering Properties', E'Absence of an entry indicates that the data were not estimated', E'Engineering Properties', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table gives the engineering classifications and the range of engineering properties for the layers of each soil in the survey area.\r\n\r\n     "Depth" to the upper and lower boundaries of each layer is indicated.\r\n\r\n     "Texture" is given in the standard terms used by the U.S. Department of Agriculture. These terms are defined according to percentages of sand, silt, and clay in the fraction of the soil that is less than 2 millimeters in diameter. "Loam," for example, is soil that is 7 to 27 percent clay, 28 to 50 percent silt, and less than 52 percent sand. If the content of particles coarser than sand is 15 percent or more, an appropriate modifier is added, for example, "gravelly."\r\n\r\n     "Classification" of the soils is determined according to the Unified soil classification system (ASTM, 2005) and the system adopted by the American Association of State Highway and Transportation Officials (AASHTO, 2004).\r\n\r\n     The Unified system classifies soils according to properties that affect their use as construction material. Soils are classified according to particle-size distribution of the fraction less than 3 inches in diameter and according to plasticity index, liquid limit, and organic matter content. Sandy and gravelly soils are identified as GW, GP, GM, GC, SW, SP, SM, and SC; silty and clayey soils as ML, CL, OL, MH, CH, and OH; and highly organic soils as PT. Soils exhibiting engineering properties of two groups can have a dual classification, for example, CL-ML.\r\n\r\n     The AASHTO system classifies soils according to those properties that affect roadway construction and maintenance. In this system, the fraction of a mineral soil that is less than 3 inches in diameter is classified in one of seven groups from A-1 through A-7 on the basis of particle-size distribution, liquid limit, and plasticity index. Soils in group A-1 are coarse grained and low in content of fines (silt and clay). At the other extreme, soils in group A-7 are fine grained. Highly organic soils are classified in group A-8 on the basis of visual inspection.\r\n\r\n     If laboratory data are available, the A-1, A-2, and A-7 groups are further classified as A-1-a, A-1-b, A-2-4, A-2-5, A-2-6, A-2-7, A-7-5, or A-7-6. As an additional refinement, the suitability of a soil as subgrade material can be indicated by a group index number. Group index numbers range from 0 for the best subgrade material to 20 or higher for the poorest.\r\n\r\n     "Rock fragments" larger than 10 inches in diameter and 3 to 10 inches in diameter are indicated as a percentage of the total soil on a dry-weight basis. The percentages are estimates determined mainly by converting volume percentage in the field to weight percentage.\r\n\r\n     "Percentage (of soil particles) passing designated sieves" is the percentage of the soil fraction less than 3 inches in diameter based on an ovendry weight. The sieves, numbers 4, 10, 40, and 200 (USA Standard Series), have openings of 4.76, 2.00, 0.420, and 0.074 millimeters, respectively. Estimates are based on laboratory tests of soils sampled in the survey area and in nearby areas and on estimates made in the field.\r\n\r\n     "Liquid limit" and "plasticity index" (Atterberg limits) indicate the plasticity characteristics of a soil. The estimates are based on test data from the survey area or from nearby areas and on field examination.\r\n\r\nReferences:\r\nAmerican Association of State Highway and Transportation Officials (AASHTO). 2004. Standard specifications for transportation materials and methods of sampling and testing. 24th edition.\r\nAmerican Society for Testing and Materials (ASTM). 2005. Standard classification of soils for engineering purposes. ASTM Standard D2487-00.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (27, NULL, E'Physical Soil Properties', E'Physical Soil Properties', E'Entries under "Erosion Factors--T" apply to the entire profile.  Entries under "Wind Erodibility Group" and "Wind Erodibility Index" apply only to the surface layer.  Absence of an entry indicates that data were not estimated', E'Physical Soil Properties', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table shows estimates of some physical characteristics and features that affect soil behavior. These estimates are given for the layers of each soil in the survey area. The estimates are based on field observations and on test data for these and similar soils.\r\n\r\n     "Depth" to the upper and lower boundaries of each layer is indicated.\r\n\r\n     Particle size is the effective diameter of a soil particle as measured by sedimentation, sieving, or micrometric methods. Particle sizes are expressed as classes with specific effective diameter class limits. The broad classes are sand, silt, and clay, ranging from the larger to the smaller.\r\n\r\n     "Sand" as a soil separate consists of mineral soil particles that are 0.05 millimeter to 2 millimeters in diameter. In this table, the estimated sand content of each soil layer is given as a percentage, by weight, of the soil material that is less than 2 millimeters in diameter.\r\n\r\n     "Silt" as a soil separate consists of mineral soil particles that are 0.002 to 0.05 millimeter in diameter. In this table, the estimated silt content of each soil layer is given as a percentage, by weight, of the soil material that is less than 2 millimeters in diameter.\r\n\r\n     "Clay" as a soil separate consists of mineral soil particles that are less than 0.002 millimeter in diameter. In this table, the estimated clay content of each soil layer is given as a percentage, by weight, of the soil material that is less than 2 millimeters in diameter.\r\n\r\n     The content of sand, silt, and clay affects the physical behavior of a soil. Particle size is important for engineering and agronomic interpretations, for determination of soil hydrologic qualities, and for soil classification.\r\n\r\n     The amount and kind of clay affect the fertility and physical condition of the soil and the ability of the soil to adsorb cations and to retain moisture. They influence shrink-swell potential, saturated hydraulic conductivity (Ksat), plasticity, the ease of soil dispersion, and other soil properties. The amount and kind of clay in a soil also affect tillage and earthmoving operations.\r\n\r\n     "Moist bulk density" is the weight of soil (ovendry) per unit volume. Volume is measured when the soil is at field moisture capacity, that is, the moisture content at 1/3- or 1/10-bar (33kPa or 10kPa) moisture tension. Weight is determined after the soil is dried at 105 degrees C. In the table, the estimated moist bulk density of each soil horizon is expressed in grams per cubic centimeter of soil material that is less than 2 millimeters in diameter. Bulk density data are used to compute linear extensibility, shrink-swell potential, available water capacity, total pore space, and other soil properties. The moist bulk density of a soil indicates the pore space available for water and roots. Depending on soil texture, a bulk density of more than 1.4 can restrict water storage and root penetration. Moist bulk density is influenced by texture, kind of clay, content of organic matter, and soil structure.\r\n\r\n     "Saturated hydraulic conductivity" refers to the ability of a soil to transmit water or air. The term "permeability" indicates saturated hydraulic conductivity (Ksat ). The estimates in the table indicate the rate of water movement, in micrometers per second, when the soil is saturated. They are based on soil characteristics observed in the field, particularly structure, porosity, and texture.  Ksat is considered in the design of soil drainage systems and septic tank absorption fields.\r\n\r\n     "Available water capacity" refers to the quantity of water that the soil is capable of storing for use by plants. The capacity for water storage is given in inches of water per inch of soil for each soil layer. The capacity varies, depending on soil properties that affect retention of water. The most important properties are the content of organic matter, soil texture, bulk density, and soil structure. Available water capacity is an important factor in the choice of plants or crops to be grown and in the design and management of irrigation systems. Available water capacity is not an estimate of the quantity of water actually available to plants at any given time.\r\n\r\n     "Linear extensibility" refers to the change in length of an unconfined clod as moisture content is decreased from a moist to a dry state. It is an expression of the volume change between the water content of the clod at 1/3- or 1/10-bar tension (33kPa or 10kPa tension) and oven dryness. The volume change is reported in the table as percent change for the whole soil. The amount and type of clay minerals in the soil influence volume change.\r\n\r\n     Linear extensibility is used to determine the shrink-swell potential of soils. The shrink-swell potential is low if the soil has a linear extensibility of less than 3 percent; moderate if 3 to 6 percent; high if 6 to 9 percent; and very high if more than 9 percent. If the linear extensibility is more than 3, shrinking and swelling can cause damage to buildings, roads, and other structures and to plant roots. Special design commonly is needed.\r\n\r\n     "Organic matter" is the plant and animal residue in the soil at various stages of decomposition. In this table, the estimated content of organic matter is expressed as a percentage, by weight, of the soil material that is less than 2 millimeters in diameter.\r\n\r\n     The content of organic matter in a soil can be maintained by returning crop residue to the soil. Organic matter has a positive effect on available water capacity, water infiltration, soil organism activity, and tilth. It is a source of nitrogen and other nutrients for crops and soil organisms.\r\n\r\n     "Erosion factors" are shown in the table as the K factor (Kw and Kf) and the T factor. Erosion factor K indicates the susceptibility of a soil to sheet and rill erosion by water. Factor K is one of six factors used in the Universal Soil Loss Equation (USLE) and the Revised Universal Soil Loss Equation (RUSLE) to predict the average annual rate of soil loss by sheet and rill erosion in tons per acre per year. The estimates are based primarily on percentage of silt, sand, and organic matter and on soil structure and Ksat. Values of K range from 0.02 to 0.69. Other factors being equal, the higher the value, the more susceptible the soil is to sheet and rill erosion by water.\r\n\r\n     "Erosion factor Kw" indicates the erodibility of the whole soil. The estimates are modified by the presence of rock fragments.\r\n\r\n     "Erosion factor Kf" indicates the erodibility of the fine-earth fraction, or the material less than 2 millimeters in size.\r\n\r\n     "Erosion factor T" is an estimate of the maximum average annual rate of soil erosion by wind and/or water that can occur without affecting crop productivity over a sustained period. The rate is in tons per acre per year.\r\n\r\n     "Wind erodibility groups" are made up of soils that have similar properties affecting their susceptibility to wind erosion in cultivated areas. The soils assigned to group 1 are the most susceptible to wind erosion, and those assigned to group 8 are the least susceptible. The groups are described in the "National Soil Survey Handbook."\r\n\r\n     "Wind erodibility index" is a numerical value indicating the susceptibility of soil to wind erosion, or the tons per acre per year that can be expected to be lost to wind erosion. There is a close correlation between wind erosion and the texture of the surface layer, the size and durability of surface clods, rock fragments, organic matter, and a calcareous reaction. Soil moisture and frozen soil layers also influence wind erosion.\r\n\r\nReference:\r\nUnited States Department of Agriculture, Natural Resources Conservation Service. National soil survey handbook, title 430-VI. (http://www.statlab.iastate.edu/soils/nssh/)');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (30, NULL, E'Chemical Soil Properties', E'Chemical Soil Properties', E'Absence of an entry indicates that data were not estimated', E'Chemical Soil Properties', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table shows estimates of some chemical characteristics and features that affect soil behavior. These estimates are given for the layers of each soil in the survey area. The estimates are based on field observations and on test data for these and similar soils.\r\n\r\n     "Depth" to the upper and lower boundaries of each layer is indicated.\r\n\r\n     "Cation-exchange capacity" is the total amount of extractable bases that can be held by the soil, expressed in terms of milliequivalents per 100 grams of soil at neutrality (pH 7.0) or at some other stated pH value. Soils having a low cation-exchange capacity hold fewer cations and may require more frequent applications of fertilizer than soils having a high cation-exchange capacity. The ability to retain cations reduces the hazard of ground-water pollution.\r\n\r\n     "Effective cation-exchange capacity" refers to the sum of extractable bases plus aluminum expressed in terms of milliequivalents per 100 grams of soil. It is determined for soils that have pH of less than 5.5.\r\n\r\n     "Soil reaction" is a measure of acidity or alkalinity. It is important in selecting crops and other plants, in evaluating soil amendments for fertility and stabilization, and in determining the risk of corrosion.\r\n\r\n     "Calcium carbonate" equivalent is the percent of carbonates, by weight, in the fraction of the soil less than 2 millimeters in size. The availability of plant nutrients is influenced by the amount of carbonates in the soil. Incorporating nitrogen fertilizer into calcareous soils helps to prevent nitrite accumulation and ammonium-N volatilization.\r\n\r\n     "Gypsum" is expressed as a percent, by weight, of hydrated calcium sulfates in the fraction of the soil less than 20 millimeters in size. Gypsum is partially soluble in water. Soils that have a high content of gypsum may collapse if the gypsum is removed by percolating water.\r\n\r\n     "Salinity" is a measure of soluble salts in the soil at saturation. It is expressed as the electrical conductivity of the saturation extract, in millimhos per centimeter at 25 degrees C. Estimates are based on field and laboratory measurements at representative sites of nonirrigated soils. The salinity of irrigated soils is affected by the quality of the irrigation water and by the frequency of water application. Hence, the salinity of soils in individual fields can differ greatly from the value given in the table. Salinity affects the suitability of a soil for crop production, the stability of soil if used as construction material, and the potential of the soil to corrode metal and concrete.\r\n\r\n     "Sodium adsorption ratio" (SAR) is a measure of the amount of sodium (Na) relative to calcium (Ca) and magnesium (Mg) in the water extract from saturated soil paste. It is the ratio of the Na concentration divided by the square root of one-half of the Ca + Mg concentration. Soils that have SAR values of 13 or more may be characterized by an increased dispersion of organic matter and clay particles, reduced saturated hydraulic conductivity and aeration, and a general degradation of soil structure.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (31, NULL, E'Water Features', E'Water Features', E'Depths of layers are in feet.  See text for definitions of terms used in this table.  Estimates of the frequency of ponding and flooding apply to the whole year rather than to individual months.  Absence of an entry indicates that the feature is not a concern or that data were not estimated', E'Water Features', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table gives estimates of various soil water features. The estimates are used in land use planning that involves engineering considerations.\r\n\r\n     "Hydrologic soil groups" are based on estimates of runoff potential. Soils are assigned to one of four groups according to the rate of water infiltration when the soils are not protected by vegetation, are thoroughly wet, and receive precipitation from long-duration storms.\r\n\r\n     The four hydrologic soil groups are:\r\n\r\n     Group A.  Soils having a high infiltration rate (low runoff potential) when thoroughly wet. These consist mainly of deep, well drained to excessively drained sands or gravelly sands. These soils have a high rate of water transmission.\r\n\r\n     Group B.  Soils having a moderate infiltration rate when thoroughly wet. These consist chiefly of moderately deep or deep, moderately well drained or well drained soils that have moderately fine texture to moderately coarse texture. These soils have a moderate rate of water transmission.\r\n\r\n     Group C.  Soils having a slow infiltration rate when thoroughly wet. These consist chiefly of soils having a layer that impedes the downward movement of water or soils of moderately fine texture or fine texture. These soils have a slow rate of water transmission.\r\n\r\n     Group D.  Soils having a very slow infiltration rate (high runoff potential) when thoroughly wet. These consist chiefly of clays that have a high shrink-swell potential, soils that have a high water table, soils that have a claypan or clay layer at or near the surface, and soils that are shallow over nearly impervious material. These soils have a very slow rate of water transmission.\r\n\r\n     If a soil is assigned to a dual hydrologic group (A/D, B/D, or C/D), the first letter is for drained areas and the second is for undrained areas.\r\n\r\n     "Surface runoff" refers to the loss of water from an area by flow over the land surface. Surface runoff classes are based on slope, climate, and vegetative cover. The concept indicates relative runoff for very specific conditions. It is assumed that the surface of the soil is bare and that the retention of surface water resulting from irregularities in the ground surface is minimal. The classes are negligible, very low, low, medium, high, and very high. \r\n\r\n     The "months" in the table indicate the portion of the year in which a water table, ponding, and/or flooding is most likely to be a concern.\r\n\r\n     "Water table" refers to a saturated zone in the soil. The water features table indicates, by month, depth to the top ("upper limit") and base ("lower limit") of the saturated zone in most years. Estimates of the upper and lower limits are based mainly on observations of the water table at selected sites and on evidence of a saturated zone, namely grayish colors or mottles (redoximorphic features) in the soil. A saturated zone that lasts for less than a month is not considered a water table.\r\n\r\n     "Ponding" is standing water in a closed depression. Unless a drainage system is installed, the water is removed only by percolation, transpiration, or evaporation. The table indicates "surface water depth" and the "duration" and "frequency" of ponding. Duration is expressed as "very brief" if less than 2 days, "brief" if 2 to 7 days, "long" if 7 to 30 days, and "very long" if more than 30 days. Frequency is expressed as none, rare, occasional, and frequent. "None" means that ponding is not probable; "rare" that it is unlikely but possible under unusual weather conditions (the chance of ponding is nearly 0 percent to 5 percent in any year); "occasional" that it occurs, on the average, once or less in 2 years (the chance of ponding is 5 to 50 percent in any year); and "frequent" that it occurs, on the average, more than once in 2 years (the chance of ponding is more than 50 percent in any year).\r\n\r\n     "Flooding" is the temporary inundation of an area caused by overflowing streams, by runoff from adjacent slopes, or by tides. Water standing for short periods after rainfall or snowmelt is not considered flooding, and water standing in swamps and marshes is considered ponding rather than flooding.\r\n\r\n     "Duration" and "frequency" are estimated. Duration is expressed as "extremely brief" if 0.1 hour to 4 hours, "very brief" if 4 hours to 2 days, "brief" if 2 to 7 days, "long" if 7 to 30 days, and "very long" if more than 30 days. Frequency is expressed as none, very rare, rare, occasional, frequent, and very frequent. "None" means that flooding is not probable; "very rare" that it is very unlikely but possible under extremely unusual weather conditions (the chance of flooding is less than 1 percent in any year); "rare" that it is unlikely but possible under unusual weather conditions (the chance of flooding is 1 to 5 percent in any year); "occasional" that it occurs infrequently under normal weather conditions (the chance of flooding is 5 to 50 percent in any year); "frequent" that it is likely to occur often under normal weather conditions (the chance of flooding is more than 50 percent in any year but is less than 50 percent in all months in any year); and "very frequent" that it is likely to occur very often under normal weather conditions (the chance of flooding is more than 50 percent in all months of any year).\r\n\r\n     The information is based on evidence in the soil profile, namely thin strata of gravel, sand, silt, or clay deposited by floodwater; irregular decrease in organic matter content with increasing depth; and little or no horizon development.\r\n\r\n     Also considered are local information about the extent and levels of flooding and the relation of each soil on the landscape to historic floods. Information on the extent of flooding based on soil data is less specific than that provided by detailed engineering surveys that delineate flood-prone areas at specific flood frequency levels.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (32, NULL, E'Soil Features', E'Soil Features', E'Absence of an entry indicates that the feature is not a concern or that data were not estimated', E'Soil Features', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table gives estimates of various soil features. The estimates are used in land use planning that involves engineering considerations.\r\n\r\n     A "restrictive layer" is a nearly continuous layer that has one or more physical, chemical, or thermal properties that significantly impede the movement of water and air through the soil or that restrict roots or otherwise provide an unfavorable root environment. Examples are bedrock, cemented layers, dense layers, and frozen layers. The table indicates the hardness and thickness of the restrictive layer, both of which significantly affect the ease of excavation. "Depth to top" is the vertical distance from the soil surface to the upper boundary of the restrictive layer.\r\n\r\n     "Subsidence" is the settlement of organic soils or of saturated mineral soils of very low density. Subsidence generally results from either desiccation and shrinkage, or oxidation of organic material, or both, following drainage. Subsidence takes place gradually, usually over a period of several years. The table shows the expected initial subsidence, which usually is a result of drainage, and total subsidence, which results from a combination of factors.\r\n\r\n     "Potential for frost action" is the likelihood of upward or lateral expansion of the soil caused by the formation of segregated ice lenses (frost heave) and the subsequent collapse of the soil and loss of strength on thawing. Frost action occurs when moisture moves into the freezing zone of the soil. Temperature, texture, density, saturated hydraulic conductivity (Ksat), content of organic matter, and depth to the water table are the most important factors considered in evaluating the potential for frost action. It is assumed that the soil is not insulated by vegetation or snow and is not artificially drained. Silty and highly structured, clayey soils that have a high water table in winter are the most susceptible to frost action. Well drained, very gravelly, or very sandy soils are the least susceptible. Frost heave and low soil strength during thawing cause damage to pavements and other rigid structures.\r\n\r\n     "Risk of corrosion" pertains to potential soil-induced electrochemical or chemical action that corrodes or weakens uncoated steel or concrete. The rate of corrosion of uncoated steel is related to such factors as soil moisture, particle-size distribution, acidity, and electrical conductivity of the soil. The rate of corrosion of concrete is based mainly on the sulfate and sodium content, texture, moisture content, and acidity of the soil. Special site examination and design may be needed if the combination of factors results in a severe hazard of corrosion. The steel or concrete in installations that intersect soil boundaries or soil layers is more susceptible to corrosion than the steel or concrete in installations that are entirely within one kind of soil or within one soil layer.\r\n\r\n     For uncoated steel, the risk of corrosion, expressed as "low," "moderate," or "high," is based on soil drainage class, total acidity, electrical resistivity near field capacity, and electrical conductivity of the saturation extract.\r\n\r\n     For concrete, the risk of corrosion also is expressed as "low," "moderate," or "high." It is based on soil texture, acidity, and amount of sulfates in the saturation extract.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (33, NULL, E'Taxonomic Classification of the Soils', E'Taxonomic Classification of the Soils', E'An asterisk following the soil name indicates a taxadjunct to the series', E'Taxonomic Classification of the Soils', E'0', NULL, NULL, NULL, E'1', E'1', E'     The system of soil classification used by the National Cooperative Soil Survey has six categories (Soil Survey Staff, 1999 and 2003). Beginning with the broadest, these categories are the order, suborder, great group, subgroup, family, and series. Classification is based on soil properties observed in the field or inferred from those observations or from laboratory measurements. This table shows the classification of the soils in the survey area. The categories are defined in the following paragraphs.\r\n\r\n     ORDER.  Twelve soil orders are recognized. The differences among orders reflect the dominant soil-forming processes and the degree of soil formation. Each order is identified by a word ending in "sol." An example is Alfisols.\r\n\r\n     SUBORDER.  Each order is divided into suborders primarily on the basis of properties that influence soil genesis and are important to plant growth or properties that reflect the most important variables within the orders. The last syllable in the name of a suborder indicates the order. An example is Udalfs ("Ud," meaning humid, plus "alfs," from Alfisols).\r\n\r\n     GREAT GROUP.  Each suborder is divided into great groups on the basis of close similarities in kind, arrangement, and degree of development of pedogenic horizons; soil moisture and temperature regimes; type of saturation; and base status. Each great group is identified by the name of a suborder and by a prefix that indicates a property of the soil. An example is Hapludalfs ("Hapl," meaning minimal horizonation, plus "udalfs," the suborder of the Alfisols that has a udic moisture regime).\r\n\r\n     SUBGROUP.  Each great group has a typic subgroup. Other subgroups are intergrades or extragrades. The typic subgroup is the central concept of the great group; it is not necessarily the most extensive. Intergrades are transitions to other orders, suborders, or great groups. Extragrades have some properties that are not representative of the great group but do not indicate transitions to any other taxonomic class. Each subgroup is identified by one or more adjectives preceding the name of the great group. The adjective "Typic" identifies the subgroup that typifies the great group. An example is Typic Hapludalfs.\r\n\r\n     FAMILY.  Families are established within a subgroup on the basis of physical and chemical properties and other characteristics that affect management. Generally, the properties are those of horizons below plow depth where there is much biological activity. Among the properties and characteristics considered are particle-size class, mineralogy class, cation-exchange activity class, soil temperature regime, soil depth, and reaction class. A family name consists of the name of a subgroup preceded by terms that indicate soil properties. An example is fine-loamy, mixed, active, mesic Typic Hapludalfs.\r\n\r\n     SERIES.  The series consists of soils within a family that have horizons similar in color, texture, structure, reaction, consistence, mineral and chemical composition, and arrangement in the profile.\r\n\r\nReferences:\r\nSoil Survey Staff. 1999. Soil taxonomy: A basic system of soil classification for making and interpreting soil surveys. 2nd edition. Natural Resources Conservation Service. U.S. Department of Agriculture Handbook 436.\r\nSoil Survey Staff. 2003. Keys to soil taxonomy. 9th edition. U.S. Department of Agriculture, Natural Resources Conservation Service. (The soils in a given survey area may have been classified according to earlier editions of this publication.)');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (34, NULL, E'Camp Areas, Picnic Areas, and Playgrounds', E'Camp Areas, Picnic Areas, and Playgrounds', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'0', E'1', E'     The soils of the survey area are rated in this table according to limitations that affect their suitability for camp areas, picnic areas, and playgrounds. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect the recreational uses. "Not limited" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. "Somewhat limited" indicates that the soil has features that are moderately favorable for the specified use. The limitations can be overcome or minimized by special planning, design, or installation. Fair performance and moderate maintenance can be expected. "Very limited" indicates that the soil has one or more features that are unfavorable for the specified use. The limitations generally cannot be overcome without major soil reclamation, special design, or expensive installation procedures. Poor performance and high maintenance can be expected.\r\n\r\n     Numerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     The ratings are based on restrictive soil features, such as wetness, slope, and texture of the surface layer. Susceptibility to flooding is considered. Not considered in the ratings, but important in evaluating a site, are the location and accessibility of the area, the size and shape of the area and its scenic quality, vegetation, access to water, potential water impoundment sites, and access to public sewer lines. The capacity of the soil to absorb septic tank effluent and the ability of the soil to support vegetation also are important. Soils that are subject to flooding are limited for recreational uses by the duration and intensity of flooding and the season when flooding occurs. In planning recreational facilities, onsite assessment of the height, duration, intensity, and frequency of flooding is essential.\r\n\r\n     The information in this table can be supplemented by other information, for example, interpretations for dwellings without basements, for local roads and streets, and for septic tank absorption fields.\r\n\r\n     "Camp areas" require site preparation, such as shaping and leveling the tent and parking areas, stabilizing roads and intensively used areas, and installing sanitary facilities and utility lines. Camp areas are subject to heavy foot traffic and some vehicular traffic. The ratings are based on the soil properties that affect the ease of developing camp areas and the performance of the areas after development. Slope, stoniness, and depth to bedrock or a cemented pan are the main concerns affecting the development of camp areas. The soil properties that affect the performance of the areas after development are those that influence trafficability and promote the growth of vegetation, especially in heavily used areas. For good trafficability, the surface of camp areas should absorb rainfall readily, remain firm under heavy foot traffic, and not be dusty when dry. The soil properties that influence trafficability are texture of the surface layer, depth to a water table, ponding, flooding, saturated hydraulic conductivity (Ksat), and large stones. The soil properties that affect the growth of plants are depth to bedrock or a cemented pan, Ksat, and toxic substances in the soil.\r\n\r\n     "Picnic areas" are subject to heavy foot traffic. Most vehicular traffic is confined to access roads and parking areas. The ratings are based on the soil properties that affect the ease of developing picnic areas and that influence trafficability and the growth of vegetation after development. Slope and stoniness are the main concerns affecting the development of picnic areas. For good trafficability, the surface of picnic areas should absorb rainfall readily, remain firm under heavy foot traffic, and not be dusty when dry. The soil properties that influence trafficability are texture of the surface layer, depth to a water table, ponding, flooding, Ksat, and large stones. The soil properties that affect the growth of plants are depth to bedrock or a cemented pan, Ksat, and toxic substances in the soil.\r\n\r\n     "Playgrounds" require soils that are nearly level, are free of stones, and can withstand intensive foot traffic. The ratings are based on the soil properties that affect the ease of developing playgrounds and that influence trafficability and the growth of vegetation after development. Slope and stoniness are the main concerns affecting the development of playgrounds. For good trafficability, the surface of the playgrounds should absorb rainfall readily, remain firm under heavy foot traffic, and not be dusty when dry. The soil properties that influence trafficability are texture of the surface layer, depth to a water table, ponding, flooding, Ksat, and large stones. The soil properties that affect the growth of plants are depth to bedrock or a cemented pan, Ksat, and toxic substances in the soil.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (35, NULL, E'Paths, Trails, and Golf Fairways', E'Paths, Trails, and Golf Fairways', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'0', E'1', E'     The soils of the survey area are rated in this table according to limitations that affect their suitability for paths, trails, and golf fairways. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect the recreational uses. "Not limited" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. "Somewhat limited" indicates that the soil has features that are moderately favorable for the specified use. The limitations can be overcome or minimized by special planning, design, or installation. Fair performance and moderate maintenance can be expected. "Very limited" indicates that the soil has one or more features that are unfavorable for the specified use. The limitations generally cannot be overcome without major soil reclamation, special design, or expensive installation procedures. Poor performance and high maintenance can be expected.\r\n\r\n     Numerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     The ratings are based on restrictive soil features, such as wetness, slope, and texture of the surface layer. Susceptibility to flooding is considered. Not considered in the ratings, but important in evaluating a site, are the location and accessibility of the area, the size and shape of the area and its scenic quality, vegetation, access to water, potential water impoundment sites, and access to public sewer lines. The capacity of the soil to absorb septic tank effluent and the ability of the soil to support vegetation also are important. Soils that are subject to flooding are limited for recreational uses by the duration and intensity of flooding and the season when flooding occurs. In planning recreational facilities, onsite assessment of the height, duration, intensity, and frequency of flooding is essential.\r\n\r\n     "Paths and trails" for hiking and horseback riding should require little or no slope modification through cutting and filling. The ratings are based on the soil properties that affect trafficability and erodibility. These properties are stoniness, depth to a water table, ponding, flooding, slope, and texture of the surface layer.\r\n\r\n     "Off-road motorcycle trails" require little or no site preparation. They are not covered with surfacing material or vegetation. Considerable compaction of the soil material is likely. The ratings are based on the soil properties that influence erodibility, trafficability, dustiness, and the ease of revegetation. These properties are stoniness, slope, depth to a water table, ponding, flooding, and texture of the surface layer.\r\n\r\n     "Golf fairways" are subject to heavy foot traffic and some light vehicular traffic. Cutting or filling may be required. Irrigation is not considered in the ratings. The ratings are based on the soil properties that affect plant growth and trafficability after vegetation is established. The properties that affect plant growth are reaction; depth to a water table; ponding; depth to bedrock or a cemented pan; the available water capacity in the upper 40 inches; the content of salts, sodium, or calcium carbonate; and sulfidic materials. The properties that affect trafficability are flooding, depth to a water table, ponding, slope, stoniness, and the amount of sand, clay, or organic matter in the surface layer. The suitability of the soil for traps, tees, roughs, and greens is not considered in the ratings.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (36, NULL, E'Windbreaks and Environmental Plantings', E'Windbreaks and Environmental Plantings', E'Absence of an entry indicates that trees generally do not grow to the given height on the soil', E'Windbreaks and Environmental Plantings', E'0', NULL, NULL, NULL, E'0', E'1', E'     Windbreaks protect livestock, buildings, yards, fruit trees, gardens, and cropland from wind and snow; help to keep snow on fields; and provide food and cover for wildlife. Field windbreaks are narrow plantings made at right angles to the prevailing wind and at specific intervals across the field. The interval depends on the erodibility of the soil.\r\n\r\n     Environmental plantings help to beautify and screen houses and other buildings and to abate noise. The plants, mostly evergreen shrubs and trees, are closely spaced. To ensure plant survival, a healthy planting stock of suitable species should be planted properly on a well prepared site and maintained in good condition.\r\n\r\n     This table shows the height that locally grown trees and shrubs are expected to reach in 20 years on soils in the survey area. The estimates are based on measurements and observation of established plantings that have been given adequate care. They can be used as a guide in planning windbreaks and screens. Additional information on planning windbreaks and screens and planting and caring for trees and shrubs can be obtained from the local office of the Natural Resources Conservation Service or of the Cooperative Extension Service or from a commercial nursery.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (37, NULL, E'Prime and Other Important Farmlands', E'Prime and Other Important Farmlands', NULL, E'Prime and Other Important Farmlands', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table lists the map units in the survey area that are considered important farmlands. Important farmlands consist of prime farmland, unique farmland, and farmland of statewide or local importance. This list does not constitute a recommendation for a particular land use. \r\n\r\n     In an effort to identify the extent and location of important farmlands, the Natural Resources Conservation Service, in cooperation with other interested Federal, State, and local government organizations, has inventoried land that can be used for the production of the Nation\'s food supply.\r\n\r\n     "Prime farmland" is of major importance in meeting the Nation\'s short- and long-range needs for food and fiber. Because the supply of high-quality farmland is limited, the U.S. Department of Agriculture recognizes that responsible levels of government, as well as individuals, should encourage and facilitate the wise use of our Nation\'s prime farmland.\r\n\r\n     Prime farmland, as defined by the U.S. Department of Agriculture, is land that has the best combination of physical and chemical characteristics for producing food, feed, forage, fiber, and oilseed crops and is available for these uses. It could be cultivated land, pastureland, forestland, or other land, but it is not urban or built-up land or water areas. The soil quality, growing season, and moisture supply are those needed for the soil to economically produce sustained high yields of crops when proper management, including water management, and acceptable farming methods are applied. In general, prime farmland has an adequate and dependable supply of moisture from precipitation or irrigation, a favorable temperature and growing season, acceptable acidity or alkalinity, an acceptable salt and sodium content, and few or no rocks. The water supply is dependable and of adequate quality. Prime farmland is permeable to water and air. It is not excessively erodible or saturated with water for long periods, and it either is not frequently flooded during the growing season or is protected from flooding. Slope ranges mainly from 0 to 6 percent. More detailed information about the criteria for prime farmland is available at the local office of the Natural Resources Conservation Service.\r\n\r\n     For some of the soils identified in the table as prime farmland, measures that overcome a hazard or limitation, such as flooding, wetness, and droughtiness, are needed. Onsite evaluation is needed to determine whether or not the hazard or limitation has been overcome by corrective measures.\r\n\r\n     A recent trend in land use in some areas has been the loss of some prime farmland to industrial and urban uses. The loss of prime farmland to other uses puts pressure on marginal lands, which generally are more erodible, droughty, and less productive and cannot be easily cultivated.\r\n\r\n     "Unique farmland" is land other than prime farmland that is used for the production of specific high-value food and fiber crops, such as citrus, tree nuts, olives, cranberries, and other fruits and vegetables. It has the special combination of soil quality, growing season, moisture supply, temperature, humidity, air drainage, elevation, and aspect needed for the soil to economically produce sustainable high yields of these crops when properly managed. The water supply is dependable and of adequate quality. Nearness to markets is an additional consideration. Unique farmland is not based on national criteria. It commonly is in areas where there is a special microclimate, such as the wine country in California.\r\n\r\n     In some areas, land that does not meet the criteria for prime or unique farmland is considered to be "farmland of statewide importance" for the production of food, feed, fiber, forage, and oilseed crops. The criteria for defining and delineating farmland of statewide importance are determined by the appropriate State agencies. Generally, this land includes areas of soils that nearly meet the requirements for prime farmland and that economically produce high yields of crops when treated and managed according to acceptable farming methods. Some areas may produce as high a yield as prime farmland if conditions are favorable. Farmland of statewide importance may include tracts of land that have been designated for agriculture by State law.\r\n\r\n     In some areas that are not identified as having national or statewide importance, land is considered to be "farmland of local importance" for the production of food, feed, fiber, forage, and oilseed crops. This farmland is identified by the appropriate local agencies. Farmland of local importance may include tracts of land that have been designated for agriculture by local ordinance.');
