INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (47, NULL, E'Ponds and Embankments', E'Ponds and Embankments', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'0', E'1', E'     This table gives information on the soil properties and site features that affect water management. The degree and kind of soil limitations are given for pond reservoir areas; embankments, dikes, and levees; and aquifer-fed excavated ponds. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect these uses. "Not limited" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. "Somewhat limited" indicates that the soil has features that are moderately favorable for the specified use. The limitations can be overcome or minimized by special planning, design, or installation. Fair performance and moderate maintenance can be expected. "Very limited" indicates that the soil has one or more features that are unfavorable for the specified use. The limitations generally cannot be overcome without major soil reclamation, special design, or expensive installation procedures. Poor performance and high maintenance can be expected.\r\n\r\n     Numerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     "Pond reservoir areas" hold water behind a dam or embankment. Soils best suited to this use have low seepage potential in the upper 60 inches. The seepage potential is determined by the saturated hydraulic conductivity (Ksat) of the soil and the depth to fractured bedrock or other permeable material. Excessive slope can affect the storage capacity of the reservoir area.\r\n\r\n     "Embankments, dikes, and levees" are raised structures of soil material, generally less than 20 feet high, constructed to impound water or to protect land against overflow. Embankments that have zoned construction (core and shell) are not considered. In this table, the soils are rated as a source of material for embankment fill. The ratings apply to the soil material below the surface layer to a depth of about 5 feet. It is assumed that soil layers will be uniformly mixed and compacted during construction.\r\n\r\n     The ratings do not indicate the ability of the natural soil to support an embankment. Soil properties to a depth even greater than the height of the embankment can affect performance and safety of the embankment. Generally, deeper onsite investigation is needed to determine these properties.\r\n\r\n     Soil material in embankments must be resistant to seepage, piping, and erosion and have favorable compaction characteristics. Unfavorable features include less than 5 feet of suitable material and a high content of stones or boulders, organic matter, or salts or sodium. A high water table affects the amount of usable material. It also affects trafficability.\r\n\r\n     "Aquifer-fed excavated ponds" are pits or dugouts that extend to a ground-water aquifer or to a depth below a permanent water table. Excluded are ponds that are fed only by surface runoff and embankment ponds that impound water 3 feet or more above the original surface. Excavated ponds are affected by depth to a permanent water table, Ksat of the aquifer, and quality of the water as inferred from the salinity of the soil. Depth to bedrock and the content of large stones affect the ease of excavation.\r\n\r\n     Information in this table is intended for land use planning, for evaluating land use alternatives, and for planning site investigations prior to design and construction. The information, however, has limitations. For example, estimates and other data generally apply only to that part of the soil between the surface and a depth of 5 to 7 feet. Because of the map scale, small areas of different soils may be included within the mapped areas of a specific soil.\r\n\r\n     The information is not site specific and does not eliminate the need for onsite investigation of the soils or for testing and analysis by personnel experienced in the design and construction of engineering works.\r\n\r\n     Government ordinances and regulations that restrict certain land uses or impose specific design criteria were not considered in preparing the information in this table. Local ordinances and regulations should be considered in planning, in site selection, and in design.');
