INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (49, NULL, E'Selected Survey Area Interpretation Descriptions', E'Selected Survey Area Interpretation Descriptions', NULL, E'Selected Survey Area Interpretation Descriptions', E'1', 3, E'Report Parameters - Selected Soil Interpretation Descriptions', NULL, E'1', E'0', NULL);
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (50, NULL, E'Agricultural Disposal of Wastewater by Irrigation and Overland Flow', E'Agricultural Disposal of Wastewater by Irrigation and Overland Flow', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The columns that identify the rating class and limiting features show no more than five limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 2 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'     Soil properties are important considerations in areas where soils are used as sites for the treatment and disposal of organic waste and wastewater. Selection of soils with properties that favor waste management can help to prevent environmental damage.\r\n\r\n     This table shows the degree and kind of soil limitations affecting the treatment of wastewater, including municipal and food-processing wastewater and effluent from lagoons or storage ponds. Municipal wastewater is the waste stream from a municipality. It contains domestic waste and may contain industrial waste. It may have received primary or secondary treatment. It is rarely untreated sewage. Food-processing wastewater results from the preparation of fruits, vegetables, milk, cheese, and meats for public consumption. In places it is high in content of sodium and chloride. In the context of this table, the effluent in lagoons and storage ponds is from facilities used to treat or store food-processing wastewater or domestic or animal waste. Domestic and food-processing wastewater is very dilute, and the effluent from the facilities that treat or store it commonly is very low in content of carbonaceous and nitrogenous material; the content of nitrogen commonly ranges from 10 to 30 milligrams per liter. The wastewater from animal waste treatment lagoons or storage ponds, however, has much higher concentrations of these materials, mainly because the manure has not been diluted as much as the domestic waste. The content of nitrogen in this wastewater generally ranges from 50 to 2,000 milligrams per liter. When wastewater is applied, checks should be made to ensure that nitrogen, heavy metals, and salts are not added in excessive amounts.\r\n\r\n     The ratings in the table are for waste management systems that not only dispose of and treat wastewater but also are beneficial to crops.  The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect agricultural waste management. "Not limited" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. "Somewhat limited" indicates that the soil has features that are moderately favorable for the specified use. The limitations can be overcome or minimized by special planning, design, or installation. Fair performance and moderate maintenance can be expected. "Very limited" indicates that the soil has one or more features that are unfavorable for the specified use. The limitations generally cannot be overcome without major soil reclamation, special design, or expensive installation procedures. Poor performance and high maintenance can be expected.\r\n\r\n     Numerical ratings in the tables indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\n     "Disposal of wastewater by irrigation" not only disposes of municipal wastewater and wastewater from food-processing plants, lagoons, and storage ponds but also can improve crop production by increasing the amount of water available to crops. The ratings in the table are based on the soil properties that affect the design, construction, management, and performance of the irrigation system. The properties that affect design and management include the sodium adsorption ratio, depth to a water table, ponding, available water capacity, Ksat, slope, and flooding. The properties that affect construction include stones, cobbles, depth to bedrock or a cemented pan, depth to a water table, and ponding. The properties that affect performance include depth to bedrock or a cemented pan, bulk density, the sodium adsorption ratio, salinity, reaction, and the cation-exchange capacity, which is used to estimate the capacity of a soil to adsorb heavy metals. Permanently frozen soils are not suitable for disposal of wastewater by irrigation.\r\n\r\n     "Overland flow of wastewater" is a process in which wastewater is applied to the upper reaches of sloped land and allowed to flow across vegetated surfaces, sometimes called terraces, to runoff-collection ditches. The length of the run generally is 150 to 300 feet. The application rate ranges from 2.5 to 16.0 inches per week. It commonly exceeds the rate needed for irrigation of cropland. The wastewater leaves solids and nutrients on the vegetated surfaces as it flows downslope in a thin film. Most of the water reaches the collection ditch, some is lost through evapotranspiration, and a small amount may percolate to the ground water.\r\n\r\n     The ratings in the table are based on the soil properties that affect absorption, plant growth, microbial activity, and the design and construction of the system. Reaction and the cation-exchange capacity affect absorption. Reaction, salinity, and the sodium adsorption ratio affect plant growth and microbial activity. Slope, saturated hydraulic conductivity (Ksat), depth to a water table, ponding, flooding, depth to bedrock or a cemented pan, stones, and cobbles affect design and construction. Permanently frozen soils are unsuitable for waste treatment.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (51, NULL, E'Hydric Soils', E'Hydric Soils', E'[This report lists only those map unit components that are rated as hydric.  Dashes (---) in any column indicate that the data were not included in the database.  Definitions of hydric criteria codes are included at the end of the report]', E'Hydric Soils', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table lists the map unit components that are rated as hydric soils in the survey area. This list can help in planning land uses; however, onsite investigation is recommended to determine the hydric soils on a specific site (National Research Council, 1995; Hurt and others, 2002).\r\n\r\n     The three essential characteristics of wetlands are hydrophytic vegetation, hydric soils, and wetland hydrology (Cowardin and others, 1979; U.S. Army Corps of Engineers, 1987; National Research Council, 1995; Tiner, 1985). Criteria for all of the characteristics must be met for areas to be identified as wetlands. Undrained hydric soils that have natural vegetation should support a dominant population of ecological wetland plant species. Hydric soils that have been converted to other uses should be capable of being restored to wetlands.\r\n\r\n     Hydric soils are defined by the National Technical Committee for Hydric Soils (NTCHS) as soils that formed under conditions of saturation, flooding, or ponding long enough during the growing season to develop anaerobic conditions in the upper part (Federal Register, 1994). These soils, under natural conditions, are either saturated or inundated long enough during the growing season to support the growth and reproduction of hydrophytic vegetation.\r\n\r\n     The NTCHS definition identifies general soil properties that are associated with wetness. In order to determine whether a specific soil is a hydric soil or nonhydric soil, however, more specific information, such as information about the depth and duration of the water table, is needed. Thus, criteria that identify those estimated soil properties unique to hydric soils have been established (Federal Register, 2002). These criteria are used to identify map unit components that normally are associated with wetlands. The criteria used are selected estimated soil properties that are described in "Soil Taxonomy" (Soil Survey Staff, 1999) and "Keys to Soil Taxonomy" (Soil Survey Staff, 2003) and in the "Soil Survey Manual" (Soil Survey Division Staff, 1993).\r\n\r\n     If soils are wet enough for a long enough period of time to be considered hydric, they should exhibit certain properties that can be easily observed in the field. These visible properties are indicators of hydric soils. The indicators used to make onsite determinations of hydric soils are specified in "Field Indicators of Hydric Soils in the United States" (Hurt and others, 2002).\r\n\r\n     Hydric soils are identified by examining and describing the soil to a depth of about 20 inches. This depth may be greater if determination of an appropriate indicator so requires. It is always recommended that soils be excavated and described to the depth necessary for an understanding of the redoximorphic processes. Then, using the completed soil descriptions, soil scientists can compare the soil features required by each indicator and specify which indicators have been matched with the conditions observed in the soil. The soil can be identified as a hydric soil if at least one of the approved indicators is present.\r\n\r\n     Map units that are dominantly made up of hydric soils may have small areas, or inclusions, of nonhydric soils in the higher positions on the landform, and map units dominantly made up of nonhydric soils may have inclusions of hydric soils in the lower positions on the landform.\r\n\r\n     The criteria for hydric soils are represented by codes in the table (for example, 2B3). Definitions for the codes are as follows:\r\n\r\n1. All Histels except for Folistels, and Histosols except for Folists.\r\n2. Soils in Aquic suborders, great groups, or subgroups, Albolls suborder, Historthels great group, Histoturbels great group, Pachic subgroups, or Cumulic subgroups that:\r\n     A. are somewhat poorly drained and have a water table at the surface (0.0 feet) during the growing season, or\r\n     B. are poorly drained or very poorly drained and have either:\r\n          1) a water table at the surface (0.0 feet) during the growing season if textures are \r\n              coarse sand, sand, or fine sand in all layers within a depth of 20 inches, or\r\n          2) a water table at a depth of 0.5 foot or less during the growing season if \r\n              permeability is equal to or greater than 6.0 in/hr in all layers within a depth of 20 inches, or\r\n          3) a water table at a depth of 1.0 foot or less during the growing season if \r\n              permeability is less than 6.0 in/hr in any layer within a depth of 20 inches.\r\n3. Soils that are frequently ponded for long or very long duration during the growing season.\r\n4. Soils that are frequently flooded for long or very long duration during the growing season.\r\n\r\nReferences:\r\nCowardin, L.M., V. Carter, F.C. Golet, and E.T. LaRoe. 1979. Classification of wetlands and deep-water habitats of the United States. U.S. Fish and Wildlife Service FWS/OBS-79/31.\r\nFederal Register. September 18, 2002. Hydric soils of the United States.\r\nFederal Register. July 13, 1994. Changes in hydric soils of the United States.\r\nHurt, G.W., P.M. Whited, and R.F. Pringle, editors. Version 5.0, 2002. Field indicators of hydric soils in the United States.\r\nNational Research Council. 1995. Wetlands: Characteristics and boundaries.\r\nSoil Survey Division Staff. 1993. Soil survey manual. Soil Conservation Service. U.S. Department of Agriculture Handbook 18.\r\nSoil Survey Staff. 2003. Keys to soil taxonomy. 9th edition. U.S. Department of Agriculture, Natural Resources Conservation Service.\r\nSoil Survey Staff. 1999. Soil taxonomy: A basic system of soil classification for making and interpreting soil surveys. 2nd edition. Natural Resources Conservation Service. U.S. Department of Agriculture Handbook 436.\r\nTiner, R.W., Jr. 1985. Wetlands of Delaware. U.S. Fish and Wildlife Service and Delaware Department of Natural Resources and Environmental Control, Wetlands Section.\r\nUnited States Army Corps of Engineers, Environmental Laboratory. 1987. Corps of Engineers wetlands delineation manual. Waterways Experiment Station Technical Report Y-87-1.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (52, NULL, E'Wind Erosion Prediction System Related Attributes', E'Wind Erosion Prediction System Related Attributes', E'Absence of an entry indicates that data were not estimated', E'WEPS Related Attributes', E'0', NULL, NULL, NULL, E'1', E'1', E'     This table shows estimates of some physical and chemical characteristics and features that affect soil behavior for use in the Wind Erosion Prediction System model.  These estimates are given for the whole soil and for the layers of each soil in the survey area.  The estimates are based on field observations and on test data for these and similar soils.  The representative value for each property is indicated.\r\n\r\n     "T Factor" is an estimate of the maximum average annual rate of soil erosion by wind and/or water that can occur without affecting crop productivity over a sustained period.  The rate is in tons per acre per year.\r\n\r\n     "Taxonomic Order".  Twelve soil orders are recognized.  The differences among orders reflect the dominant soil-forming processes and the degree of soil formation.  Each order is identified by a word ending in "sol."  An example is Alfisols.\r\n\r\n     "Albedo, dry", is the estimated ratio of the incident shortwave (solar) radiation that is reflected by the air-dry, less than 2 mm fraction of the soil surface to that received by it.  Soil albedo, as a function of soil color and angle of incidence of the solar radiation, depends on the inherent color of the parent material, organic matter content, and weathering conditions.  Estimates of the evapotranspiration rates and for predicting soil water balances requires the albedo. Evapotranspiration and soil hydrology models that are part of Water Quality and Resource Assessment programs require this information. \r\n\r\n     "Restriction and Depth to Top" is a restrictive layer that is a nearly continuous layer that has one or more physical, chemical, or thermal properties that significantly impede the movement of water and air through the soil or that restrict roots or otherwise provide an unfavorable root environment.  Examples are bedrock, cemented layers, dense layers, and frozen layers.  "Depth to top" is the vertical distance from the soil surface to the upper boundary of the restrictive layer.\r\n\r\n     The thickness of each layer is indicated.\r\n\r\n     "Texture" is given in the standard terms used by the U.S. Department of Agriculture.  These terms are defined according to percentages of sand, silt, and clay in the fraction of the soil that is less than 2 millimeters in diameter.  "Loam," for example, is soil that is 7 to 27 percent clay, 28 to 50 percent silt, and less than 52 percent sand.  If the content of particles coarser than sand is 15 percent or more, an appropriate modifier is added, for example, "gravelly."  Textural terms are defined in the Glossary.\r\n\r\n     Particle size is the effective diameter of a soil particle as measured by sedimentation, sieving, or micrometric methods.  Particle sizes are expressed as classes with specific effective diameter class limits.  The broad classes are sand, silt, and clay, ranging from the larger to the smaller.\r\n\r\n     "Sand" as a soil separate consists of mineral soil particles that are 0.05 millimeter to 2 millimeters in diameter.  The estimated sand content of each soil layer is given as a percentage, by weight, of the soil material that is less than 2 millimeters in diameter.  Sand fractions of "VCOS" very coarse sand, "COS" coarse sand, "MS" medium sand, "FS" fine sand and "VFS" very fine sand are important in identifying the particle sizes susceptible to wind erosion.\r\n\r\n     "Silt" as a soil separate consists of mineral soil particles that are 0.002 to 0.05 millimeter in diameter.  The estimated silt content of each soil layer is given as a percentage, by weight, of the soil material that is less than 2 millimeters in diameter.\r\n\r\n     "Clay" as a soil separate consists of mineral soil particles that are less than 0.002 millimeter in diameter.  The estimated clay content of each soil layer is given as a percentage, by weight, of the soil material that is less than 2 millimeters in diameter.\r\n\r\n     The content of sand, silt, and clay affects the physical behavior of a soil.  Particle size is important for engineering and agronomic interpretations, for determination of soil hydrologic qualities, and for soil classification.\r\n\r\n     "Rock fragments" larger than 10 inches in diameter and 3 to 10 inches in diameter are indicated as a percentage of the total soil on a dry-weight basis.  The percentages are estimates determined mainly by converting volume percentage in the field to weight percentage.\r\n\r\n     "Organic matter" is the plant and animal residue in the soil at various stages of decomposition.  The estimated content of organic matter is expressed as a percentage, by weight, of the soil material that is less than 2 millimeters in diameter.\r\n\r\n     The content of organic matter in a soil can be maintained by returning crop residue to the soil.  Organic matter has a positive effect on available water capacity, water infiltration, soil organism activity, and tilth.  It is a source of nitrogen and other nutrients for crops and soil organisms.\r\n\r\n     "Soil reaction" is a measure of acidity or alkalinity.  It is important in selecting crops and other plants, in evaluating soil amendments for fertility and stabilization, and in determining the risk of corrosion.\r\n\r\n     "Saturated hydraulic conductivity" (Ks) refers to the ability of a soil to transmit water or air.  The term "permeability" indicates saturated hydraulic conductivity (Ksat ).  The estimates in the table indicate the rate of water movement, in micrometers per second, when the soil is saturated.  They are based on soil characteristics observed in the field, particularly structure, porosity, and texture.  Ksat is considered in the design of soil drainage systems and septic tank absorption fields.\r\n\r\n     "Cation-exchange capacity" is the total amount of extractable bases that can be held by the soil, expressed in terms of milliequivalents per 100 grams of soil at neutrality (pH 7.0) or at some other stated pH value.  Soils having a low cation-exchange capacity hold fewer cations and may require more frequent applications of fertilizer than soils having a high cation-exchange capacity.  The ability to retain cations reduces the hazard of ground-water pollution.\r\n\r\n     "Effective cation-exchange capacity" refers to the sum of extractable bases plus aluminum expressed in terms of milliequivalents per 100 grams of soil.  It is determined for soils that have pH of less than 5.5.\r\n\r\n     "Calcium carbonate equivalent" is the percent of carbonates, by weight, in the fraction of the soil less than 2 millimeters in size.  The availability of plant nutrients is influenced by the amount of carbonates in the soil. Incorporating nitrogen fertilizer into calcareous soils helps to prevent nitrite accumulation and ammonium-N volatilization.\r\n\r\n     "Linear extensibility" refers to the change in length of an unconfined clod as moisture content is decreased from a moist to a dry state.  It is an expression of the volume change between the water content of the clod at 1/3- or 1/10-bar tension (33kPa or 10kPa tension) and oven dryness.  The volume change is reported in the table as percent change for the whole soil.  The amount and type of clay minerals in the soil influence volume change.\r\n\r\n     Linear extensibility is used to determine the shrink-swell potential of soils.  The shrink-swell potential is low if the soil has a linear extensibility of less than 3 percent; moderate if 3 to 6 percent; high if 6 to 9 percent; and very high if more than 9 percent.  If the linear extensibility is more than 3, shrinking and swelling can cause damage to buildings, roads, and other structures and to plant roots.  Special design commonly is needed.\r\n\r\n     "Moist bulk density" is the weight of soil (ovendry) per unit volume. Volume is measured when the soil is at field moisture capacity, that is, the moisture content at 1/3- or 1/10-bar (33kPa or 10kPa) moisture tension.  Weight is determined after the soil is dried at 105 degrees C.  In the table, the estimated moist bulk density of each soil horizon is expressed in grams per cubic centimeter of soil material that is less than 2 millimeters in diameter.  Bulk density data are used to compute shrink-swell potential, available water capacity, total pore space, and other soil properties.  The moist bulk density of a soil indicates the pore space available for water and roots.  Depending on soil texture, a bulk density of more than 1.4 can restrict water storage and root penetration.  Moist bulk density is influenced by texture, kind of clay, content of organic matter, and soil structure.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1000, NULL, E'Hydric Soils (CA)', E'Hydric Soils (CA)', E'[Absence of an entry indicates that the feature is not a concern or that data were not estimated. Definitions of hydric criteria codes are described in the text]', E'Hydric Soils (CA)', E'0', NULL, E'Hydric Soils (CA)', NULL, E'1', E'1', E'This table lists the map unit components that are rated as hydric soils in the survey area. This list can help in planning land uses; however, onsite investigation is recommended to determine the hydric soils on a specific site (National Research Council, 1995; Hurt and Vasilas, 2006).\r\n\r\nThe three essential characteristics of wetlands are hydrophytic vegetation, hydric soils, and wetland hydrology (Cowardin and others, 1979; U.S. Army Corps of Engineers, 1987; National Research Council, 1995; Tiner, 1985). Criteria for all of the characteristics must be met for areas to be identified as wetlands. Undrained hydric soils that have natural vegetation should support a dominant population of ecological wetland plant species. Hydric soils that have been converted to other uses should be capable of being restored to wetlands.\r\n\r\nHydric soils are defined by the National Technical Committee for Hydric Soils (NTCHS) as soils that formed under conditions of saturation, flooding, or ponding long enough during the growing season to develop anaerobic conditions in the upper part (Federal Register, 1994). These soils, under natural conditions, are either saturated or inundated long enough during the growing season to support the growth and reproduction of hydrophytic vegetation.\r\n\r\nThe NTCHS definition identifies general soil properties that are associated with wetness. In order to determine whether a specific soil is a hydric soil or nonhydric soil, however, more specific information, such as information about the depth and duration of the water table, is needed. Thus, criteria that identify those estimated soil properties unique to hydric soils have been established (Federal Register, 2002). These criteria are used to identify map unit components that normally are associated with wetlands. The criteria used are selected estimated soil properties that are described in "Soil Taxonomy" (Soil Survey Staff, 1999) and "Keys to Soil Taxonomy" (Soil Survey Staff, 2006) and in the "Soil Survey Manual" (Soil Survey Division Staff, 1993).\r\n\r\nIf soils are wet enough for a long enough period of time to be considered hydric, they should exhibit certain properties that can be easily observed in the field. These visible properties are indicators of hydric soils. The indicators used to make onsite determinations of hydric soils are specified in "Field Indicators of Hydric Soils in the United States" (Hurt and Vasilas, 2006).\r\n\r\nHydric soils are identified by examining and describing the soil to a depth of about 20 inches. This depth may be greater if determination of an appropriate indicator so requires. It is always recommended that soils be excavated and described to the depth necessary for an understanding of the redoximorphic processes. Then, using the completed soil descriptions, soil scientists can compare the soil features required by each indicator and specify which indicators have been matched with the conditions observed in the soil. The soil can be identified as a hydric soil if at least one of the approved indicators is present.\r\n\r\nMap units that are dominantly made up of hydric soils may have small areas, or inclusions, of nonhydric soils in the higher positions on the landform, and map units dominantly made up of nonhydric soils may have inclusions of hydric soils in the lower positions on the landform.\r\n\r\nThe criteria for hydric soils are represented by codes in the table (for example, 2B3). Definitions for the codes are as follows:\r\n\r\n1. All Histels except for Folistels, and Histosols except for Folists.\r\n2. Soils in Aquic suborders, great groups, or subgroups, Albolls suborder, Historthels great group, Histoturbels great group, Pachic subgroups, or Cumulic subgroups that:\r\nA. are somewhat poorly drained and have a water table at the surface (0.0 feet) during the growing season, or\r\nB. are poorly drained or very poorly drained and have either:\r\n1) a water table at the surface (0.0 feet) during the growing season if textures are coarse sand, sand, or fine sand in all layers within a depth of 20 inches, or\r\n2) a water table at a depth of 0.5 foot or less during the growing season if saturated hydraulic conductivity (Ksat) is equal to or greater than 6.0 in/hr in all layers within a depth of 20 inches, or\r\n3) a water table at a depth of 1.0 foot or less during the growing season if saturated hydraulic conductivity (Ksat) is less than 6.0 in/hr in any layer within a depth of 20 inches.\r\n3. Soils that are frequently ponded for long or very long duration during the growing season.\r\n4. Soils that are frequently flooded for long or very long duration during the growing season.\r\n\r\nReferences:\r\nCowardin, L.M., V. Carter, F.C. Golet, and E.T. LaRoe. 1979. Classification of wetlands and deep-water habitats of the United States. U.S. Fish and Wildlife Service FWS/OBS-79/31.\r\nFederal Register. September 18, 2002. Hydric soils of the United States.\r\nFederal Register. July 13, 1994. Changes in hydric soils of the United States.\r\nHurt, G.W., and L.M. Vasilas, editors. Version 6.0, 2006. Field indicators of hydric soils in the United States.\r\nNational Research Council. 1995. Wetlands: Characteristics and boundaries.\r\nSoil Survey Division Staff. 1993. Soil survey manual. Soil Conservation Service. U.S. Department of Agriculture Handbook 18.\r\nSoil Survey Staff. 2006. Keys to soil taxonomy. 10th edition. U.S. Department of Agriculture, Natural Resources Conservation Service.\r\nSoil Survey Staff. 1999. Soil taxonomy: A basic system of soil classification for making and interpreting soil surveys. 2nd edition. Natural Resources Conservation Service. U.S. Department of Agriculture Handbook 436.\r\nTiner, R.W., Jr. 1985. Wetlands of Delaware. U.S. Fish and Wildlife Service and Delaware Department of Natural Resources and Environmental Control, Wetlands Section.\r\nUnited States Army Corps of Engineers, Environmental Laboratory. 1987. Corps of Engineers wetlands delineation manual. Waterways Experiment Station Technical Report Y-87-1.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1001, NULL, E'Brief Soil Descriptions (CA)', E'Brief Soil Descriptions (CA)', E'[Absence of an entry indicates that the feature is not a concern or that data were not estimated. Data applies to the entire extent of the map unit within the survey area. Map unit and soil properties for a specific parcel of land may vary somewhat and should be determined by onsite investigation]', E'17 MUD2', E'0', NULL, E'Brief Soil Descriptions (CA)', NULL, E'1', E'1', E'NASIS derived Non-Technical Descriptions.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1002, NULL, E'Storie Index Rating (CA)', E'Storie Index Rating (CA)', NULL, E'Storie Index Rating (CA)', E'0', NULL, E'Storie Index Rating (CA)', NULL, E'1', E'1', E'The Storie Index is a widely known and accepted method of rating soils for cultivated agriculture in California. Historically, Storie Index ratings have been "hand generated" by soil survey staff and collaborators. \r\n\r\nThe Storie Index assesses the productivity of a soil from the following four characteristics: Factor A, degree of soil profile development; factor B, texture of the surface layer; factor C, slope; and factor X, manageable features, including drainage, microrelief, fertility, acidity, erosion, and salt content. A score ranging from 0 to 100 percent is determined for each factor, and the scores are then multiplied together to derive an index rating (Storie, 1932, 1978).\r\n\r\nFor simplification, Storie Index ratings have been combined into six grade classes as follows: Grade 1 (excellent), 100 to 80; grade 2 (good), 79 to 60; grade 3 (fair), 59 to 40; grade 4 (poor), 39 to 20; grade 5 (very poor), 19 to 10; and grade 6 (nonagricultural), less than 10.\r\n\r\nReferences\r\nStorie, R.E. 1932. An index for rating the agricultural value of soils. University of California Agricultural Experiment Station Bulletin 556.\r\nStorie, R.E. 1978. Storie index rating. University of California, Division of Agricultural Science Special Publication 3203.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1003, NULL, E'California Revised Storie Index Rating (CA)', E'California Revised Storie Index Rating (CA)', NULL, E'California Revised Storie Index Rating (CA)', E'0', NULL, E'California Revised Storie Index Rating (CA)', NULL, E'1', E'1', E'The Storie Index is a soil rating based on soil properties that govern a soilâ€™s potential for cultivated agriculture in California. \r\n\r\nThe Storie Index assesses the productivity of a soil from the following four characteristics: Factor A, degree of soil profile development; factor B, texture of the surface layer; factor C, slope; and factor X, manageable features, including drainage, microrelief, fertility, acidity, erosion, and salt content. A score ranging from 0 to 100 percent is determined for each factor, and the scores are then multiplied together to derive an index rating (Storie, 1932, 1978).\r\n\r\nFor simplification, Storie Index ratings have been combined into six grade classes as follows: Grade 1 (excellent), 100 to 80; grade 2 (good), 79 to 60; grade 3 (fair), 59 to 40; grade 4 (poor), 39 to 20; grade 5 (very poor), 19 to 10; and grade 6 (nonagricultural), less than 10.\r\n\r\nThe Revised Storie Index is a soil component-based interpretation designed to generate  "on-the-fly" California Storie Index ratings that are always in sync with current soil property data in the NASIS database.\r\n\r\nHistorical values calculated prior to 2005 and published in soil survey reports before 2005 are the numbers stored in the NASIS data element. The decision and justification to use these revised numbers verses the historical values falls with the users of the interpretation (such as land use planners and California state agencies). \r\n\r\nReports in National Soils Information System (NASIS) and the Soil Data Mart display either revised, historical, or both numbers and are tagged appropriately. The results of the Revised Storie Index are based only on the representative value of a range of soil properties and does not express the full range of numerical ratings possible for any one map unit delineation. \r\n\r\nBackground\r\n\r\nThe Storie Index is a widely known and accepted method of rating soils for land use and productivity in California. Ratings are generated from a broad range of soil profile and landscape characteristics. Historically, Storie Index ratings have been "hand generated" by soil survey staff and collaborators. These ratings can be highly subjective because no single person has generated Storie ratings for the entire State and because inherent biases are associated with the classification system. To reduce this subjectivity, the Revised Storie Index is used in NASIS to compute Storie Index ratings. The model uses combinations of discrete and fuzzy logic functions (Cox, 1999) to obtain scores for the factors associated with the Storie Index.  If the modeled criteria in NASIS are used, subjectivity can be minimized and thousands of ratings can be generated in a timely and consistent manner.\r\n\r\nStorie Index Characteristics\r\n\r\nFactor A.â€”Profile development. In factor A, the degree of soil development is used to assess potential productivity. For alluvial soils, the score is progressively decreased with increasing degree of soil development and/or the presence of root-restrictive layers. Deep, well drained soils that formed in alluvium would be rated 100, whereas a similar soil with a restrictive layer, such as a claypan or hardpan, would be rated much lower. For soils that formed in material weathered from bedrock, scoring is based on depth to a lithic or paralithic contact.\r\n\r\nTwo main data sets in NASIS are used to model factor A--soil taxonomy and landform. Interpretive criteria implied in the Storie Profile Group (Factor A) relied on the current taxonomic placement (Soil Survey Staff, 1999) of the soil in NASIS. In all situations, the upper limit of the scoring range in Storie (1978) was used for each soil profile group. For example, an Entisol formed on a valley floor would be rated 100, whereas a Durixeralf formed on an old terrace and having a pan at a depth of less than 1 foot would be rated 80. The fuzzy logic rule "more is better" was used to revise the upper limit of the score based on depth to the restrictive horizon.\r\n\r\n\r\nFactor B. â€”Texture of the surface layer. Loamy soils receive the highest ratings and clay-rich and sandy soils receive lower ratings. The content of rock fragments is used to modify the scores, which range from 100 to 10 percent.\r\n\r\nCrisp values were assigned for surface horizon textural classes according to Storie (1978). The following textures were not listed in the original Storie Index publication and were added and assigned ratings by the authors: sic, c, cos, vfsl, sc, lcos, lfs, lvfs, and si.  At the present time, the NASIS Storie model does not rate in-lieu-of-textures as they were not addressed in the original Storie Index. All textural class ratings were modified by the content of rock fragments on the basis of the fuzzy logic rule "less is better."  This fuzzy score for content of rock fragments was then used to weight the surface soil textural class score for factor B. For example, a silt loam with 0 percent rock fragments received a score of 100, while a very gravelly silt loam with 45 percent rock fragments received a score weighted proportionally to the amount of rock fragments. \r\n\r\nFactor C.â€”Slope. Factor C is based on steepness of slope. Nearly level and gentle slopes (0 to 8 percent) receive scores of 100 to 85. Moderate and strong slopes (9 to 30 percent) receive scores of 95 to 70 percent. Steep slopes (more than 30 percent) receive scores of 50 to 5 percent.\r\n\r\nSlope classes stored in NASIS were scored using the fuzzy logic rule set "less is better." This function reduced the subjectivity associated with choosing a score from the range of scores within each factor. For example, the original Storie Factor C (Slope) has slope categories with scores that range from 100 "nearly level" to 5 "very steep" (Storie, 1978). \r\n\r\nFactor X.â€”Fertility, drainage, erosion, acidity, salts, and microrelief. Factor X focuses on soil and landscape conditions, exclusive of the soil profile, that require special management considerations. The characteristics considered are salt-affected soils, acid soils, wind erosion and water erosion, fertility status, drainage, and microrelief.\r\n\r\nData elements stored in NASIS, such as drainage class, erosion class, microrelief, flooding, and ponding, were used to model the hydrologic and physical properties associated with the X factor. Toxic thresholds were established for electrical conductivity, sodium adsorption ratio, and pH to define adverse chemical properties used for the X factor. Soil optimum pH was used to characterize fertility. Fuzzy rule sets were implemented in NASIS to model chemical and fertility attributes associated with the X factor. A â€œless-is-betterâ€ curve was used to score erosion and salt-affected soils. Crisp values were assigned to hydrologic properties. \r\n\r\nIMPORTANT: This interpretation was not designed or intended to be used in a regulatory manner. \r\n\r\nReferences\r\n\r\nCox, Earl. 1999. The fuzzy systems handbook. 2nd edition. Academic Press.\r\n\r\nStorie, R.E. 1932. An index for rating the agricultural value of soils. University of California Agricultural Experiment Station Bulletin 556.\r\n\r\nStorie, R.E. 1978. Storie index rating. University of California, Division of Agricultural Science Special Publication 3203.\r\n\r\nSoil Survey Staff. 1998. Keys to soil taxonomy. 8th edition. U.S. Department of Agriculture, Natural Resources Conservation Service.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1004, NULL, E'Desert Tortoise (CA)', E'Desert Tortoise (CA)', NULL, E'Template Interpretation Report - 1 Interpretation', E'0', NULL, NULL, NULL, E'1', E'1', E'This table gives information about the soils as potential habitat for the desert tortoise. It is intended to be used only in those soil survey areas that have the potential for desert tortoise habitat. The soils are rated according to their suitability for burrowing by desert tortoises. Burrows are considered a necessary part of the habitat. \r\n\r\nThis table is intended to provide guidelines in the identification and selection of sites that have the best potential for preserving, maintaining, or increasing local populations of the desert tortoise. It is of a general nature. It is designed to be used in the planning process to identify areas of concern prior to the application of conservation practices. Based upon the wildlife objectives, these areas can be avoided or practices can be adjusted to minimize damage to the burrow habitat. The guide does not take into account climate or soil temperature, which may influence the presence or distribution patterns of a wildlife species. The presence or absence of a species is determined at the local level.\r\n\r\nThe table provides suitability ratings and identifies the dominant soil charecteristics that influence the suitability of a site for burrowing by desert tortoises. This information allows the user to plan and develop alternatives in site selection by identifying the site that best meets the wildlife habitat requirements.\r\n\r\nSoils that are rated â€œwell suitedâ€ have no restrictions and are favorable for burrowing by desert tortoises. Colonization and population densities may be above average if other habitat factors are not limiting. A rating of â€œsuitedâ€ indicates that the soil is suitable for burrowing by desert tortoises and that some restrictive features may limit the use of the habitat. Colonization and population densities may be average if the other habitat requirements are met. A rating of â€œpoorly suitedâ€ indicates that the soil characteristics may limit establishment, maintenance, or use of the soil by burrowing species. Colonization and population densities may be restricted by the limiting factors even though all the other species habitat requirements are met.\r\n\r\nThe final identification and selection of a site for burrowing by desert tortoises are determined by the limitations of the soils that influence excavation, maintenance, and preservation of the burrows. This interpretation identifies the soil-related restricting features that have the most significant effects on the habitat.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1005, NULL, E'Sprinkler and Drip Irrigation (CA)', E'Sprinkler and Drip Irrigation (CA)', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the limitation.  The table shows only the top limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 2 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'This table shows the degree and kind of soil limitations that affect sprinkler irrigation and drip or trickle irrigation. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect the irrigation system. â€œNo limitationsâ€ indicates that the soil has features that are very favorable for the specified system. Good performance and very low maintenance can be expected. â€œLimitationsâ€ indicates that the soil has some features that are favorable for the specified use and some that are unfavorable. This table identifies only the most significant limitations for any given soil. The limitations listed can be overcome or minimized by special planning, design, or installation. Fair or poor performance and moderate or high maintenance can be expected, depending on the number of limitations and the severity of each limitation.\r\n\r\nNumerical ratings indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the irrigation system (1.00) and the point at which a soil feature is not a limitation (0.00).\r\n\r\nThe interpretations for the two irrigation systems were developed by the NRCS Soils Staff in Davis, California. They were developed with assistance from the NRCS Resource Technology Staff in Davis, California, and received further technical review from irrigation specialists at UC-Davis. For drip or trickle irrigation, criteria for permeability restrictions were omitted on the basis of suggestions made by NRCS personnel working on the Alameda County Agricultural Enhancement Plan.\r\n\r\nThe soil properties and qualities important in design and management are the sodium adsorption ratio, depth to a seasonal high water table, the available water capacity, saturated hydraulic conductivity (Ksat), wind erodibility, water erodibility, slope, and flooding.  The soil properties and qualities that influence construction are stones, depth to bedrock or to a cemented pan, and depth to a seasonal high water table.  The properties and qualities that affect performance of the irrigation system are depth to bedrock or to a cemented pan, bulk density, the sodium adsorption ratio, salinity, and soil reaction.  Permanently frozen soils are not suited to irrigation.\r\n\r\nIMPORTANT: These interpretations are not designed or intended to be used in a regulatory manner.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1006, NULL, E'Basin, Border, and Furrow Irrigation (CA)', E'Basin, Border, and Furrow Irrigation (CA)', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the limitation.  The table shows only the top limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'This table shows the degree and kind of soil limitations that affect basin or paddy irrigation, graded border irrigation, and furrow irrigation. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect the irrigation system. â€œNo limitationsâ€ indicates that the soil has features that are very favorable for the specified system. Good performance and very low maintenance can be expected. â€œLimitationsâ€ indicates that the soil has some features that are favorable for the specified use and some that are unfavorable. This table identifies only the most significant limitations for any given soil. The limitations listed can be overcome or minimized by special planning, design, or installation. Fair or poor performance and moderate or high maintenance can be expected, depending on the number of limitations and the severity of each limitation.\r\n\r\nNumerical ratings indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the irrigation system (1.00) and the point at which a soil feature is not a limitation (0.00).\r\n\r\nThe interpretations for the three irrigation systems were developed by the NRCS Soils Staff in Davis, California. They were developed with assistance from the NRCS Resource Technology Staff in Davis, California, and received further technical review from irrigation specialists at UC-Davis.\r\n\r\nThe soil properties and qualities important in design and management are the sodium adsorption ratio, depth to a seasonal high water table, the available water capacity, saturated hydraulic conductivity (Ksat), wind erodibility, water erodibility, slope, and flooding.  The soil properties and qualities that influence construction are stones, depth to bedrock or to a cemented pan, and depth to a seasonal high water table.  The properties and qualities that affect performance of the irrigation system are depth to bedrock or to a cemented pan, bulk density, the sodium adsorption ratio, salinity, and soil reaction.  Permanently frozen soils are not suited to irrigation.\r\n\r\nIMPORTANT: These interpretations are not designed or intended to be used in a regulatory manner.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1007, NULL, E'Camp Areas, Off-Road Motorcycle Trails, and Paths and Trails (CA)', E'Camp Areas, Off-Road Motorcycle Trails, and Paths and Trails (CA)', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the potential limitation.  The table shows only the top limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'The soils of the survey area are rated in this table according to limitations that affect their suitability for recreational uses. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect the specified use. "No limitations" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. â€œLimitationsâ€ indicates that the soil has some features that are favorable for the specified use and some that are unfavorable. The table identifies only the most significant limitations for any given soil.  The limitations listed can be overcome or minimized by special planning, design, or installation. Fair or poor performance and moderate or high maintenance can be expected, depending on the number of limitations and the severity of each limitation.\r\n\r\nNumerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\nThe ratings are based on restrictive soil features, such as wetness, slope, and texture of the surface layer. Susceptibility to flooding is considered. Not considered in the ratings, but important in evaluating a site, are the location and accessibility of the area, the size and shape of the area and its scenic quality, vegetation, access to water, potential water impoundment sites, and access to public sewer lines. The capacity of the soil to absorb septic tank effluent and the ability of the soil to support vegetation also are important. Soils that are subject to flooding are limited for recreational uses by the duration and intensity of flooding and the season when flooding occurs. In planning recreational facilities, onsite assessment of the height, duration, intensity, and frequency of flooding is essential.\r\n\r\nThe information in this table can be supplemented by other information, for example, interpretations for building site development, construction materials, sanitary facilities, and water management.\r\n\r\nâ€œCamp areasâ€ require site preparation, such as shaping and leveling the tent and parking areas, stabilizing roads and intensively used areas, and installing sanitary facilities and utility lines. Camp areas are subject to heavy foot traffic and some vehicular traffic. The ratings are based on the soil properties that affect the ease of developing camp areas and the performance of the areas after development. Slope, stoniness, and depth to bedrock or a cemented pan are the main concerns affecting the development of camp areas. The soil properties that affect the performance of the areas after development are those that influence trafficability and promote the growth of vegetation, especially in heavily used areas. For good trafficability, the surface of camp areas should absorb rainfall readily, remain firm under heavy foot traffic, and not be dusty when dry. The soil properties that influence trafficability are texture of the surface layer, depth to a water table, ponding, flooding, saturated hydraulic conductivity (Ksat), and large stones. The soil properties that affect the growth of plants are depth to bedrock or a cemented pan, Ksat, and toxic substances in the soil.\r\n                                                                                                                         \r\nâ€œPaths and trailsâ€ for hiking and horseback riding should require little or no slope modification through cutting and filling. The ratings are based on the soil properties that affect trafficability and erodibility. These properties are stoniness, depth to a water table, ponding, flooding, slope, and texture of the surface layer.\r\n\r\nâ€œOff-road motorcycle trailsâ€ require little or no site preparation. They are not covered with surfacing material or vegetation. Considerable compaction of the soil material is likely. The ratings are based on the soil properties that influence erodibility, trafficability, dustiness, and the ease of revegetation. These properties are stoniness, slope, depth to a water table, ponding, flooding, and texture of the surface layer.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1008, NULL, E'Picnic Areas, Playgrounds, and Lawns, Landscaping, Golf Fairways (CA)', E'Picnic Areas, Playgrounds, and Lawns, Landscaping, Golf Fairways (CA)', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the limitation.  The table shows only the top limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'The soils of the survey area are rated in this table according to limitations that affect their suitability for recreational uses. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect the specified use. "No limitations" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. â€œLimitationsâ€ indicates that the soil has some features that are favorable for the specified use and some that are unfavorable. The table identifies only the most significant limitations for any given soil.  The limitations listed can be overcome or minimized by special planning, design, or installation. Fair or poor performance and moderate or high maintenance can be expected, depending on the number of limitations and the severity of each limitation.\r\n\r\nNumerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\nThe ratings are based on restrictive soil features, such as wetness, slope, and texture of the surface layer. Susceptibility to flooding is considered. Not considered in the ratings, but important in evaluating a site, are the location and accessibility of the area, the size and shape of the area and its scenic quality, vegetation, access to water, potential water impoundment sites, and access to public sewer lines. The capacity of the soil to absorb septic tank effluent and the ability of the soil to support vegetation also are important. Soils that are subject to flooding are limited for recreational uses by the duration and intensity of flooding and the season when flooding occurs. In planning recreational facilities, onsite assessment of the height, duration, intensity, and frequency of flooding is essential.\r\n\r\nThe information in this table can be supplemented by other information, for example, interpretations for building site development, construction materials, sanitary facilities, and water management.\r\n\r\nâ€œPicnic areasâ€ are subject to heavy foot traffic. Most vehicular traffic is confined to access roads and parking areas. The ratings are based on the soil properties that affect the ease of developing picnic areas and that influence trafficability and the growth of vegetation after development. Slope and stoniness are the main concerns affecting the development of picnic areas. For good trafficability, the surface of picnic areas should absorb rainfall readily, remain firm under heavy foot traffic, and not be dusty when dry. The soil properties that influence trafficability are texture of the surface layer, depth to a water table, ponding, flooding, saturated hydraulic conductivity (Ksat), and large stones. The soil properties that affect the growth of plants are depth to bedrock or a cemented pan, Ksat, and toxic substances in the soil.\r\n\r\nâ€œPlaygroundsâ€ require soils that are nearly level, are free of stones, and can withstand intensive foot traffic. The ratings are based on the soil properties that affect the ease of developing playgrounds and that influence trafficability and the growth of vegetation after development. Slope and stoniness are the main concerns affecting the development of playgrounds. For good trafficability, the surface of the playgrounds should absorb rainfall readily, remain firm under heavy foot traffic, and not be dusty when dry. The soil properties that influence trafficability are texture of the surface layer, depth to a water table, ponding, flooding, Ksat, and large stones. The soil properties that affect the growth of plants are depth to bedrock or a cemented pan, Ksat, and toxic substances in the soil.  \r\n\r\nâ€œLawns, landscaping and golf fairwaysâ€ require soils on which turf and ornamental trees and shrubs can be established and maintained. Irrigation is not considered in the ratings. The ratings are based on the soil properties that affect plant growth and trafficability after vegetation is established. The properties that affect plant growth are reaction; depth to a water table; ponding; depth to bedrock or a cemented pan; the available water capacity in the upper 40 inches; the content of salts, sodium, or calcium carbonate; and sulfidic materials. The properties that affect trafficability are flooding, depth to a water table, ponding, slope, stoniness, and the amount of sand, clay, or organic matter in the surface layer.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1009, NULL, E'Dwellings and Small Commercial Buildings (CA)', E'Dwellings and Small Commercial Buildings (CA)', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the limitation.  The table shows only the top limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'Soil properties influence the development of building sites, including the selection of the site, the design of the structure, construction, performance after construction, and maintenance. This table shows the degree and kind of soil limitations that affect dwellings with and without basements and small commercial buildings.\r\n\r\nThe ratings in the table are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect building site development. "No limitations" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. â€œLimitationsâ€ indicates that the soil has some features that are favorable for the specified use and some that are unfavorable. The limitations can be overcome or minimized by special planning, design, or installation. Fair performance and moderate maintenance can be expected, depending on the number of limitations and the severity of each limitation.\r\n\r\nNumerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\nâ€Dwellingsâ€ are single-family houses of three stories or less. For dwellings without basements, the foundation is assumed to consist of spread footings of reinforced concrete built on undisturbed soil at a depth of 2 feet or at the depth of maximum frost penetration, whichever is deeper. For dwellings with basements, the foundation is assumed to consist of spread footings of reinforced concrete built on undisturbed soil at a depth of about 7 feet. The ratings for dwellings are based on the soil properties that affect the capacity of the soil to support a load without movement and on the properties that affect excavation and construction costs. The properties that affect the load-supporting capacity include depth to a water table, ponding, flooding, subsidence, linear extensibility (shrink-swell potential), and compressibility. Compressibility is inferred from the Unified classification. The properties that affect the ease and amount of excavation include depth to a water table, ponding, flooding, slope, depth to bedrock or a cemented pan, hardness of bedrock or a cemented pan, and the amount and size of rock fragments.\r\n\r\nâ€œSmall commercial buildingsâ€œare structures that are less than three stories high and do not have basements. The foundation is assumed to consist of spread footings of reinforced concrete built on undisturbed soil at a depth of 2 feet or at the depth of maximum frost penetration, whichever is deeper. The ratings are based on the soil properties that affect the capacity of the soil to support a load without movement and on the properties that affect excavation and construction costs. The properties that affect the load-supporting capacity include depth to a water table, ponding, flooding, subsidence, linear extensibility (shrink-swell potential), and compressibility (which is inferred from the Unified classification). The properties that affect the ease and amount of excavation include flooding, depth to a water table, ponding, slope, depth to bedrock or a cemented pan, hardness of bedrock or a cemented pan, and the amount and size of rock fragments.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1010, NULL, E'Roads and Streets and Shallow Excavations (CA)', E'Roads and Streets and Shallow Excavations (CA)', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the limitation.  The table shows only the top limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 2 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'Soil properties influence the development of building sites, including the selection of the site, the design of the structure, construction, performance after construction, and maintenance. This table shows the degree and kind of soil limitations that affect local roads and streets, shallow excavations, and lawns and landscaping. The ratings in the table are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect building site development."No limitations" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. "Limitations" indicates that the soil has features that are favorable to unfavorable for the specified use. The table identifies only the top limitations for any given soil.  The limitations listed can be overcome or minimized by special planning, design, or installation. Fair to poor performance and moderate to high maintenance can be expected, depending on the number of limitations and the severity of each limitation.\r\n\r\nNumerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\nLocal roads and streets have an all-weather surface and carry automobile and light truck traffic all year. They have a subgrade of cut or fill soil material; a base of gravel, crushed rock, or soil material stabilized by lime or cement; and a surface of flexible material (asphalt), rigid material (concrete), or gravel with a binder. The ratings are based on the soil properties that affect the ease of excavation and grading and the traffic-supporting capacity. The properties that affect the ease of excavation and grading are depth to bedrock or a cemented pan, hardness of bedrock or a cemented pan, depth to a water table, ponding, flooding, the amount of large stones, and slope. The properties that affect the traffic-supporting capacity are soil strength (as inferred from the AASHTO group index number), subsidence, linear extensibility (shrink-swell potential), the potential for frost action, depth to a water table, and ponding.\r\n\r\nShallow excavations are trenches or holes dug to a maximum depth of 5 or 6 feet for graves, utility lines, open ditches, or other purposes. The ratings are based on the soil properties that influence the ease of digging and the resistance to sloughing. Depth to bedrock or a cemented pan, hardness of bedrock or a cemented pan, the amount of large stones, and dense layers influence the ease of digging, filling, and compacting. Depth to the seasonal high water table, flooding, and ponding may restrict the period when excavations can be made. Slope influences the ease of using machinery. Soil texture, depth to the water table, and linear extensibility (shrink-swell potential) influence the resistance to sloughing.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1011, NULL, E'Source of Sand and Gravel (CA)', E'Source of Sand and Gravel (CA)', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.00 to 0.99.  The larger the value, the greater the likelihood that the bottom layer or thickest layer of the soil is a source of sand or gravel', E'Template Interpretation Report - 2 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'This table gives information about the soils as potential sources of gravel and sand. Normal compaction, minor processing, and other standard construction practices are assumed.\r\n\r\nSand and gravel are natural aggregates suitable for commercial use with a minimum of processing. They are used in many kinds of construction. Specifications for each use vary widely.  Only the likelihood of finding material in suitable quantity is evaluated. The suitability of the material for specific purposes is not evaluated, nor are factors that affect excavation of the material. The properties used to evaluate the soil as a source of sand or gravel are gradation of grain sizes (as indicated by the Unified classification of the soil), the thickness of suitable material, and the content of rock fragments. If the bottom layer of the soil contains sand or gravel, the soil is considered a likely source regardless of thickness. The assumption is that the sand or gravel layer below the depth of observation exceeds the minimum thickness. The ratings are for the whole soil, from the surface to a depth of about 6 feet.\r\n\r\nThe soils are rated "good", "fair", or "poor" as potential sources of sand and gravel. A rating of "good" or "fair" means that the source material is likely to be in or below the soil. The bottom layer and the thickest layer of the soils are assigned numerical ratings. These ratings indicate the likelihood that the layer is a source of sand or gravel. The number 0.00 indicates that the layer is a "poor" source. The number 1.00 indicates that the layer is a "good" source. A number between 0.00 and 1.00 indicates the degree to which the layer is a likely source.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1012, NULL, E'Source of Reclamation Material, Roadfill, and Topsoil (CA)', E'Source of Reclamation Material, Roadfill, and Topsoil (CA)', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.00 to 0.99.  The smaller the value, the greater the limitation', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'This table gives information about the soils as potential sources of reclamation material, roadfill, and topsoil . Normal compaction, minor processing, and other standard construction practices are assumed.\r\n\r\nThe soils are rated "good", "fair", or "poor" as potential sources of reclamation material, roadfill, and topsoil. The features that limit the soils as sources of these materials are specified in the table. Numerical ratings between 0.00 and 1.00 are given after the specified features.  These numbers indicate the degree to which the features limit the soils as sources of the materials. The lower the number, the greater the limitation.\r\n\r\nâ€œReclamation materialâ€ is used in areas that have been drastically disturbed by surface mining or similar activities. When these areas are reclaimed, layers of soil material or unconsolidated geological material, or both, are replaced in a vertical sequence. The reconstructed soil favors plant growth. The ratings in the table do not apply to quarries and other mined areas that require an offsite source of reconstruction material. The ratings are based on the soil properties that affect erosion and stability of the surface and the productive potential of the reconstructed soil. These properties include the content of sodium, salts, and calcium carbonate; reaction; available water capacity; erodibility; texture; content of rock fragments; and content of organic matter and other features that affect fertility.\r\n\r\nâ€œRoadfillâ€ is soil material that is excavated in one place and used in road embankments in another place. In this table, the soils are rated as a source of roadfill for low embankments, generally less than 6 feet high and less exacting in design than higher embankments. The ratings are for the whole soil, from the surface to a depth of about 5 feet. It is assumed that soil layers will be mixed when the soil material is excavated and spread.\r\n\r\nThe ratings are based on the amount of suitable material and on soil properties that affect the ease of excavation and the performance of the material after it is in place. The thickness of the suitable material is a major consideration. The ease of excavation is affected by large stones, depth to a water table, and slope. How well the soil performs in place after it has been compacted and drained is determined by its strength (as inferred from the AASHTO classification of the soil) and linear extensibility (shrink-swell potential).\r\n\r\nâ€œTopsoilâ€ is used to cover an area so that vegetation can be established and maintained. The upper 40 inches of a soil is evaluated for use as topsoil. Also evaluated is the reclamation potential of the borrow area. The ratings are based on the soil properties that affect plant growth; the ease of excavating, loading, and spreading the material; and reclamation of the borrow area. Toxic substances, soil reaction, and the properties that are inferred from soil texture, such as available water capacity and fertility, affect plant growth. The ease of excavating, loading, and spreading is affected by rock fragments, slope, depth to a water table, soil texture, and thickness of suitable material. Reclamation of the borrow area is affected by slope, depth to a water table, rock fragments, depth to bedrock or a cemented pan, and toxic material.\r\n\r\nThe surface layer of most soils is generally preferred for topsoil because of its organic matter content. Organic matter greatly increases the absorption and retention of moisture and nutrients for plant growth.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1013, NULL, E'Ponds and Embankments (CA)', E'Ponds and Embankments (CA)', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the limitation.  The table shows only the top limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'This table gives information on the soil properties and site features that affect water management. The degree and kind of soil limitations are given for pond reservoir areas; embankments, dikes, and levees; and aquifer-fed excavated ponds. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect these uses. "No limitations" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. â€œLimitationsâ€ indicates that the soil has some features that are favorable for the specified use and some that are unfavorable. The limitations listed can be overcome or minimized by special planning, design, or installation. Fair or poor performance and moderate or high maintenance can be expected, depending on the number of limitations and the severity of each limitation.\r\n\r\nNumerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\nâ€œPond reservoir areasâ€ hold water behind a dam or embankment. Soils best suited to this use have low seepage potential in the upper 60 inches. The seepage potential is determined by the saturated hydraulic conductivity (Ksat) of the soil and the depth to fractured bedrock or other permeable material. Excessive slope can affect the storage capacity of the reservoir area.\r\n\r\nâ€œEmbankments, dikes, and leveesâ€ are raised structures of soil material, generally less than 20 feet high, constructed to impound water or to protect land against overflow. Embankments that have zoned construction (core and shell) are not considered. In this table, the soils are rated as a source of material for embankment fill. The ratings apply to the soil material below the surface layer to a depth of about 5 feet. It is assumed that soil layers will be uniformly mixed and compacted during construction.\r\n\r\nThe ratings do not indicate the ability of the natural soil to support an embankment. Soil properties to a depth even greater than the height of the embankment can affect performance and safety of the embankment. Generally, deeper onsite investigation is needed to determine these properties.\r\n\r\nSoil material in embankments must be resistant to seepage, piping, and erosion and have favorable compaction characteristics. Unfavorable features include less than 5 feet of suitable material and a high content of stones or boulders, organic matter, or salts or sodium. A high water table affects the amount of usable material. It also affects trafficability.\r\n\r\nâ€œAquifer-fed excavated pondsâ€ are pits or dugouts that extend to a ground-water aquifer or to a depth below a permanent water table. Excluded are ponds that are fed only by surface runoff and embankment ponds that impound water 3 feet or more above the original surface. Excavated ponds are affected by depth to a permanent water table, Ksat of the aquifer, and quality of the water as inferred from the salinity of the soil. Depth to bedrock and the content of large stones affect the ease of excavation.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1014, NULL, E'Sewage Disposal (CA)', E'Sewage Disposal (CA)', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the limitation.  The table shows only the top limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 2 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'This table shows the degree and kind of soil limitations that affect septic tank absorption fields and sewage lagoons. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect these uses. "No limitations" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. â€œLimitationsâ€ indicates that the soil has some features that are favorable for the specified use and some that are unfavorable. The table identifies only the most significant limitations for any given soil. The limitations listed can be overcome or minimized by special planning, design, or installation. Fair or poor performance and moderate or high maintenance can be expected, depending on the number of limitations and the severity of each limitation. \r\n\r\nNumerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\nâ€œSeptic tank absorption fieldsâ€ are areas in which effluent from a septic tank is distributed into the soil through subsurface tiles or perforated pipe. Only that part of the soil between depths of 24 and 60 inches is evaluated. The ratings are based on the soil properties that affect absorption of the effluent, construction and maintenance of the system, and public health. Saturated hydraulic conductivity (Ksat), depth to a water table, ponding, depth to bedrock or a cemented pan, and flooding affect absorption of the effluent. Stones and boulders, ice, and bedrock or a cemented pan interfere with installation. Subsidence interferes with installation and maintenance. Excessive slope may cause lateral seepage and surfacing of the effluent in downslope areas.\r\n\r\nSome soils are underlain by loose sand and gravel or fractured bedrock at a depth of less than 4 feet below the distribution lines. In these soils the absorption field may not adequately filter the effluent, particularly when the system is new. As a result, the ground water may become contaminated.\r\n\r\nâ€œSewage lagoonsâ€ are shallow ponds constructed to hold sewage while aerobic bacteria decompose the solid and liquid wastes. Lagoons should have a nearly level floor surrounded by cut slopes or embankments of compacted soil. Nearly impervious soil material for the lagoon floor and sides is required to minimize seepage and contamination of ground water. Considered in the ratings are slope, Ksat, depth to a water table, ponding, depth to bedrock or a cemented pan, flooding, large stones, and content of organic matter.\r\n\r\nKsat is a critical property affecting the suitability for sewage lagoons. Most porous soils eventually become sealed when they are used as sites for sewage lagoons. Until sealing occurs, however, the hazard of pollution is severe. Soils that have a Ksat rate of more than 14 um per second are too porous for the proper functioning of sewage lagoons. In these soils, seepage of the effluent can result in contamination of the ground water. Ground-water contamination also is a hazard if fractured bedrock is within a depth of 40 inches, if the water table is high enough to raise the level of sewage in the lagoon, or if floodwater overtops the lagoon.\r\n\r\nA high content of organic matter is detrimental to proper functioning of the lagoon because it inhibits aerobic activity. Slope, bedrock, and cemented pans can cause construction problems, and large stones can hinder compaction of the lagoon floor. If the lagoon is to be uniformly deep throughout, the slope must be gentle enough and the soil material must be thick enough over bedrock or a cemented pan to make land smoothing practical.');
INSERT INTO "SYSTEM - Soil Reports" ("Report Key", "Report Sequence", "Report Name", "Report Title", "Report Header Text", "Access Report Name", "Parameters Required", "Maximum Number of Parameters", "Access Parameter Form Name", "Report Parameters Parameter", "Include Report", "Map Unit Selection Required", "Report Documentation") VALUES (1015, NULL, E'Landfills (CA)', E'Landfills (CA)', E'The information in this table indicates the dominant soil condition but does not eliminate the need for onsite investigation.  The numbers in the value columns range from 0.01 to 1.00.  The larger the value, the greater the limitation.  The table shows only the top limitations for any given soil.  The soil may have additional limitations', E'Template Interpretation Report - 3 Interpretations', E'0', NULL, NULL, NULL, E'1', E'1', E'This table shows the degree and kind of soil limitations that affect sanitary landfills and daily cover for landfill. The ratings are both verbal and numerical. Rating class terms indicate the extent to which the soils are limited by all of the soil features that affect these uses."No limitations" indicates that the soil has features that are very favorable for the specified use. Good performance and very low maintenance can be expected. â€œLimitationsâ€ indicates that the soil has some features that are favorable for the specified use and some that are unfavorable. This table identifies only the most significant limitations for any given soil. The limitations listed can be overcome or minimized by special planning, design, or installation. Fair or poor performance and moderate or high maintenance can be expected, depending on the number of limitations and the severity of each limitation.\r\n\r\nNumerical ratings in the table indicate the severity of individual limitations. The ratings are shown as decimal fractions ranging from 0.01 to 1.00. They indicate gradations between the point at which a soil feature has the greatest negative impact on the use (1.00) and the point at which the soil feature is not a limitation (0.00).\r\n\r\nA â€œtrench sanitary landfillâ€ is an area where solid waste is placed in successive layers in an excavated trench. The waste is spread, compacted, and covered daily with a thin layer of soil excavated at the site. When the trench is full, a final cover of soil material at least 2 feet thick is placed over the landfill. The ratings in the table are based on the soil properties that affect the risk of pollution, the ease of excavation, trafficability, and revegetation. These properties include saturated hydraulic conductivity (Ksat), depth to bedrock or a cemented pan, depth to a water table, ponding, slope, flooding, texture, stones and boulders, highly organic layers, soil reaction, and content of salts and sodium. Unless otherwise stated, the ratings apply only to that part of the soil within a depth of about 6 feet. For deeper trenches, onsite investigation may be needed.\r\n\r\nHard, nonrippable bedrock, creviced bedrock, or highly permeable strata in or directly below the proposed trench bottom can affect the ease of excavation and the hazard of ground-water pollution. Slope affects construction of the trenches and the movement of surface water around the landfill. It also affects the construction and performance of roads in areas of the landfill.\r\n\r\nSoil texture and consistence affect the ease with which the trench is dug and the ease with which the soil can be used as daily or final cover. They determine the workability of the soil when dry and when wet. Soils that are plastic and sticky when wet are difficult to excavate, grade, or compact and are difficult to place as a uniformly thick cover over a layer of refuse.\r\n\r\nThe soil material used as the final cover for a trench landfill should be suitable for plants. It should not have excess sodium or salts and should not be too acid. The surface layer generally has the best workability, the highest content of organic matter, and the best potential for plants. Material from the surface layer should be stockpiled for use as the final cover.\r\n\r\nIn an â€œarea sanitary landfill,â€ solid waste is placed in successive layers on the surface of the soil. The waste is spread, compacted, and covered daily with a thin layer of soil from a source away from the site. A final cover of soil material at least 2 feet thick is placed over the completed landfill. The ratings in the table are based on the soil properties that affect trafficability and the risk of pollution. These properties include flooding, Ksat, depth to a water table, ponding, slope, and depth to bedrock or a cemented pan.\r\n\r\nFlooding is a serious problem because it can result in pollution in areas downstream from the landfill. If Ksat is too rapid or if fractured bedrock, a fractured cemented pan, or the water table is close to the surface, the leachate can contaminate the water supply. Slope is a consideration because of the extra grading required to maintain roads in the steeper areas of the landfill. Also, leachate may flow along the surface of the soils in the steeper areas and cause difficult seepage problems.\r\n\r\nâ€œDaily cover for landfillâ€ is the soil material that is used to cover compacted solid waste in an area sanitary landfill. The soil material is obtained offsite, transported to the landfill, and spread over the waste. The ratings in the table also apply to the final cover for a landfill. They are based on the soil properties that affect workability, the ease of digging, and the ease of moving and spreading the material over the refuse daily during wet and dry periods. These properties include soil texture, depth to a water table, ponding, rock fragments, slope, depth to bedrock or a cemented pan, reaction, and content of salts, sodium, or lime.\r\n\r\nLoamy or silty soils that are free of large stones and excess gravel are the best cover for a landfill. Clayey soils may be sticky and difficult to spread; sandy soils are subject to wind erosion.\r\n\r\nSlope affects the ease of excavation and of moving the cover material. Also, it can influence runoff, erosion, and reclamation of the borrow area. \r\n\r\nAfter soil material has been removed, the soil material remaining in the borrow area must be thick enough over bedrock, a cemented pan, or the water table to permit revegetation. The soil material used as the final cover for a landfill should be suitable for plants. It should not have excess sodium, salts, or lime and should not be too acid.\r\n\r\nInformation in this table is intended for land use planning, for evaluating land use alternatives, and for planning site investigations prior to design and construction. The information, however, has limitations. For example, estimates and other data generally apply only to that part of the soil between the surface and a depth of 5 to 7 feet. Because of the map scale, small areas of different soils may be included within the mapped areas of a specific soil.\r\n\r\nThe information is not site specific and does not eliminate the need for onsite investigation of the soils or for testing and analysis by personnel experienced in the design and construction of engineering works.\r\n\r\nGovernment ordinances and regulations that restrict certain land uses or impose specific design criteria were not considered in preparing the information in this table. Local ordinances and regulations should be considered in planning, in site selection, and in design.');
