INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'Accessing an External Soil Database', 3, NULL, E'The Access External Soil Database functions allow you to either import data contained in an external template soil database, or attach to the tables in an external template soil database.  The main reason you might want to import from an external soil database is that you have downloaded an updated template database, and now you want to import the soil survey data that resides in the older template database you had been using.\r\n\r\nThere are fewer reasons to attach to the tables in another template soil database.  When you attach to the soil tables in another template soil database, the existing soil tables in this template database are first dropped and then replaced with references to the soil tables in the external template database.  We originally provided the attach capability as a way for a person to be able to generate FSA-CRP data (See the section titled â€œFSA-CRP Data Generationâ€ for more information.) without having to bring their existing soil survey area data into the updated template database.  There may be other scenarios where attaching is favored over importing, but in general, importing is likely preferable.  Note however that, with a couple of exceptions discussed in the section about â€œimport and attach caveatsâ€, most functions that run against local tables also work with attached tables.\r\n\r\nAttaching to soil data tables in an external template database, or importing data from an external template database, is accomplished by running the macro named â€œAccess External Soil Databaseâ€.  This macro displays a form with one data entry blank, and three buttons: Import, Attach and Cancel.  In the blank, you enter the fully qualified pathname of the external template database you wish to access, e.g. â€œD:\\soils\\data\\NE079.mdbâ€.  After entering the external template database pathname, click the appropriate button.\r\n\r\nThe Import button attempts to import ALL soil data that resides in the external template database.\r\n\r\nThe Attach button attempts to attach to the soil data tables that reside in the external template database.\r\n\r\nThe Cancel button simply closes the form without attempting to import or attach.\r\n\r\nWhen importing from or attaching to the tables in an external template database, the following checks are always made.  If any of these checks fail, the import or attach process is aborted.\r\n\r\n1.  The external database format (corresponding MS Jet engine version) must be compatible with that of the local database.  The local database is the database where you are running the import or attach process.  For example, an Access 97 database cannot import data from an Access 2002 database.\r\n\r\n2.  The external template database must contain the soil data tables.\r\n\r\n3.  The soil data tables in the external template database must be local to that database, i.e. they cannot be attached tables themselves.\r\n\r\nBelow are some caveats pertaining to the Import and Attach functions.\r\n\r\nYou can import data from an external template database into a database that currently contains soil data, but you will be warned that you should probably be importing into a copy of your original, since the import process can fail.  If you attempt to do this, you are given a warning, and an option to either proceed or cancel.\r\n\r\nYou cannot import data from an external template database into a template database whose tables are currently attached tables, as opposed to local tables.  You can however import data from ASCII files into a database whose tables are currently attached tables.\r\n\r\nIf an import operation is not successful, your local database may be left with only partial data for the survey or surveys that were being imported.  Any surveys for which only partial data was imported should be dropped from the local database by running the macro named â€œDrop Soil Survey Areaâ€.  This is why itâ€™s a good idea to know what surveys reside in your database, prior to an import operation.  This is also why if you are importing into a database that already contains soil data, you should import into a copy of that database, rather than the original.\r\n\r\nYou cannot import from the database that you are currently using.\r\n\r\nA SSURGO template database can typically import from any earlier version SSURGO template database, but a SSURGO template database cannot import from a later version SSURGO template database.\r\n\r\nWhen you attempt to attach to soil data tables in an external template database, your local database must not currently contain any soil data.  The reason for this is that in order to attach to tables in an external database, your local tables must be dropped.  As a safety feature, local tables are never dropped, unless they are currently empty.  If you want to delete data from a local database, use the macro named â€œDrop Soil Survey Areaâ€.\r\n\r\nYou cannot use the macro named â€œDrop Soil Survey Areaâ€ to drop soil survey areas from the soil data tables in an attached database.  This is disabled as a safety feature.\r\n\r\nIf an attach operation is not successful, your local database will be left without any soil data tables.  Since we require that your local database be empty prior to any attempt to attach to an external template database, no real harm will have been done.  The worst that can happen is that you may have to go get another copy of the template database to replace the one that was just â€œdestroyedâ€.\r\n\r\nAfter any successful OR FAILED attempt to attach to the soil data tables in an external template database, you can then immediately attempt to attach to the soil data tables in a different external template database.  After a failed attempt to attach to the soil data tables in an external template database, the only function that is still available is the capability to attach to the soil data tables in an external template database.  Most other macros and forms will now fail because one or more required tables are now missing from the local database.\r\n\r\nYou cannot attach to the database that you are currently using.\r\n\r\nA SSURGO template database can only attach to another SSURGO template database of the same SSURGO version.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'Contacting Support', 15, NULL, E'Questions about this database should be directed to the Soils Hotline.  The Soils Hotline, which resides at the National Soil Survey Center in Lincoln Nebraska, is typically staffed from 8:00 AM to 4:30 PM Central Time.\r\n\r\n(402) 437-5378 â€“ Steve Speidel\r\n(402) 437-5379 â€“ Tammy Cheever\r\n\r\ne-mail:  hotline@lin.usda.gov');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'Deleting/Updating Data', 5, NULL, E'All data for one or more soil survey areas can be deleted by running the macro named â€œDrop Soil Survey Areaâ€.  The Drop Soil Survey Area form displays all soil survey areas that currently reside in the database.  To delete all data for one or more soil survey areas, select the soil survey area, or areas, whose data you wish to drop, and then click the button labeled â€œDropâ€.  Multiple contiguous (contiguous in the formâ€™s selection list) soil survey areas can be selected using <Shift>Click, or by clicking and dragging.  Multiple noncontiguous soil survey areas can be selected using <Ctrl>Click.\r\n\r\nThe main reason for dropping data for a soil survey area is the case where your database currently contains data for a particular soil survey area, and you want to update that data from a newer export.  The import process is not currently capable of performing an update, so any existing data for a particular soil survey area must be deleted before updated data for that same soil survey area can be imported.\r\n\r\nThe Drop Soil Survey Area process does not reclaim the space occupied by the deleted data, and if data is dropped and reloaded enough times, the size of the database may become an issue.  Of course an existing database can always be compacted by selecting â€œDatabase Utilities: Compact Databaseâ€ from the Tools menu in MS Access.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'Exporting Data', 6, NULL, E'From time to time the national SSURGO template database is updated.  Existing errors are fixed and new capabilities and reports are added.  The changes associated with each version of the SSURGO template database are documented in the system report titled â€œTemplate Database Change Historyâ€.  Some states distribute a customized version of the national template, and these state custom template databases may also be updated from time to time.\r\n\r\nThere may come a time when you want to replace your current SSURGO database with an updated version.  You may want to transfer your existing SSURGO data from your current database to the updated database.  This can be accomplished in two different ways.  One way is to export data from your current template database and then import that data into the updated template database.  The other way is to use the updated template database to import data directly from your current template database.  This second method is discussed in detail in the section titled â€œAccessing an External Soil Databaseâ€.  The remainder of this section discusses exporting data from an existing template database.\r\n\r\nTo export data from you current SSURGO database, open your database in MS Access, select the Macros tab and then run the macro named â€œExportâ€.  After the export form is displayed, enter the full path of the directory into which the data should be exported.  The directory into which you export your SSURGO data should not contain any data from a previous SSURGO export.  If it does, and you then import from that directory, the import may fail due to encountering partial data from that previous SSURGO export.\r\n\r\nAt the current time, the export process does not let you select the soil survey areas to be exported.  The current export process always exports all soil survey areas that currently reside in the database.  If you want to export only selected soil survey areas, make a copy of you current database, and then from the database copy, drop the survey areas you donâ€™t want to export and then export.  See the section titled â€œDeleting/Updating Dataâ€ for more information on dropping soil survey area data.\r\n\r\nThe export process produces a set of ASCII delimited files in the SSURGO version format of the database from which data is being exported.  This export process does not zip up the individual ASCII delimited files into a single zip file.  Once an export has been produced, that data can then be imported into a different template database by running the Import macro in that database.  See the section titled â€œImporting Dataâ€ for more information about the import process.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'FSA-CRP Data Generation', 14, NULL, E'FSA-CRP data generation produces a file that includes some of the information that the Farm Service Agency uses in determining if a piece of land is eligible for inclusion in the Conservation Reserve Program.  The FSA-CRP data generation functions always process ALL data that currently resides in the template database.  In other words, there is no capability to generate FSA-CRP data for some subset of the data in your database.\r\n\r\nIn the template database, there are two macros associated with this process:\r\n\r\nFSA-CRP â€“ Create Data\r\n\r\nFSA-CRP â€“ Create Data and Export\r\n\r\nMacro â€œFSA-CRP â€“ Create Dataâ€ generates results and writes the results to the table named â€œFSA-CRP Dataâ€, but does not export the contents of that table.  There is no user interaction after this macro is invoked.\r\n\r\nMacro â€œFSA-CRP â€“ Create Data and Exportâ€ generates results, writes the results to the table named â€œSYSTEM â€“ FSA-CRP Dataâ€, and automatically exports the contents of that table to a file named â€œfsacrp.txtâ€.  After this macro is invoked, a form is displayed where you must specify the desired output directory.  There is no option to specify the output file name.  If you want a different output file name, you must rename the file after it is created.\r\n\r\nEach output record represents a map unit that occurs in a particular county.  The attribute values correspond to the dominant component of that map unit, based on percent composition.  If there is a tie for dominant component, the component with the lowest key value (cokey) is arbitrarily selected.\r\n\r\nThe process of determining what county or counties a map unit occurs in is a multi-part process.  If a map unit in a survey area has at least one county record in the Map Unit Area Overlap table (muaoverlap), a record is output for each county corresponding to that map unit.\r\n\r\nIf a map unit has no county record in the Map Unit Area Overlap table, but the corresponding survey area has at least one county record in the Legend Area Overlap table (laoverlap), a record is output for that map unit for each county corresponding to that survey area.\r\n\r\nIf a survey area has no corresponding county record in the Legend Area Overlap table, a record is output for that map unit for each record that the corresponding survey area has in the Survey Area-County Geographic Coincidence table (SYSTEM â€“ Survey Area-County Geographic Coincidence).\r\n\r\nIf a map unit has no county record in the Map Unit Area Overlap table, and the corresponding survey area has no county record in the Legend Area Overlap table, and the corresponding survey area has no record in the Survey Area-County Geographic Coincidence table, NO record for that map unit is output.  If this occurs for any map unit, a warning dialog is displayed at the end of the data generation process.  Map units for which no corresponding county could be determined are logged in the file named â€œSYSTEM â€“ FSA-CRP â€“ Warnings and Rejectsâ€.  If this occurs, this situation should be resolved before you forward your output to the proper recipients.  A quick way to fix this problem is to add the appropriate record or records to the Survey Area-County Geographic Coincidence table.  You should add one record for each county that coincides with the survey area in question.  Before doing this you should probably consult with whoever provided you with the soil data that you are using.\r\n\r\nIt is also possible that no dominant component for a map unit can be determined.  If this occurs for any map unit, a warning dialog is displayed at the end of the data generation process.  Map units for which no dominant component can be determined are also logged to the table named â€œSYSTEM â€“ FSA-CRP â€“ Warnings and Rejectsâ€.  As long as a corresponding county can be determined, such a map unit is output, but the values of all FSA-CRP criteria attributes will be null.  Again, if this occurs, you should probably check with the person who provided you with the soil data that you are using, before you forward your output to the proper recipients.\r\n\r\nThe FSA-CRP data generation process can act on data that resides in the current template database (i.e. local tables), or it can act on data that resides in an external template database (i.e. attached tables).  The reason for this is that we wanted to provide a new template that includes the FSA-CRP data generation functions, but we didnâ€™t want to force data providers to have to re-download data and provide new soil databases.\r\n\r\nThis means that you can obtain a new version of the template that contains the new FSA-CRP data generation functions, and use that template to attach to your existing soil database in order to create the FSA-CRP data.  In order to run the FSA-CRP data generation functions against an attached database, you must first run the macro named â€œAccess External Soil Databaseâ€ to attach to the soil tables in the external template database.  See the section titled â€œAccess External Soil Databaseâ€ in the report titled â€œHow to Understand and Use this Databaseâ€, for more information.\r\n\r\nThis brief overview does not discuss the derivation of any of the FSA-CRP criteria attributes.  If you want more details about the actual derivation of these attributes, please contact the Soils Hotline at the National Soil Survey Center in Lincoln NE.  See the section titled â€œContacting Supportâ€ in the report titled â€œHow to Understand and Use this Databaseâ€.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'General Information', 1, NULL, E'This database was developed in order to facilitate the delivery and use of soil survey data for USDA Natural Resources Conservation Service end-users and cooperators.  This database may be used stand-alone or in conjunction with the Soil Data Viewer application.  The underlying data structure corresponds to the SSURGO version identified in the report named â€œHow to Understand and Use this Databaseâ€.  Although a SSURGO product typically represents both the tabular and spatial aspects of a correlated and published soil survey area, this database may also be used to deliver tabular data for a soil survey area where mapping or updating is still in progress.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'Generating Reports', 4, NULL, E'This database contains an interface for generating a variety of reports.  Reports are divided into two categories, â€œSoil Reportsâ€ and â€œSystem Reportsâ€.  Soil reports present information about a selected soil survey area.  System reports describe the functionality and structure of this template database.  At this time, no descriptions of the individual soil reports are available.  Descriptions of some of the system reports can be found in the section titled â€œSSURGO Metadata Reportsâ€.\r\n\r\nIn order to generate soil reports, select the tab labeled â€œFormsâ€ and then open the form named â€œSoil Reportsâ€.  In order to generate system reports, select the tab labeled â€œFormsâ€ and then open the form named â€œSystem Reportsâ€.  Note that the Soil Reports form has a button for opening the System Reports form, and vice versa.  Both forms may be open at the same time.\r\n\r\nIn order to generate most soil reports, you must first select one or more map units to be included in the report.  If your database contains data for more than one soil survey area, you may first have to select the appropriate soil survey area before selecting map units.  The current soil report interface restricts you to selecting one or more map units for a single soil survey area at a time.  The only soil reports that donâ€™t require you to fist select one or more map units are the Survey Area Metadata and Survey Area Interpretation Descriptions reports.\r\n\r\nAfter you have selected the map units you wish to include in the report, select the soil report you wish to generate.  If the report you selected does not require any parameters, the button on the lower left of the form will have the caption â€œGenerate Reportâ€.  Clicking â€œGenerate Reportâ€ will display the currently selected report in the â€œpreview windowâ€.  If the report you selected requires parameters, the button on the lower left of the form will have the caption â€œSelect Parametersâ€.  Clicking â€œSelect Parametersâ€ will bring up another form, from which you can make your parameter selections.  After making your parameter selection, click the button on the parameter form that is labeled â€œGenerate Reportâ€.\r\n\r\nOnce a report has come up in the preview window, you can browse through the report in the preview window, or actually print the report from the preview window.  When you are finished browsing or printing the report, you can close the preview window by either clicking the â€œXâ€ at the top right of the window or by clicking the menu item at the top of the screen labeled â€œCloseâ€.\r\n\r\nThe System Reports form operates the same as the Soil Reports form except you do not select map units before generating a system report.\r\n\r\nAll report interface forms may be closed by clicking the button labeled â€œExitâ€.\r\n\r\nGenerating a soil report (as opposed to a system report) by selecting the tab labeled â€œReportsâ€ and then opening a specific report should be avoided.  While this wonâ€™t break anything per se, the report that is displayed, if any, will be based on map unit selections that were made at some point in the past.  If the report requires additional parameters, the report will be based on parameter selections that were also made at some point in the past.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'Importing Data', 2, NULL, E'Soil data downloaded from the Soil Data Mart has to be unzipped before it can be used.  The location to which that data is unzipped doesn\'t really matter.  If your system has a zip utility already installed, a zip file can typically be unzipped simply by double clicking on it.  Soil Data Mart zip files are created using WinZip, but any compatible compression utility can be used to unzip an export file.\r\n\r\nExports are packaged by soil survey area, and the soil survey area symbol is embedded in the zipped export file name.  A soil survey area symbol is composed of a two letter state FIPS code followed by a three digit number that distinguishes one soil survey area in a state from another.  For example, the zipped export file for Cherry County, Nebraska would be named "soil_ne031.zip".\r\n\r\nAfter unzipping a file named soil_ne031.zip, in the directory to which you unzipped the file, you are left with a directory/file hierarchy similar to what is shown below.  A top level directory corresponding to the soil survey area is created in order to separate exports that are unzipped to the same directory.\r\n\r\n\\soil_ne031\r\n    \\spatial\r\n    \\tabular (contains the soil tabular data ASCII delimited files)\r\n    readme.txt\r\n    soil_metadata_ne031.txt\r\n    soil_metadata_ne031.xml\r\n    soildb_US_2002.zip (a zipped MS Access SSURGO template database)\r\n\r\nThe last file is only present if you chose to include a SSURGO template database with your download.  The name of this file may vary depending on the state for which you requested a download, and depending on the Microsoft Access version you requested.\r\n\r\nThe soil tabular data cannot be easily used without importing it into a Microsoft Access database.\r\n\r\nIf you requested a Microsoft Access SSURGO template database, the file containing that SSURGO template database must now also be unzipped before it can be used.  If your export request did not include a SSURGO template database, you can always download one from:\r\n\r\nhttp://soildatamart.nrcs.usda.gov/Templates.aspx\r\n\r\nIn order to use a SSURGO template database, an appropriate version of Microsoft Access must be installed on your PC.  In general, the version of Microsoft Access on your PC must be equal to or newer than the version of the SSURGO template database.\r\n\r\nUnzipping soildb_US_2002.zip results in a file named soildb_US_2002.mdb.  This unzipped file is a Microsoft Access database.  Again, the location to which the SSURGO template database is unzipped doesn\'t really matter.\r\n\r\nTo import data into the Microsoft Access database, you must first open the database by double clicking the database file name.  When you first open that database, and it is empty, the Import form is automatically displayed.  If the Import form is not automatically displayed when you open the database, select the Forms tab of the Database window and open the form named "Import".\r\n\r\nIn the blank on the Import form, enter the fully qualified path name of the directory containing the soil tabular data ASCII delimited files whose contents are to be imported, .e.g.\r\n\r\nd:\\temp\\soil_ne031\\tabular\r\n\r\nAfter entering the directory pathname, click "OK" to initiate the import process.  When the import has completed, the Import form will automatically be closed, and the Soil Reports form will be automatically opened.\r\n\r\nIf any problems occur during the import process, a dialog box noting the problem will be displayed.  All problems that occur during the import process are logged in a file named "ssurgodberr.txt".  The file "ssurgodberr.txt" is created in the same directory in which this template database resides.\r\n\r\nData from more than one export may be imported into this database.  Each export has to be imported independently.  A subsequent import cannot contain any data for a soil survey area that already resides in this database, since the current import process is strictly an "add" operation as opposed to a more sophisticated "add/update" operation.  If you attempt to process an export that contains data for a soil survey area that already resides in this database, that import operation will fail.  If you want to update a soil survey area that already resides in a database, you must first drop the existing copy of that soil survey area.  For more information on dropping the data for an existing soil survey area from a database, please see the section titled "Deleting/Updating Data".\r\n\r\nMS Access, despite being the incredibly nifty desktop database it is, should not be confused with a genuine high-end database management system.  You may continue to import soil survey data until the maximum allowable size of an MS Access database is reached (Access 97 - 1 Gigabyte, Access 2000/2002/2003 - 2 Gigabytes).  Of course the larger the MS Access database, the more that performance will degrade.  Performance goes completely south long before maximum database size is reached.\r\n\r\nAs of template database version 29, it is now possible to import spot feature descriptions.  Spot feature descriptions are imported into the featdesc table.  Spot features are considered to be part of the spatial data and are therefore not automatically imported with the tabular data.  Even when spatial data is available, spot feature descriptions may not exist.\r\n\r\nTo import spot feature descriptions, open the form named "Import Feature Descriptions".  In the blank on that form, enter the fully qualified path name of the file containing the spot feature descriptions to be imported.  For a download from the Soil Data Mart, spot feature descriptions, when available, reside in a file in the subdirectory named "spatial".  The prefix of the spot feature description file name will be either "soilst_t" (Shapefile format) or "ssf_t" (ArcInfo Coverage or ArcInfo Interchange format), depending on the format in which the spatial data was exported.  The corresponding soil survey area symbol is also embedded in this file\'s name.  For example, if spot feature descriptions for Cherry County, Nebraska existed, and if the spatial data was requested to be in Shapefile format, the spot feature descriptions would be contained in â€¦\\soil_ne031\\spatial\\soilsf_t_ne031.txt.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'Soil Data Versioning', 7, NULL, E'Prior to establishment of the Soil Data Warehouse, soil data was loosely versioned, at best.  Version was reflected either in a SSURGO archive date, in a NASIS SSURGO exportâ€™s corresponding distribution generation date, or possibly in the soil survey areaâ€™s corresponding export certification date.  Export certification date was not even a required field.\r\n\r\nWith the establishment of the Soil Data Warehouse, soil data is now explicitly and formally versioned.  Version information is now tracked for the following entities:\r\n\r\nSoil Survey Area\r\nSoil Survey Area Tabular Data\r\nSoil Survey Area Spatial Data\r\n\r\nThe Soil Data Warehouse recognizes that fact that, at the present, survey area tabular data is maintained and managed independent of its corresponding spatial data.\r\n\r\nThe Soil Data Warehouse provides the capability to distribute soil survey area tabular data that has no spatial data counterpart.  This is sometimes done for survey areas where mapping or updating is still in progress.  The distribution of soil survey area spatial data without a tabular data counterpart is not permitted.\r\n\r\nWhen data for a soil survey area is checked into the Soil Data Warehouse, and both tabular and spatial data are available, every map unit in the spatial data must have a counterpart in the tabular data.  A map unit is the tabular data is not required to have a spatial counterpart.  This permits both tabular and spatial data to be released before the survey area map is complete.\r\n\r\nFor a survey area for which both spatial and tabular data exist, as long as the set of map unit has not changed, a new spatial version can be created without creating a new tabular version, and vice versa.  In general, tabular data for a soil survey area is updated more frequently than the corresponding spatial data.\r\n\r\nWhenever a new tabular data version for a soil survey area is created, a new overall survey area version is created.\r\n\r\nWhenever a new spatial data version for a soil survey area is created, a new overall survey area version is created.\r\n\r\nA version (survey area or tabular data or spatial data) is characterized by two attributes:\r\n\r\nVersion Number â€“ A sequential integer number.\r\n\r\nVersion Established Date â€“ The date and time when a particular version was established.\r\n\r\nFor example:\r\n\r\n06/30/2003 â€“ Tabular data for survey area CO644 is added to the warehouse.  There is no corresponding spatial data available yet.  No data for this survey area existed in the warehouse before this date.\r\n\r\nCurrent Survey Area Version: 1\r\nCurrent Survey Area Version Established Date: 06/30/2003\r\nCurrent Tabular Data Version: 1\r\nCurrent Tabular Data Version Established Date: 06/30/2003\r\nCurrent Spatial Data Version: none\r\nCurrent Spatial Data Version Established Date: none\r\n\r\n09/15/2003 â€“ Spatial data for survey area CO644 is added to the warehouse.  The corresponding tabular data is not updated.  The underlying set of map units for survey area CO644 has not changed.\r\n\r\nCurrent Survey Area Version: 2\r\nCurrent Survey Area Version Established Date: 09/15/2003\r\nCurrent Tabular Data Version: 1\r\nCurrent Tabular Data Version Established Date: 06/30/2003\r\nCurrent Spatial Data Version: 1\r\nCurrent Spatial Data Version Established Date: 09/15/2003\r\n\r\n03/09/2004 â€“ Tabular data for survey area CO644 is updated in the warehouse.  The corresponding spatial data is not updated.  The underlying set of map units for survey area CO644 has not changed.\r\n\r\nCurrent Survey Area Version: 3\r\nCurrent Survey Area Version Established Date: 03/09/2004\r\nCurrent Tabular Data Version: 2\r\nCurrent Tabular Data Version Established Date: 03/09/2004\r\nCurrent Spatial Data Version: 1\r\nCurrent Spatial Data Version Established Date: 09/15/2003\r\n\r\nThe older retired versions for survey area CO644 are still available in the Soil Data Warehouse.\r\n\r\nHow do you know the version of the data you are using, and how do you know if you have the most current version?\r\n\r\nFor each survey area currently in the database, survey area version and tabular data version is available in the table named â€œsacatalogâ€.  Also, every soil report displays the survey area version of the data in that report, in the page footer of each page in the report.\r\n\r\nIn order to determine if you have the most current version of data for a soil survey area, you have to first access the Soil Data Mart using your web browser:\r\n\r\nhttp://soildatamart.nrcs.usda.gov/\r\n\r\nNavigate and make the selections required to find the soil survey area of concern, and then click the button labeled â€œDownload Dataâ€.  The Soil Data Mart Download page displays the most current survey area version and tabular data version that is available for a survey area, near the top of the page.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'SSURGO Metadata Change History', 10, NULL, E'2.2.2 - 09/01/2006\r\nItem:  Synchronized with NASIS data dictionary 5.3.2.  There were some domain changes and additions.\r\n\r\n2.2.1 - 10/11/2005\r\nItem:  For survey area data committed to the Soil Data Warehouse prior to July 11, 2005, columns component.geomdesc and cogeomordesc.geomfname contained geomorphic feature names in singular form.  For survey area data committed to the Soil Data Warehouse on or after July 11, 2005, these columns now contain geomorphic feature names in plural form.  The definition of column cogeomordesc.geomfname was updated to reflect this change.  The definition of column component.geomdesc didn\'t specifically mention geomorphic feature names being in singular form, so that definition was not updated.\r\n\r\nItem:  Soil Data Viewer related tables "month", "sdvalgorithm", "sdvattribute", "sdvfolder" and "sdvfolderattribute" were added.\r\n\r\nItem:  For data in shape file format, point feature class data (point spot features and point map units) is now provided in single point format rather than in multipoint format.\r\n\r\nItem:  Synchronized with NASIS data dictionary 5.3.1.  There were some domain changes and additions.\r\n\r\nItem:  The field size of a number of SSURGO metadata table attributes was increased.\r\n\r\n2.1.1 - 10/03/2003\r\nItem:  For the survey area boundary feature class, column "ssaid" was renamed to "areasymbol".  Column "areasymbol" was added to all other feature classes.\r\n\r\nItem:  For the spot feature line and spot feature point feature classes, column "musym" was renamed to "featsym".\r\n\r\nItem:  Survey area spatial data is now explicitly versioned.  A spatial version number column was added to all feature classes.\r\n\r\nItem:  Survey area data now potentially includes two new feature classes, point map units and line map units.  For any particular survey area, these feature classes are optional.\r\n\r\nItem:  The delivery format of the feature description ASCII export file (featdesc.txt), is no longer Prelude format (a format associated with SSURGO version 1.0).  The format of this file is now the same as the format used for general tabular data files - ASCII, pipe field delimited and double quote text delimited.\r\n\r\nItem:  Table "featdesc" was added.  Feature description data was available in previous SSURGO versions, but there was no corresponding database table.  While feature description data is considered to be part of the spatial data, the feature description data does not include any ESRI geometry column, i.e. the feature description data is not a feature class.  Data for this table is not automatically imported when other tabular data is imported.  Data for this table must be explicitly imported in a separate process.\r\n\r\nItem:  Tables "sacatalog" and "sainterp" were added.  These tables supersede tables "distmd", "distlegendmd" and "distinterpmd".  Tables "distmd", "distlegendmd" and "distinterpmd" were left in the template database for backwards compatibility with SSURGO 2.0 exports, and SSURGO 2.1 exports include data for these tables.  These tables will likely be dropped in the next major SSURGO version.\r\n\r\nItem:  Survey area tabular data is now explicitly versioned.  The tabular version number and corresponding date reside in table "sacatalog".\r\n\r\nItem:  Synchronized with NASIS data dictionary 5.2.4.  There were some domain changes and additions.\r\n\r\nItem:  Columns mapunit.mustatus and muaggatt.mustatus were changed from not null to nullable.\r\n\r\nItem:  The following columns are still part of the SSURGO standard, but their contents will always be set to null.  These columns will likely be dropped in the next major SSURGO version:\r\n\r\nlegend.ssastatus\r\nlegend.legendsuituse\r\nlegend.legendcertstat\r\nmapunit.mustatus\r\nmapunit.mucertstat\r\nmuaggatt.mustatus\r\n\r\nItem:  Within a soil survey area, map unit symbol must now be unique.\r\n\r\nItem:  The field size of columns mdstattabcols.colphyname and mdstatidxdet.colphyname was changed from 16 to 18.\r\n\r\n2.0.3 - 04/23/2002\r\nItem:  Resynchronized with NASIS data dictionary 5.1.3.  There were some domain changes and additions.\r\n\r\nItem:  The fuzzy logic result values (interpll, interplr, interphr and interphh) in table cointerp were changed from not null to nullable.\r\n\r\nItem:  The field size of coecoclass.ecoclasstypename was changed from 254 to 60.\r\n\r\nItem:  The field size of coecoclass.ecoclassid was changed from 248 to 30.\r\n\r\nItem:  The data type of coforprod.fprod and coforprodo.fprod was changed from integer to smallfloat, and its precision was set to 2.\r\n\r\n2.0.2 - 09/12/2001\r\nItem:  Resynchronized with NASIS data dictionary 5.0.17.  There were some domain changes and additions, and some attribute descriptions were updated.\r\n\r\n2.0.1 - Approximately 01/01/2001\r\nInitial release of version 2.0 of the SSURGO standard.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'SSURGO Metadata Reports', 11, NULL, E'The SSURGO metadata is independent of what soil survey data currently resides in the database.  Note that the SSURGO metadata only describes those tables that are considered part of the SSURGO standard.  This database contains additional tables that are not part of the SSURGO standard per se.  The name of a table that is not part of the SSURGO standard always begins with â€œSYSTEM â€“ â€œ.\r\n\r\nBelow is a brief description of each SSURGO metadata report.\r\n\r\nNote that these reports are accessed via the System Reports form, rather than the Soil Reports form.\r\n\r\nSSURGO Metadata â€“ Tables\r\n\r\nThis report provides a narrative description of each table in the SSURGO standard.\r\n\r\nSSURGO Metadata - Table Columns\r\n\r\nThis report lists the columns of each table in the SSURGO standard.  This is the source for column name, logical data type, field size, precision, minimum, maximum and associated domain name, if any.\r\n\r\nSSURGO Metadata - Table Column Descriptions\r\n\r\nThis report provides a narrative description of every column in every table in the SSURGO standard.\r\n\r\nSSURGO Metadata - Indexes\r\n\r\nThis report documents all unique and duplicate indexes defined for tables in the SSURGO standard.  What unique constraints (unique indexes) are defined is of primary interest.  In the SSURGO standard, relatively few business oriented unique constraints are defined.  Most of the unique constraints represent non-business oriented unique constraints (i.e. surrogate keys).\r\n\r\nSSURGO Metadata â€“ Relationships\r\n\r\nThis report documents all relationships between tables in the SSURGO standard.  This information is important for understanding the relationship between various soil attributes and entities.  This information is needed in order to be able to effectively query the database.  This is the same type of information that is typically available in a physical data model diagram.\r\n\r\nSSURGO Metadata â€“ Domains\r\n\r\nThis report documents all domains associated with columns of tables in the SSURGO standard.  If a column is associated with a domain, that relationship will be documented in the report titled â€œSSURGO Metadata â€“ Table Columnsâ€.  A particular column may be associated with one and only one domain, but a particular domain may be associated with more than one column.  This report displays all possible members of a domain.  For some domain members, an additional narrative description is sometimes available.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'SSURGO Metadata Version', 9, E'2.2.2', E'The SSURGO metadata version is the combination of the SSURGO major and minor version (e.g. 2.1), with an appended metadata version (e.g. 2.1.2).  The SSURGO metadata version is always reset to 1 for a new SSURGO major and minor version.\r\n\r\nWhile the underlying database structure (data model) for a given version of SSURGO is theoretically static, the metadata associated with a version of SSURGO may still change.  New choices may be added to a domain.  The wording of a choice in a domain may be updated.  Things that lacked a description may eventually be described, and existing descriptions may be updated.  Using a template database with an outdated version of the SSURGO metadata will not prevent data from importing correctly.  If you use a template database version with an outdated version of the SSURGO metadata, you may see entries in choice columns that are not documented in your outdated metadata.\r\n\r\nFor a particular SSURGO major and minor version, we try to not make any changes that affect the corresponding database schema, but despite our best intentions, minor structural changes are sometimes made, without updating the major or minor SSURGO version.  But whenever the underlying database structure is modified, or some non-structural metadata change is made, the corresponding SSURGO metadata version is incremented, e.g. 2.1.1 to 2.1.2.  The section titled â€œSSURGO Metadata Change Historyâ€ documents changes to the SSURGO standard itself.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'SSURGO Version', 8, E'2.2', E'The SSURGO version defines the underlying data structure of the soil data tables, i.e. which tables and columns are defined, and the relationships between tables.  In more technical terms, the SSURGO version is equivalent to the underlying data model.  SSURGO also encompasses the format of the spatial data portion of the soil survey area data.\r\n\r\nNot all of the tables in this SSURGO template database are included in the SSURGO standard.  Tables whose name begins with the string â€œSYSTEMâ€œ are not part of the SSURGO standard.  These tables support special functions only available in this particular delivery implementation.\r\n\r\nSee the section titled â€œSSURGO Metadata Change Historyâ€ for additional details.\r\n\r\nSSURGO 2.2\r\n\r\nThis version of SSURGO, released towards the end of 2005, coincided with the release of Soil Data Viewer 5.0.  The tables that drive the Soil Data Viewer application were added to the database.  When data for a survey area is exported from the Soil Data Mart, the corresponding data needed to drive the Soil Data Viewer application is also exported as the same time.  When data for a survey area is imported into a SSURGO template database, the corresponding Soil Data Viewer driver data is also imported at the same time.\r\n\r\nSSURGO 2.1\r\n\r\nThis version of SSURGO, released towards the end of 2003, coincided with the establishment of the Soil Data Warehouse and Soil Data Mart.  Up to this point, SSURGO data was obtained either from the SSURGO website, or SSURGO tabular data could be obtained directly from NASIS itself.  From this point on, SSURGO data should be obtained from the Soil Data Mart website.\r\n\r\nIn version 2.1, there were minor changes to both the tabular and spatial portions of the SSURGO standard.  Spatial data is no longer available in Modified Digital Line Graph 3 format.  Coordinate system/projection is no longer fixed, however there are a limited number of coordinate system/projection options.\r\n\r\nSSURGO 2.0\r\n\r\nIn this version of SSURGO, released in early 2001, the structure of the tabular data reflected the structure of the National Soil Information System Database (NASIS).  The structure of the spatial data was still that of SSURGO 1.0.  The SSURGO tabular data could now be loaded into an MS Access SSURGO template database.  Spatial data was now available in ArcView Shape File format.  Soil data in SSURGO 2.0 format provided the foundation for the Soil Data Viewer application.\r\n\r\nSSURGO 1.0\r\n\r\nIn the original version of SSURGO, the structure of the tabular data reflected the structure of the State Soil Survey Database (SSSD), the predecessor of NASIS (National Soil Information System).  There was no corresponding MS Access SSURGO template database.  Spatial data was available as an Arc/Info Coverage, as an Arc/Info Export File or in Modified Digital Line Graph 3 format.  Coordinate system/projection was fixed.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'Template Database Change History', 999, NULL, E'33 - 10/17/2006\r\nItem:  The template database was synchronized with NASIS data dictionary 5.3.2.  A number of additions and updates were made to existing domains.  The embedded data in the static metadata tables in a SSURGO template database was updated.  The corresponding SSURGO Static Metadata Version was updated to 2.2.2.  The "SSURGO Metadata Change History" section of report "How to Understand and Use this Database" was updated.\r\n\r\nItem:  Report "Brief Map Unit Description" was renamed "Map Unit Description (Brief)".\r\n\r\nItem:  Report "Map Unit Description (Brief, Generated)" was added.\r\n\r\nItem:  Since the forestry soil interpretations were updated to be able to return "Not rated", like all other soil interpretations, since the last template database version, the same interp report templates and rating class name/rating value formatting logic is now used for all soil interpretation reports.  Prior to this change, the overall rating for miscellaneous area components in a forestry soil interpretation report was automatically set to "Not rated".  All interp report and subreport templates whose name ended with " - Old" were dropped.  The function named "FormattedInterpReasonOld" in the module named "Report Functions" was dropped.\r\n\r\nItem:  The function named "FormattedInterpReason" in the module named "Report Functions" was updated to use the same logic that is currently used in NASIS soil interpretation reports, in order to display consistent results for the same data in both NASIS and a SSURGO template database.  A similar change was recently made in the Soil Data Mart.\r\n\r\nItem:  Descriptions were added for the following reports:\r\nAcreage and Proportionate Extent of the Soils\r\nAcreage and Proportionate Extent of the Soils by County\r\nComponent Legend\r\nComponent Text\r\nMap Unit Description (Brief)\r\nMap Unit Legend\r\nMap Unit Text\r\nRUSLE2 Related Attributes\r\nSelected Soil Interpretations\r\nSelected Survey Area Interpretation Descriptions\r\nSurvey Area Data Summary\r\n\r\nItem:  Function GetInterpReasons() was added.  This function returns a comma delimited list of the reasons for the corresponding overall interpretation result.  How many reasons should be included in the list is a parameter.\r\n\r\nItem:  The font size of the narrative text in the following reports was changed from 8 point to 10 point:\r\nComponent Text\r\nMap Unit Description (Brief)\r\nMap Unit Description (Brief, Generated)\r\nMap Unit Text\r\n\r\nItem:  The template database change history was updated.\r\n\r\n32 - 10/11/2005\r\n06/12/2006 Item:  The unique constraint on column resultcolumnname was dropped for tables "sdvattribute" and "SYSTEM - sdvattribute".  We had dropped this constraint in the information system used to input and manage SDV rules, but had forgotten to also drop this constraint in the SSURGO template database.\r\n\r\nItem:  The contents of tables "SYSTEM - Geomorphic Feature Type" and "SYSTEM - Geomorphic Feature" were updated on 07/27/2005.\r\n\r\nItem:  The following sections in report "How to Understand and Use this Database" were updated:\r\nGeneral Information\r\nAccessing an External Soil Database\r\nExporting Data\r\nSoil Data Versioning\r\nSSURGO Version\r\nSSURGO Metadata Change History\r\nContacting Support\r\n\r\nItem:  The SSURGO version was changed to 2.2, and the SSURGO metadata version was changed to 2.2.1.  SSURGO version 2.2 now includes five new Soil Data Viewer related tables: "month", "sdvalgorithm", "sdvattribute", "sdvfolder" and "sdvfolderattribute".  Soil Data Viewer related data will now be included in a SSURGO 2.2 export.  The following functions have been updated to account for this change:\r\nImport from ASCII delimited files.\r\nExport to ASCII delimited files.\r\nImport from the tables in an external SSURGO template database.\r\nAttach to the tables in an external SSURGO template database.\r\n\r\nItem:  The version check made before importing data from ASCII files was modified to allow the import of any data in SSURGO 2.x format.  This means that the major version number is effectively redefined to mean that the only difference between subsequent subversions of the same major version is that data for additional tables may be provided.\r\n\r\nItem:  The function to create data for WinPst was altered to set the high water table flag (water table depth to top less than or equal to two feet) only for apparent water tables.  Previously it was setting this flag for both perched and apparent water tables.\r\n\r\nItem:  The following slew of report and report parameter related changes were made:\r\n\r\nReport "Wind Erosion Prediction System Related Attributes" was added.\r\n\r\nIn the older paradigm interpretation reports, the phrase "Not Rated" was changed to "Not rated".\r\n\r\nFor both Rangeland Productivity reports, the Range Production column headings and units are now centered rather than right justified.\r\n\r\nIn report "Rangeland Productivity and Plant Composition", the line gap in the legend control break heading was closed.\r\n\r\nAny disclaimer about a report including only major components now appears in the report\'s header text rather than in the report\'s page footer.\r\n\r\nReport "Nontechnical Descriptions" was renamed to "Brief Map Unit Description".  Other aspects of this report and its related parameter form were updated in order to be consistent.\r\n\r\nReport "Prime and other Important Farmlands" was renamed to "Prime and Other Important Farmlands".\r\n\r\nThe phrase "(includes Land Capability Classification)" was added to the end of the report name (but not the report title) of all crop yield reports.\r\n\r\nAll existing report narrative descriptions (aka "prewritten materials") were updated.\r\n\r\nAll report titles were moved back to the page header section of the report.  For some reports with variable length titles that could require more than one line, the report title had been moved to the legend group header.  When a person requested to include the description in such a report, no report title appeared on any of the pages containing the report description.\r\n\r\nThe Hydric Soils report was modified to always include the corresponding report description, regardless of whether or not the user requested it.  The report footer, which contains the report description, was also changed to start on a new page.  The part of the report description containing the hydric criteria codes always needed to be visible anyway.\r\n\r\nThe form title for all report parameter forms was shortened to something like "Select whatever".  I hadn\'t noticed that most of the previous form titles were being severely truncated.\r\n\r\nIn all report header text, the phrase "The table shows only the top five limitations for any given soil." was changed to "The columns that identify the rating class and limiting features show no more than five limitations for any given soil.".\r\n\r\nIn report "Water Features", column heading "Month" was changed to "Months" and column heading "Surface depth" was changed to "Surface water depth".\r\n\r\nIn report "Source of Sand and Gravel", all instances of column heading "Rating class and limiting features" were changed to "Rating class".\r\n\r\nIn report "Windbreaks and Environmental Plantings", the phrase "on the soil" was added to the end of the existing report header text.\r\n\r\nIn report "Engineering Properties", in the USDA Texture column, every texture phrase following the first is now in lower case.\r\n\r\nIn report "Taxonomic Classification of the Soils" the report header text now includes the phrase about taxadjuncts only when the corresponding report include one or more taxadjuncts.\r\n\r\nIn report "Rangeland Productivity and Plant Composition", all instances of unit of measure abbreviation "Lb/Ac" were changed to "Lb/ac".\r\n\r\nIn report "Brief Map Unit Description" a text category group header section was added.  In reports "Component Text" and "Map Unit Text", a text kind/text category group header section was added.  This was done so that the text kind and category information would be repeated across a page break that occurs in the middle of a text entry.\r\n\r\nIn the report parameter form for selecting soil interpretations, the source query was changed to no longer include "class" type soil interpretations.  Such an interpretation should never appear in a traditional soil interpretation report.\r\n\r\nFor any report that requires one or more map units to be selected prior to report generation, when such a report requires that additional parameters be selected at run time, that list of parameters will now be constrained by which map units are currently selected.  This change affects the following reports:\r\nAll 3 component crop yield reports.\r\nAll 3 map unit crop yield reports.\r\nComponent Text\r\nMap Unit Text\r\nBrief Map Unit Description\r\n\r\nThe list of crop parameters for a crop yield report is now sensitive to whether the corresponding report includes only irrigated yields, includes only nonirrigated yields or includes both irrigated and nonirrigated yields.\r\n\r\nReports now assume that the source of all data is the Soil Data Mart.  All reports and report parameter forms were updated to no longer depend on any of the now obsolete distribution metadata tables.  The following reports, which were based on data in the now obsolete distribution metadata tables, were dropped:\r\nDynamic Metadata - Import Information\r\nDynamic Metadata - Soil Interpretation Descriptions\r\n\r\nReport page footers now display survey area version and date rather than tabular data version and date.\r\n\r\nThe entire scheme for what property "keep together" should be set to, for report sections and groups, was rethought and implemented.  Certain reports were going into infinite loops because the "keep together" property for the group that included the detail section would be set to "with first detail" and the "keep together" property for the detail section would be set to "yes".  The infinite loop occurred when a report encountered data where the detail section for a given record didn\'t fit on a single page.  As far as I\'m concerned, this is an Access bug.  The "keep together" property for a detail section is now set to "yes" only for a few special cases where there is a reason that we don\'t want the detail section to split across a page, and in each of these cases we know that the detail section will always fit on page.\r\n\r\n31 - 08/27/2004\r\nItem:  Reports containing soil component level information, with the exception of the Hydric Soils report, now have the option to either include or exclude minor components.  Note that this option is displayed for all soil reports, regardless of whether or not the option pertains to the report that is currently selected.  Report page footers now indicate when minor components have been excluded from a report.\r\n\r\nNote:  In general, main report queries and subqueries and subreport queries and subqueries include the logic for including/excluding minor components.  I had to remove this logic from the interp rating subquries and interp reason subqueries because performance was severely impacted.  Having this logic in the main report query is generally sufficient.  I had thought that having the same logic in subqueries would improve performance in general.  The problem appears to arise when other conditions exist in the subquery, where each of those conditions has to be duplicated due to the "or" logic required for including/excluding minor components.\r\n\r\nItem:  Column "surface runoff" was added to the Water Features report.  The report end notes were updated to reflect this change.\r\n\r\nItem:  Soil report names in the list of available soil reports are now sorted alphabetically.  Column [System - Soil Reports].[Report Sequence] was left in the database but is no longer used.  This column is no longer required, and its corresponding unique constraint was dropped.\r\n\r\nItem:  The "Importing Data" section of report "How to Understand and Use this Database" was updated.  The instructions displayed in forms "Import" and "Import Feature Descriptions" were modified.\r\n\r\nItem:  The Prime Farmland report was modified and is now known as the Prime and other Important Farmlands report.  In addition to map units representing various kinds of prime farmland, this report now also includes map units whose farmland classification is either "unique farmland", "farmland of statewide importance" or "farmland of local importance".  Report formatting and sorting were changed.\r\n\r\nItem:  For all soil reports, main report names were changed to be consistent with the report names displayed in the soil reports dropdown list.  For all soil reports, also changed reports so that the caption in the report viewer window is consistent with either the name displayed in the soil reports dropdown list, or is consistent with the report title specified by the user at run time (for those few reports whose title can be specified by the user), regardless of what the corresponding MS Access report is currently named.  The report viewer window, by default, displays the MS Access report name, and the MS Access report names had gotten pretty out of sync with the names displayed in the soil reports dropdown list.\r\n\r\nItem:  All soil reports (but not system reports) were modified to always retrieve their title and header text (all or base header text) from the "SYSTEM - Soil Reports" table.  Related function nomenclature and use was standardized.  Functions "GetInterpReportHeaderText" and "GetInterpReportTitle" were superseded by "GetDefaultReportHeaderText" and "GetDefaultReportTitle", respectively, but were left in the database for backwards compatibility in case any state customized databases reference them.\r\n\r\nItem:  The existing constraint on mustatus (map unit status) was removed from the query that provides the input data to the FSA-CRP data generation process ("FSA-CRP - Input").  Since for SSURGO 2.1, mustatus is now always null, this constraint effectively resulted in no input records whatsoever.  Paul Finnell says that the FSA-CRP data generation process is still used to derive certain attributes that are used in contexts other than FSA-CRP.\r\n\r\nItem:  A number of report names, report titles and report descriptions were updated.  The order in which reports are displayed in the report choice list was modified.\r\n\r\nItems:  The agricultural waste management interpretations that were distributed between two reports are now distributed between three reports.\r\n\r\nItem:  An updated Hydric Soils report was added back.\r\n\r\nItem:  Report "Selected Soil Interpretations" was modified so that a user now has complete control over the order in which the selected interpretations occur from left to right.  The user can no longer optionally specify the header text for this report.\r\n\r\nItem:  Report "Survey Area Interpretation Descriptions" was replaced by report "Selected Survey Area Interpretation Descriptions".  Obviously the new report now longer has to include descriptions for all interpretations that were included for a survey area.\r\n\r\nItem:  For reports with variable length titles, the report title was moved from the page header section to the legend group header section.  I had not realized that the page header section could not grow, and some of the new longer report titles were being truncated.  This change was made to the following reports:\r\nComponent Text\r\nMapunit Text\r\nSelected Soil Interpretations\r\nTemplate Interpretation Report - 2 Interpretations\r\nTemplate Interpretation Report - 2 Interpretations - Old\r\nTemplate Interpretation Report - 3 Interpretations\r\nTemplate Interpretation Report - 3 Interpretations - Old\r\n\r\nItem.  The SSURGO metadata change history was updated.  The text associated with SSURGO metadata version 2.1.1 was updated to more accurately describe the changes that occurred at that time.  Please see the section titled "SSURGO Metadata Change History" in the report named "How to Understand and Use this Database" for details.\r\n\r\nItem:  Function "GetLandforms" was modified to only return landforms where the corresponding value of "rvindicator" is "Yes", in order to be consistent with how the updated Hydric Soils report in NASIS is designed.\r\n\r\nItem:  Function "GetHydricCriteria" was modified to no longer return Boolean values indicating if saturation, flooding or ponding criteria were met.  This function now returns a variant rather than a string.\r\n\r\n30 - 02/05/2004\r\nItem:  In the Engineering Properties report, both the Unified and AASHTO columns were displaying the Unified classification.  This problem has been fixed.  The actual error was in report "Subreport - Table H - Engineering Properties".\r\n\r\n29 - 12/02/2003\r\nStarting with this version I\'ve decided to drop the prefix "1." from the template database version because I can\'t explain what the prefix corresponds to.  It seemed like a good idea at the time.\r\n\r\nVersion 29 of the template database is the first version of the template database designed to accommodate exports from the new Soil Data Mart.  Exports from the Soil Data Mart are in SSURGO version 2.1 format.  The difference between the SSURGO 2.0 format and the SSURGO 2.1 format is documented in the section titled "SSURGO Metadata Change History" in the report titled "How to Understand and Use this Database".\r\n\r\nExports from the Soil Data Mart CANNOT be imported into any template database version prior to version 29.  However, ANY pre-Soil Data Mart SSURGO 2.0 export can be imported into this template database version.\r\n\r\nItem:  The template database change history has been removed from the report titled "SYSTEM - Template Database Information".  The template database change history is now available in a SYSTEM report titled "SYSTEM - Template Database Change History".\r\n\r\nItem:  The import, export and drop soil survey area processes were updated to deal with the changes introduced in SSURGO 2.1.\r\n\r\nItem:  The process that imports data from an external database and the process that attaches to the tables in an external database were updated to deal with the changes introduced in SSURGO 2.1.  A SSURGO 2.1 database can import data from either a SSURGO 2.0 or a SSURGO 2.1 database, as long as the two database formats are compatible.  A SSURGO 2.1 database can only attach to the tables in another SSURGO 2.1 database, and again, only when the two database formats are compatible.\r\n\r\nThese import and attach processes were also modified to now verify:\r\n\r\n1.  The external database format is compatible with the local database format.  (i.e. Jet Engine version is compatible.)\r\n2.  The external database contains soil data tables.\r\n3.  The soil data tables in the external database are local to that database.\r\n\r\nItem:  I had written a function named "LegendTableExists" but never actually used it.  I replaced every instance where the code to determine if the legend tables exists was duplicated with a reference to this function.  I also added two new functions, "LegendTableEmpty" and "LegendTableAttached".  These functions are used in the processes for importing data from, and attaching to the tables in, an external soil database.\r\n\r\nItem:  The SSURGO 2.1 standard includes two new dynamic metadata tables, sacatalog and sainterp.  The existing dynamic metadata tables, distmd, distlegendmd and distinterpmd will eventually be dropped from the SSURGO standard, but these tables have been left in the template database for the time being for the purpose of backwards compatibility with the Soil Data Viewer application.\r\n\r\nFor pre-Soil Data Mart exports, to review dynamic metadata, the existing SYSTEM reports "Dynamic Metadata - Import Information" and "Dynamic Metadata - Soil Interpretation Descriptions" should still be used.\r\n\r\nFor post-Soil Data Mart exports, to review dynamic metadata, the new SOIL reports "Survey Area Metadata" and "Survey Area Interpretation Descriptions" should be used.\r\n\r\nI decided that dynamic metadata reports should be considered soil reports rather than system reports, but I left the old dynamic metadata reports as system reports, since that is where users are used to finding them.  Since the new dynamic metadata reports do not require the selection of one or more map units, I added the capability to distinguish between soil reports that do and do not require selected map units.  This resulted in the addition of column "Map Unit Selection Required" to table "System - Soil Reports", and the addition of a new table named "System - Selected Legend Key".\r\n\r\nItem:  This version of the template database accommodates both SSURGO 2.0 and 2.1 exports.  For survey areas exported in SSURGO 2.1 format, soil report page footers now display tabular data version number and tabular data version established date.  For survey areas exported in SSURGO 2.0 format, soil report page footers display tabular data NASIS export date, which is equivalent to the value of distribution generation date from the distribution metadata table.\r\n\r\nItem:  SSURGO version number was dropped from the footers of the two older dynamic metadata reports.\r\n\r\nItem:  The attribute "relationship name" is no longer displayed in report "Static Tabular Metadata - Relationships".\r\n\r\nItem:  Reports "MANU - Table A. Acres" and "MANU - Table A1. Acres by County (2 or 3 counties)" no longer excludes map units whose status is "additional", since map unit status is now null in SSURGO 2.1 exports.\r\n\r\nItem:  Updated the contents of tables "SYSTEM - Geomorphic Feature Type" and "SYSTEM - Geomorphic Feature" on 10/03/2003.\r\n\r\nItem:  Report parameter form "Report Parameters - Soil Interpretations" was updated to obtain the default report title and disclaimer text from the corresponding report record in table "SYSTEM - Soil Reports", rather than being hard-coded.  To accomplish this, two new functions were added, "GetDefaultReportTitle()" and "GetDefaultDisclaimerText()".\r\n\r\nReport parameter forms "Report Parameters - Component Text Kinds & Categories" and "Report Parameters - Mapunit Text Kinds & Categories" were also updated to obtain the default report title from the corresponding report record in table "SYSTEM - Soil Reports", rather than being hard-coded.\r\n\r\nItem:  In all reports having either a map unit or component group header, for the corresponding group header, attribute "Keep Together" was set to "With First Detail".  This should reduce the stray group headers from appearing quite so much.\r\n\r\nItem:  The Selected Soil Interpretation reports now indicate which interpretations are "limitations", and which are "suitabilities", by indicating with asterisks following the interpretation name in the page header.  The meaning of the asterisk or asterisks is defined in the header text on the first page of the report.  A corresponding description appears in the report header only when a corresponding interpretation of that kind is selected for inclusion.  So for numbers in the value column, people will now know when closer to 1 is more limiting, and when closer to 0 is more limiting.\r\n\r\nItem:  The following Template Database Information report sections were renamed as follows:\r\n\r\n"SSURGO Static Metadata Version" was renamed to "SSURGO Metadata Version".\r\n"Static Metadata Change History" was renamed to "SSURGO Metadata Change History".\r\n"Metadata" was renamed to "SSURGO Metadata Reports".\r\n"Template Version" was renamed to "Template Database Version".\r\n"Database Security" was renamed to "Template Database Security/Customization".\r\n\r\nThe sections in the Template Database Information report were reordered.\r\n\r\nAlmost every section in the Template Database Information report was updated.\r\n\r\nItem:  Added new section titled "Soil Data Versioning" to the system report titled "SYSTEM - Template Database Information".\r\n\r\nItem:  The following reports were renamed as follows:\r\n\r\n"Static Tabular Metadata - Domains" was renamed to "SSURGO Metadata - Domains"\r\n"Static Tabular Metadata - Indexes" was renamed to "SSURGO Metadata - Indexes".\r\n"Static Tabular Metadata - Relationships" was renamed to "SSURGO Metadata - Relationships".\r\n"Static Tabular Metadata - Table Column Descriptions" was renamed to "SSURGO Metadata - Table Column Descriptions".\r\n"Static Tabular Metadata - Table Columns" was renamed to "SSURGO Metadata - Table Columns".\r\n"Static Tabular Metadata - Tables" was renamed to "SSURGO Metadata - Tables".\r\n\r\nItem:  The RUSLE Related Attributes report was modified to display Kf rather than Kw.\r\n\r\nItem:  The capability to import soil spot feature descriptions was added.  Feature descriptions are not imported with the tabular data.  Even though the feature descriptions are tabular in nature, they are actually a part of the spatial data associated with a survey area.\r\nNew Macro:  Import Feature Descriptions\r\nNew Form:  Import Feature Descriptions\r\nNew Function:  import_feature_desciptions\r\n\r\nItem: Incorporated as many as possible of the changes that the NSSC editors requested be made to the Soil Data Mart reports, to the template DB soil reports, in order to make the soil reports in the template DB as consistent as possible with the reports in the Soil Data Mart.  The requested changes are too numerous to be listed here.  Most of these changes are listed in the SSURGO Template Database Customization Guide.\r\n\r\nItem:  Soil reports in the template DB no longer display total pages in report page footers due to the delay this causes before the initial page of the report is displayed.\r\n\r\nItem:  For soil reports that have corresponding narrative description, that description can now be optionally included at the end of the report.  A report\'s corresponding descriptions is stored in "SYSTEM - Soil Reports.Report Documentation".  In the Soil Reports form, the button used to include this text is titled "Include Report Description".  This enhancement required the addition of a report footer and an On Open event procedure to all soil reports.  This enhancement also required changes to the code associated with the Soil Reports form.  A new global variable (blnIncludeReportDescription) and several new functions (GetReportDescription, IncludeReportDescription) were added to the module named "Report Functions".\r\n\r\nItem:  Report "SYSTEM - Template Database Change History" was renamed to "Template Database Change History".  Report "SYSTEM - Template Database Information" was renamed to "How to Understand and Use this Database".  Text directing new users to the report titled "How to Understand and Use this Database" was added to the Import and Soil Reports forms.\r\n\r\n1.28 - 3/27/2003\r\nItem:  The logic for formatting ponding frequency class in report "MANU - Table K1 - Water Features" was changed from "=IIf(IsNull([pondfreqcl]),"None",[pondfreqcl])" to "=IIf(IsNull([pondfreqcl]) And IsNull([ponddurcl]),"None",IIf(IsNull([pondfreqcl]) And Not IsNull([ponddurcl]),"---",[pondfreqcl]))".  The previous version of this change was incorrect, and when a user generated report Table K1. - Water Features, they were mistakenly prompted for parameters (the misspelled column names).\r\n\r\n1.27 - 03/11/2003\r\nItem:  The original function designed for joining tabular data to spatial data, getmukey(musym), was not working as intended, and has been fixed.  This function is referenced in query "Sample Soil Polygon Attribute Table Update Query".  Note that we provide two different examples of how to perform the function of joining tabular and spatial data.  The alternative example shown in query "Sample Soil Polygon Attribute Table Alternate Update Query" still works as expected.\r\n\r\nItem:  The logic for formatting ponding frequency class in report "MANU - Table K1 - Water Features" was changed from "=IIf(IsNull([pondfreqcl]),"None",[pondfreqcl])" to "=IIf(IsNull([pondfreqcl]) And IsNull([pnddurcl]),"None",IIf(IsNull([pndfreqcl]) And Not IsNull([pnddurcl]),"---",[pondfreqcl]))".\r\n\r\n1.26 - 11/13/2002\r\nItem:  In report "SYSTEM - Template Database Information, updated section "SSURGO Static Metadata Version" and added new section "Static Metadata Change History".\r\n\r\nItem:  The FSA-CRP data generation function was fixed so that any "order by" on a value returned by function "RV" is handled as a numeric sort rather than a character sort.\r\n\r\nItem:  The following entries were added to table "SYSTEM - Survey Area-County Geographic Coincidence":\r\n\r\nSTCOID  STSSAID\r\nTX141     TX624\r\nTX495     TX615\r\n\r\n1.25 - 10/31/2002\r\nItem:  Fixed error in function that generates FSA-CRP data.  When slope length USLE is populated, value wasn\'t being converted from meters to feet before looking up LS topographic factor.\r\n\r\n1.24 - 10/22/2002\r\nItem:  Added a new report named "MANU - Table WMS-1. Water Management w/fuzzy rating".\r\n\r\nItem:  The reports included in this database no longer modify the case of soil survey area, county or parish, map unit or component names.  The National Soil Survey Center has completed a cleanup of standard soil survey area and county or parish names.  Calculations have been added to NASIS to assist users in establishing map unit and component names in appropriate case.  Therefore, we now assume that soil survey area, country or parish, map unit and component names are already in the case desired by the data steward.  The existing case of soil survey area, county or parish, map unit and component names is also maintained in the user interface.  And last, but not least, the reports included in this database no longer modify the case of taxonomic classification or plant common names, in order to be consistent with the corresponding reports in NASIS.\r\n\r\nItem:  Added FSA-CRP (Farm Service Agency - Conservation Reserve Program) data generation facilities.  For more information on this capability, please see the section titled "FSA-CRP Data Generation" in the report titled "System - Template Database Information".  The following permanent database objects were added:\r\n\r\nTable:  SYSTEM - FSA-CRP Data\r\nTable:  SYSTEM - FSA-CRP - Warnings and Rejects\r\nTable:  SYSTEM - Long Leaf Pine Counties\r\nTable:  SYSTEM - Palouse Soil Survey Areas\r\nTable:  SYSTEM - Survey Area-County Geographic Coincidence\r\nQuery:  FSA-CRP - Input\r\nForm:  FSA-CRP - Create Data and Export\r\nMacro:  FSA-CRP - Create Data\r\nMacro:  FSA-CRP - Create Data and Export\r\nModule:  FSA-CRP Functions (numerous new functions)\r\n\r\nItem:  The form and macro named "Win-Pst - Export" were renamed to "Win-Pst - Create Data and Export", in order to emphasize that Win-Pst data is regenerated as part of this process.\r\n\r\nItem:  Added the ability to either import data from an external Access soil database, or attach to the soil data tables in an external Access soil database.  For more information on these capabilities, please see the section titled "Accessing an External Soil Database" in the report titled "System - Template Database Information".  The following permanent database objects were added:\r\n\r\nForm:  Access External Soil Database\r\nMacro:  Access External Soil Database\r\nModule:  Access External Soil Database Functions (numerous new functions)\r\n\r\nItem:  The original method we recommended for updating the MUKEY column of a soil polygon attribute table sometimes fails for larger soil survey areas.  We haven\'t been able to figure out why this query fails to complete in some cases.  We have included another sample query that uses an alternate method of updating the MUKEY column of a soil polygon attribute table.  The name of this query is "Sample Soil Polygon Attribute Table Alternate Update Query".\r\n\r\nItem:  The National Soil Survey Center in Lincoln NE has decided that, for the time being, national forestry interpretations are not going to be updated to take advantage of the new interpretation generation paradigm that was discussed for template version 1.21.  Therefore all national forestry interpretation reports have been changed back to the older style, where interpretation results for components that represent miscellaneous areas are automatically suppressed.\r\n\r\nItem:  The scrip that runs when the database is opened was modified to determine whether or not map units and/or interpretation results need to be sorted.  Up to this point, this sorting was done anytime that data was imported via the import form, which until now was the only way that data could be loaded into this database.  The soil data mart that is under development will export data directly from the data mart database into the Access SSURGO template database.  Such a process bypasses the existing import processing, and as a result the data imported directly from the data mart is not sorted.  Data that has not been sorted doesn\'t show up in the report interface.  So when the user opens a database that has been populated directly from the data mart, the soil reports user interface is empty.\r\n\r\nThe modified startup script now determines if tables that store the mapunit and interpretation sort results contain the correct number of records.  If they do not, data is then automatically resorted.  Since sort results are permanently saved, subsequent opening of a database that had previously been resorted, should not result in another sort.  In addition to the changes described above, I decided to add a macro named "Sort Mapunits and Interpretation Results".  A user can run the macro to force map units and interpretation results to be resorted.  There really shouldn\'t be any reason that a user would need to do this, but I added the macro, just in case.  This is a relatively benign process that shouldn\'t ever cause a problem.  The only consequence of needlessly running this macro is slightly increasing the size of the database each time this macro is run.\r\n\r\nItem:  Fixed the Hydric Soils List report so that it no longer fails when it encounters null hydric criteria.\r\n\r\nItem:  We discovered that the Drop Soil Survey Area function fails for larger soil survey areas, due to a lack of system resources.  To fix this problem, data for a survey area is now deleted in multiple steps rather than in one fell swoop.\r\n\r\n1.23 - 07/26/2002\r\nItem:  Changed error logging to write to a file named "ssurgodberr.txt: located in the same directory as the current SSURGO template Access database.  Previous versions of the template logged errors to a file named "nasiserr.txt" in the root directory of the C drive.  This change was made because 1) future CCE (Common Computing Environment) configurations are much more restrictive in regards to which directories are writable and 2) in the past I didn\'t know how to determine the directory in which the current Access database resides.\r\n\r\nItem:  Corrected a logic error in the WinPst data generation function.  A soil with a water table where an initial non-wet layer is followed by one or more wet layers, followed by a non-wet layer, was not being classified as a perched water table.  Prior to fixing this error, the only case in which a water table was classified as perched was when the first soil moisture layer encountered was wet, and a subsequent lower layer was non-wet.\r\n\r\n1.22 - 05/31/2002\r\nItem:  Fixed reports C1 (Range Production) and C2 (Range Production & Plants w/o Forest Understory) to display ecological site names whose ultimate origin is the Ecological Site table in NASIS.  This change should have been made in the previous template version, corresponding to the release of NASIS 5.1.\r\n\r\n1.21 - 05/20/2002\r\n\r\nItem:  Modified function "GetLandforms" and report "Hydric Soils List" in order to improve performance of this report.  The NameCase conversion of the landform string is now performed within the GetLandforms function rather than within the landforms control of the Hydric Soils List report.  Not sure why this makes such a difference, but it does.\r\n\r\nItem:  The spelling of "Gypsum" was corrected in the heading of report "Table J2. - Chemical Properties of the Soils".\r\n\r\nItem:  The soil interpretation staff at the NSSC in Lincoln NE has decided to make some fundamental changes to what interpretation results can be generated in the face of insufficient data.  This change was in response to the issue that under the old paradigm, an interpretation always returned non-null fuzzy values, regardless of how much data was missing or not populated.  Under the new paradigm, an interpretation can be written to return a null fuzzy value in the face of insufficient data, which is then interpreted as "Not Rated".  The actual phrase used to connote "Not Rated" can vary from interpretation to interpretation.\r\n\r\nIn previous versions of the SSURGO template database, the interpretation rating class for components whose kind was "miscellaneous area" was automatically set to "Not Rated", and no reasons were reported for "miscellaneous area" components.  Now, the interpretation rating class is always reported as is, regardless of component kind, and reasons are not displayed only when the main rating class is "Not Rated" (i.e. the value of cointerp.interphr is Null).\r\n\r\nThe interpretation paradigm related changes resulted in changes to the following database objects:\r\n\r\ncointerp (Table) (interpll, interplr, interphr and interphh can now be null)\r\nSubreport - Interp Reasons - Interp 1 (Query)\r\nSubreport - Interp Reasons - Interp 2 (Query)\r\nSubreport - Interp Reasons - Interp 3 (Query)\r\nSubreport - Interp Reasons - Interp 1 (Report)\r\nSubreport - Interp Reasons - Interp 2 (Report)\r\nSubreport - Interp Reasons - Interp 3 (Report)\r\nFormattedInterpReason (Function)\r\nTemplate Interpretation Report - 1 Interpretation (Report)\r\nTemplate Interpretation Report - 2 Interpretations (Report)\r\nTemplate Interpretation Report - 3 Interpretations (Report)\r\nSelected Soil Interpretations (Report)\r\n\r\nItem:  The Component Text and Mapunit Text reports were modified so that mapunit name doesn\'t appear by itself on a page without at least part of the corresponding narrative text.\r\n\r\nItem:  All interpretation reports were modified in order to improve performance.  An interpretation report for an entire soil survey now completes in a reasonable amount of time.  This enhancement resulted in changes to the following database objects:\r\n\r\nSoil Reports (Form)\r\nSubreport - Interp Reasons - Interp 1 (Query)\r\nSubreport - Interp Reasons - Interp 2 (Query)\r\nSubreport - Interp Reasons - Interp 3 (Query)\r\nSubreport - Interp Reasons - Interp 1 (Report)\r\nSubreport - Interp Reasons - Interp 2 (Report)\r\nSubreport - Interp Reasons - Interp 3 (Report)\r\nTemplate Interpretation Report - 1 Interpretation (Report)\r\nTemplate Interpretation Report - 2 Interpretations (Report)\r\nTemplate Interpretation Report - 3 Interpretations (Report)\r\nSelected Soil Interpretations (Report)\r\n\r\nItem:  Report "Selected Soil Interpretations" was split into 3 reports, a 1 interpretation version, a 2 interpretation version and a 3 interpretation version.\r\n\r\nItem:  Included local phase name as part of the component name for report "Component Text".  This was an oversight to begin with.  Every report that prints component name includes the local phase name as part of the component name.\r\n\r\nItem:  Whenever component name/local phase name is printed, local phase name is now printed "as is".  Up to this point, the NameCase function was applied to both component name and local phase name.\r\n\r\nItem:  Added a new report named "RUSLE Related Attributes".\r\n\r\nItem:  Added the capability to drop the data for one or more soil survey areas from the database.  This function may be invoked either by running the macro titled "Drop Soil Survey Area" or by opening the form named "Drop Soil Survey Area".\r\n\r\nOne case where this capability may be of value is when a database currently contains data for more than one soil survey area, and the data for only one of those soil survey areas needs to be updated.  The import process is not currently capable of performing an update, so any existing data for a particular soil survey area must be deleted before updated data for that same soil survey area can be imported.\r\n\r\nIf all of the data in a particular database needs to be updated, it may be easier to simply download a current copy of the blank template database, and then re-import all required data.  The Drop Soil Survey Area process does not reclaim the space occupied by the deleted data, and if data is dropped and reloaded enough times, the size of the database may become an issue.  Of course an existing database can always be compacted by selecting "Database Utilities: Compact Database" from the Tools menu in MS Access.\r\n\r\nItem:  A new "System - Template Database Information" report section titled "Deleting/Updating Data" was added.\r\n\r\nItem:  The template database was synchronized with NASIS data dictionary 5.1.3.  The corresponding SSURGO Static Metadata Version was updated to 2.0.3.\r\n\r\nThere were additions and changes to a number of domains.\r\n\r\nA handful of table and attribute descriptions were corrected or improved.\r\n\r\nThe following columns may now be null:\r\n\r\ncointerp.interpll\r\ncointerp.interplr\r\ncointerp.interphr\r\ncointerp.interphh\r\n\r\nThe data type of the following columns was changed from Integer to Single:\r\n\r\ncoforprod.fprod_l\r\ncoforprod.fprod_r\r\ncoforprod.fprod_h\r\ncoforprodo.fprod_l\r\ncoforprodo.fprod_r\r\ncoforprodo.fprod_h\r\n\r\nThe field size of the following columns was changed:\r\n\r\ncoecoclass.ecoclasstypename:  from 254 to 60\r\ncoecoclass.ecoclassid:  from 248 to 30\r\n\r\nItem:  Updated the contents of tables "SYSTEM - Geomorphic Feature Type" and "SYSTEM - Geomorphic Feature" on 04/23/2002.\r\n\r\n1.20 - 01/09/2002 - Added 2 new reports: "Component Text" and "Mapunit Text".  Each report allows the user to select one or more text kind/text category combinations to be included in the report.  As is the case for all runtime report parameters, available choices are restricted to those that exist for the current soil survey area.\r\n\r\nAdded 2 new tables: "SYSTEM - Geomorphic Feature Type" and "SYSTEM - Geomorphic Feature".  Prior to now, the complete geomorphic feature metadata was not available in the SSURGO template database.\r\n\r\nAdded new function "PluralGeomorphicFeatureName(Geomorphic_Feature_Type_Name, Singular_Geomorphic_Feature_Name).  This function returns the plural form of a geomorphic feature name.\r\n\r\nChanged the export function to not present any options other than directory location.  The export function now produces only SSURGO standard exports of all data that currently resides in the template database.  Note that all data that could previously be exported can still be exported, but there is no longer an option to produce exports where text fields are not delimited with double quotes.  The reasons for doing this are:\r\n\r\n1.  We currently have no known requirement to export data in any other format other than SSURGO format.\r\n2.  We believe that the primary purpose of the export function will be to export data in a field office for the purpose of then importing that data back into an updated version of the template database.  We see no reason to provide options that might: a) confuse users or b) produce an export that cannot be re-imported back into a SSURGO template database or c) produce an import that does not contain all required SSURGO data.\r\n\r\nThe "System - Template Database Information" report section titled "Importing Data" was updated.\r\n\r\nA new "System - Template Database Information" report section titled "Exporting Data" was added.\r\n\r\n1.19 - 11/29/2001 - Modified function WinPst_Create_Data to not abort on null water table depths to top.  In reverse engineering water table information, only records were RV water table depth to top is not null are considered, and RV water table depth to top is now substituted when either water table depth to top low or water table depth to top high is null.\r\n\r\nModified all main forms to display template version in the form title bar.  This was done to make the template version more prominent and easier to find during support calls.\r\n\r\nNumerous changes were made to help make customizing the SSURGO template database easier.  Interpretation reports were modified to be completely table driven.  This required modifications to the design of tables "SYSTEM - Soil Reports" and "SYSTEM - Soil Reports - Interpretations".  A number of new functions were added to retrieve values from these two tables at report generation time.  Other modifications were made to the existing contents of table "SYSTEM - Soil Reports" in order to make existing entries consistent with SSURGO template database customization guidelines.\r\n\r\n1.18 - 10/15/2001 - Made the following minor metadata corrections, not all of which even pertain to SSURGO per se:\r\nDescription for attribute "initial_cooperator_acres_goal" was updated.\r\nDescription for attribute "update_cooperator_acres" was updated.\r\nDescription for domain "soil_survey_area_status" choice "maintenance" was updated.\r\nStatus of domain "taxonomic_subgroup" choice "lithic-ruptic-entic hapludults" was changed from "obsolete" to "current".\r\n\r\n1.17 - 09/19/2001 - Updated SSURGO metadata reports to include metadata version number.  Added new function GetSSURGOStaticMetadataVersion.\r\n\r\n1.16 - 09/12/2001 - Resynchronized with NASIS data dictionary 5.0.17.  SSURGO data dictionary version is now 2.0.2.  There were some domain changes and additions, and some attribute descriptions were updated.\r\n\r\n1.15 - 07/16/2001 - Corrected an error in function WinPst_Create_Data.  Changed all format specifications of "#.#" to "0.0".  With the previous format specification, water table depths of zero were being converted to "." rather than "0.0".\r\n\r\n1.14 - 07/10/2001 - As of NASIS 5.0, plant scientific name is no longer a required field, due to the inclusion of "plants" such as "other annual forbs", etc.  This change was mistakenly not implemented in the SSURGO template database.  Plant scientific name was made nullable in the following tables:\r\n\r\ncocanopycover - Component Canopy Cover\r\ncoeplants - Component Existing Plants\r\ncoforprod - Component Forest Productivity\r\ncopwindbreak - Component Potential Windbreak\r\ncotreestomng - Component Trees to Manage\r\n\r\n1.13 - 06/15/2001 - Added Win-Pst data generation facilities.  The following permanent database objects were added:\r\n\r\nTable: SYSTEM - Win-Pst Data\r\nQuery: Win-Pst - Input\r\nForm: Win-Pst Export\r\nMacro: Win-Pst - Create Data\r\nMacro: Win-Pst - Export\r\nFunction: Win-Pst Functions.WinPst_Create_Data\r\nFunction: Win-Pst Functions.WinPst_Export\r\n\r\n1.12 - 05/22/2001 - Report "Hydric Soils List" was added.\r\n\r\nReport "Soil Component Legend" was renamed "Component Legend" and reformatted to be more consistent with other reports.\r\n\r\nThe display order of the non-manuscript reports in the Soil Reports form "Select Report" combo box list was changed.\r\n\r\nThe closing and reopening of form "Soil Reports" when importing data was changed to occur only after data has been successfully imported.\r\n\r\n1.11 - 04/25/2001 - Report "MANU - Table A1 - Acres by County (2 or 3 counties)" was modified to always append a state alpha FIPS code to the county name.  Situations exist where a soil survey crosses a state boundary and includes two counties with the same name.  To implement this change, new function "GetCountyOrParishState" was added.\r\n\r\nThe function "NameCase" was modified to also capitalize any letter following a dash.\r\n\r\nForm "Soil Reports" was modified such that when a user selects a report that requires parameters, the caption of button cmdGenerateReport is changed to "Select Parameters".  The value of "SYSTEM - Template Database Information.Item Narrative", where "SYSTEM - Template Database Information.Item Name" = "Generating Reports", was updated to reflect this change.\r\n\r\n1.10 - 04/18/2001 - Fixed problem with report MANU - Table K1 - Water Features where water table information was not printing for months that had no flooding or ponding.  This fix required a change to query "Subreport - Table K1 - Water Features - Subquery" such that the selection criteria for selecting "Subreport - Table K1 - Water Features - Water Table - Months.month" was independent of all other selection criteria.\r\n\r\nNew report "Soil Component Legend" was added.\r\n\r\n1.9 - 04/10/2001 - Changed startup and import procedures as follows:\r\nOn startup, if database is empty, the Import form is displayed.\r\nOn startup, if database is not empty, the Soil Reports form is displayed.\r\n(The autoexec macro now calls new function StartUp, rather than always opening the\r\nSoil Reports form.)\r\nThe Import main function now closes the Soil Reports form before the import process begins, and then reopens the Soil Reports form after the import process has completed.  This means that the Soil Reports form now always reflects the current contents of the database, immediately after an import.\r\n\r\n1.8 - 03/15/2001 - Made the following modifications to improve performance of soil interpretation related reports:\r\nEstablished primary key for table "SYSTEM - Selected Mapunit Keys".\r\nEstablished duplicate index on column "depthseq" for table "SYSTEM - Interp Depth Sequence".\r\nEstablished duplicate index on column "mrulename" for table "cointerp".\r\nEstablished duplicate index on column "ruledepth" for table "cointerp".\r\nModified design of the following queries:\r\n"Subreport - Interp Reasons - Interp 1"\r\n"Subreport - Interp Reasons - Interp 2"\r\n"Subreport - Interp Reasons - Interp 3"\r\n\r\n1.7 - 03/12/2001 - Because SSURGO Version 2 downloads need to be generated prior to the conversion of the Component Potential Ecosystem table, the SSURGO Version 2 export was reset to export from the Component Potential Ecosystem table rather than from the Component Ecological Site and Component Other Vegetative Classification tables.  Due to this change, the criteria for "ecoclasstypename" in query "Subreport - Rangeland Productivity - Eco Site - Subquery" was changed from "NRCS Rangeland Site" to "Range site".\r\n\r\n1.6 - 03/08/2001 - All references to SSURGO 2000 were changed to SSURGO version 2.  Import main routine was modified to expect "SSURGOV2" in file version.txt.  The functions "permanent_database_create_main" and "permanent_database_drop_main" were removed from module "Mains and Miscellaneous" in order to avoid compile error messages when converting database between Access versions.\r\n\r\n1.5 - 02/20/2001 - In MUSymCompare changed integer1 and integer2 from "Integer" to "Long", since numeric map unit symbols may exceed 32768.\r\n\r\n1.4 - 02/05/2001 - Modified database to sort data immediately after importing rather than\r\nwhen the Soil Reports form is opened.\r\n\r\n1.3 - 02/01/2001 - Resynchronized with NASIS data dictionary version 5.0.15.\r\n\r\n1.2 - 01/29/2001 - Column label for muaggatt.flodfreqmax changed from "Flooding Frequence - Maximum" to "Flooding Frequency - Maximum".\r\n\r\n1.1 - 01/17/2001 - Modified interpretation reason subreport queries and subreports and added a new function (FormattedInterpretationReason) so that interpretation reason fuzzy values will be properly formatted on reports.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'Template Database Security/Customization', 13, NULL, E'This database has not been secured in any way.  Therefore there is no security to prevent the deletion or modification of any existing database object (table, query, form, report, macro or module).  Because so many database objects are referenced from multiple locations, deleting or modifying an existing database object may result in the unanticipated disabling of certain database objects or functions.\r\n\r\nIf you want to alter or customize this database, we suggest that you do so by always creating new database objects.  Of course you can always make a copy of an existing object, and give it a different name, in order to modify an existing database object.  A document is available that describes recommended practices when customizing this database.  This document can be downloaded from the following web page:\r\n\r\nhttp://nasis.nrcs.usda.gov/downloads/\r\n\r\nAt the top of this page, select the link for SSURGO related downloads.  Then select the link titled â€œDownload SSURGO Template Database Customization Guide (zipped Word document)â€.\r\n\r\nBefore you commit to making a lot of customizations, please keep in mind that this SSURGO template database is frequently updated and enhanced.  See the system report titled â€œTemplate Database Change Historyâ€ for the gory details.  If you want to keep relatively current with the latest version of the template database, you will be responsible for reapplying your customizations to new versions of the template database.');
INSERT INTO "SYSTEM - Template Database Information" ("Item Name", "Item Sequence", "Item Value", "Item Narrative") VALUES (E'Template Database Version', 12, E'33', E'The template database version is the overall version of ALL tables, queries, forms, reports, macros and modules in the underlying MS Access template database.  Although there is always a new template database version when something changes in the SSURGO standard, the template database version can also change when nothing in the SSURGO standard has changed.  In fact, the template database version changes much more frequently than the SSURGO version does.\r\n\r\nThis MS Access template database is just one of a number of possible alternatives for delivering SSURGO data.  This database implementation is not part of the SSURGO standard, per se.\r\n\r\nWhen corrections or enhancements are made to this database, the template database version is always updated.  The system report â€œTemplate Database Change Historyâ€ records the changes associated with a particular template database version.');
